(window.webpackJsonp=window.webpackJsonp||[]).push([[78],{SCyt:function(e){e.exports=[{id:1,type:"  opentelekomcloud_antiddos_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"enable_l7",description:'<li><p><a name="enable_l7"></a><a href="#enable_l7"><code>enable_l7</code></a> - <strong>(Required)</strong> Specifies whether to enable L7 defense.</p>\n</li>',elementType:"li",listDepth:1},{name:"traffic_pos_id",description:'<li><p><a name="traffic_pos_id"></a><a href="#traffic_pos_id"><code>traffic_pos_id</code></a> - <strong>(Required)</strong> The position ID of traffic. The value ranges from 1 to 9.</p>\n</li>',elementType:"li",listDepth:1},{name:"http_request_pos_id",description:'<li><p><a name="http_request_pos_id"></a><a href="#http_request_pos_id"><code>http_request_pos_id</code></a> - <strong>(Required)</strong> The position ID of number of HTTP requests. The value ranges from 1 to 15.</p>\n</li>',elementType:"li",listDepth:1},{name:"cleaning_access_pos_id",description:'<li><p><a name="cleaning_access_pos_id"></a><a href="#cleaning_access_pos_id"><code>cleaning_access_pos_id</code></a> - <strong>(Required)</strong>The position ID of access limit during cleaning. The value ranges from 1 to 8.</p>\n</li>',elementType:"li",listDepth:1},{name:"app_type_id",description:'<li><p><a name="app_type_id"></a><a href="#app_type_id"><code>app_type_id</code></a> - <strong>(Required)</strong> The application type ID.</p>\n</li>',elementType:"li",listDepth:1},{name:"floating_ip_id",description:'<li><p><a name="floating_ip_id"></a><a href="#floating_ip_id"><code>floating_ip_id</code></a> - <strong>(Required)</strong> The ID corresponding to the Elastic IP Address (EIP) of a user.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/antiddos_v1.html",docType:""},{id:2,type:"  opentelekomcloud_as_configuration_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"scaling_configuration_name",description:'<li><p><a name="scaling_configuration_name"></a><a href="#scaling_configuration_name"><code>scaling_configuration_name</code></a> - <strong>(Required)</strong> The name of the AS configuration. The name can contain letters,\ndigits, underscores(_), and hyphens(-), and cannot exceed 64 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"instance_config",description:'<li><p><a name="instance_config"></a><a href="#instance_config"><code>instance_config</code></a> - <strong>(Required)</strong> The information about instance configurations. The instance_config\ndictionary data structure is documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>instance_config</code> block supports:</p>",elementType:"p"},{name:"instance_id",description:'<li><p><a name="instance_id"></a><a href="#instance_id"><code>instance_id</code></a> - <strong>(Optional)</strong> When using the existing instance specifications as the template to\ncreate AS configurations, specify this argument. In this case, flavor, image,\nand disk arguments do not take effect. If the instance_id argument is not specified,\nflavor, image, and disk arguments are mandatory.</p>\n</li>',elementType:"li",listDepth:1},{name:"flavor",description:'<li><p><a name="flavor"></a><a href="#flavor"><code>flavor</code></a> - <strong>(Optional)</strong> The flavor ID.</p>\n</li>',elementType:"li",listDepth:1},{name:"image",description:'<li><p><a name="image"></a><a href="#image"><code>image</code></a> - <strong>(Optional)</strong> The image ID.</p>\n</li>',elementType:"li",listDepth:1},{name:"disk",description:'<li><p><a name="disk"></a><a href="#disk"><code>disk</code></a> - <strong>(Optional)</strong> The disk group information. System disks are mandatory and data disks are optional.\nThe dick structure is described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"key_name",description:'<li><p><a name="key_name"></a><a href="#key_name"><code>key_name</code></a> - <strong>(Required)</strong> The name of the SSH key pair used to log in to the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"user_data",description:'<li><p><a name="user_data"></a><a href="#user_data"><code>user_data</code></a> - <strong>(Optional)</strong> The user data to provide when launching the instance.\nThe file content must be encoded with Base64.</p>\n</li>',elementType:"li",listDepth:1},{name:"personality",description:'<li><p><a name="personality"></a><a href="#personality"><code>personality</code></a> - <strong>(Optional)</strong> Customize the personality of an instance by\ndefining one or more files and their contents. The personality structure\nis described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"public_ip",description:'<li><p><a name="public_ip"></a><a href="#public_ip"><code>public_ip</code></a> - <strong>(Optional)</strong> The elastic IP address of the instance. The public_ip structure\nis described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"metadata",description:'<li><p><a name="metadata"></a><a href="#metadata"><code>metadata</code></a> - <strong>(Optional)</strong> Metadata key/value pairs to make available from\nwithin the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>disk</code> block supports:</p>",elementType:"p"},{name:"size",description:'<li><p><a name="size"></a><a href="#size"><code>size</code></a> - <strong>(Required)</strong> The disk size. The unit is GB. The system disk size ranges from 40 to 32768,\nand the data disk size ranges from 10 to 32768.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_type",description:'<li><p><a name="volume_type"></a><a href="#volume_type"><code>volume_type</code></a> - <strong>(Required)</strong> The disk type, which must be the same as the disk type available in the system.\nThe options include <code>SATA</code> (common I/O disk type) and <code>SSD</code> (ultra-high I/O disk type).</p>\n</li>',elementType:"li",listDepth:1},{name:"disk_type",description:'<li><p><a name="disk_type"></a><a href="#disk_type"><code>disk_type</code></a> - <strong>(Required)</strong> Whether the disk is a system disk or a data disk. Option <code>DATA</code> indicates\na data disk. option <code>SYS</code> indicates a system disk.</p>\n</li>',elementType:"li",listDepth:1},{name:"kms_id",description:'<li><p><a name="kms_id"></a><a href="#kms_id"><code>kms_id</code></a> - <strong>(Optional)</strong> The Encryption KMS ID of the data disk.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>personality</code> block supports:</p>",elementType:"p"},{name:"path",description:'<li><p><a name="path"></a><a href="#path"><code>path</code></a> - <strong>(Required)</strong> The absolute path of the destination file.</p>\n</li>',elementType:"li",listDepth:1},{name:"contents",description:'<li><p><a name="contents"></a><a href="#contents"><code>contents</code></a> - <strong>(Required)</strong> The content of the injected file, which must be encoded with base64.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>public_ip</code> block supports:</p>",elementType:"p"},{name:"eip",description:"<strong>(Required)</strong> The configuration parameter for creating an elastic IP address\nthat will be automatically assigned to the instance. The eip structure is described below.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>eip</code> block supports:</p>",elementType:"p"},{name:"ip_type",description:'<li><p><a name="ip_type"></a><a href="#ip_type"><code>ip_type</code></a> - <strong>(Required)</strong> The IP address type. The system only supports <code>5_bgp</code> (indicates dynamic BGP).</p>\n</li>',elementType:"li",listDepth:1},{name:"bandwidth",description:'<li><p><a name="bandwidth"></a><a href="#bandwidth"><code>bandwidth</code></a> - <strong>(Required)</strong> The bandwidth information. The structure is described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>bandwidth</code> block supports:</p>",elementType:"p"},{name:"size",description:'<li><p><a name="size-1"></a><a href="#size-1"><code>size</code></a> - <strong>(Required)</strong> The bandwidth (Mbit/s). The value range is 1 to 300.</p>\n</li>',elementType:"li",listDepth:1},{name:"share_type",description:'<li><p><a name="share_type"></a><a href="#share_type"><code>share_type</code></a> - <strong>(Required)</strong> The bandwidth sharing type. The system only supports <code>PER</code> (indicates exclusive bandwidth).</p>\n</li>',elementType:"li",listDepth:1},{name:"charging_mode",description:'<li><p><a name="charging_mode"></a><a href="#charging_mode"><code>charging_mode</code></a> - <strong>(Required)</strong> The bandwidth charging mode. The system only supports <code>traffic</code>.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/as_configuration_v1.html",docType:""},{id:3,type:"  opentelekomcloud_as_group_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"scaling_group_name",description:'<li><p><a name="scaling_group_name"></a><a href="#scaling_group_name"><code>scaling_group_name</code></a> - <strong>(Required)</strong> The name of the scaling group. The name can contain letters,\ndigits, underscores(_), and hyphens(-),and cannot exceed 64 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"scaling_configuration_id",description:'<li><p><a name="scaling_configuration_id"></a><a href="#scaling_configuration_id"><code>scaling_configuration_id</code></a> - <strong>(Optional)</strong> The configuration ID which defines\nconfigurations of instances in the AS group.</p>\n</li>',elementType:"li",listDepth:1},{name:"desire_instance_number",description:'<li><p><a name="desire_instance_number"></a><a href="#desire_instance_number"><code>desire_instance_number</code></a> - <strong>(Optional)</strong> The expected number of instances. The default\nvalue is the minimum number of instances. The value ranges from the minimum number of\ninstances to the maximum number of instances.</p>\n</li>',elementType:"li",listDepth:1},{name:"min_instance_number",description:'<li><p><a name="min_instance_number"></a><a href="#min_instance_number"><code>min_instance_number</code></a> - <strong>(Optional)</strong> The minimum number of instances.\nThe default value is 0.</p>\n</li>',elementType:"li",listDepth:1},{name:"max_instance_number",description:'<li><p><a name="max_instance_number"></a><a href="#max_instance_number"><code>max_instance_number</code></a> - <strong>(Optional)</strong> The maximum number of instances.\nThe default value is 0.</p>\n</li>',elementType:"li",listDepth:1},{name:"cool_down_time",description:'<li><p><a name="cool_down_time"></a><a href="#cool_down_time"><code>cool_down_time</code></a> - <strong>(Optional)</strong> The cooling duration (in seconds). The value ranges\nfrom 0 to 86400, and is 900 by default.</p>\n</li>',elementType:"li",listDepth:1},{name:"lb_listener_id",description:'<li><p><a name="lb_listener_id"></a><a href="#lb_listener_id"><code>lb_listener_id</code></a> - <strong>(Optional)</strong> The ELB listener IDs. The system supports up to\nthree ELB listeners, the IDs of which are separated using a comma (,).</p>\n</li>',elementType:"li",listDepth:1},{name:"lbaas_listeners",description:'<li><p><a name="lbaas_listeners"></a><a href="#lbaas_listeners"><code>lbaas_listeners</code></a> - <strong>(Optional)</strong> An array of one or more enhanced load balancer.\nThe system supports the binding of up to three load balancers. The field is\nalternative to lb_listener_id.  The lbaas_listeners object structure is\ndocumented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"available_zones",description:'<li><p><a name="available_zones"></a><a href="#available_zones"><code>available_zones</code></a> - <strong>(Optional)</strong> The availability zones in which to create\nthe instances in the autoscaling group.</p>\n</li>',elementType:"li",listDepth:1},{name:"networks",description:'<li><p><a name="networks"></a><a href="#networks"><code>networks</code></a> - <strong>(Required)</strong> An array of one or more network IDs.\nThe system supports up to five networks. The networks object structure\nis documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_groups",description:'<li><p><a name="security_groups"></a><a href="#security_groups"><code>security_groups</code></a> - <strong>(Required)</strong> An array of one or more security group IDs\nto associate with the group. The security_groups object structure is\ndocumented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"vpc_id",description:'<li><p><a name="vpc_id"></a><a href="#vpc_id"><code>vpc_id</code></a> - <strong>(Required)</strong> The VPC ID. Changing this creates a new group.</p>\n</li>',elementType:"li",listDepth:1},{name:"health_periodic_audit_method",description:'<li><p><a name="health_periodic_audit_method"></a><a href="#health_periodic_audit_method"><code>health_periodic_audit_method</code></a> - <strong>(Optional)</strong> The health check method for instances\nin the AS group. The health check methods include <code>ELB_AUDIT</code> and <code>NOVA_AUDIT</code>.\nIf load balancing is configured, the default value of this parameter is <code>ELB_AUDIT</code>.\nOtherwise, the default value is <code>NOVA_AUDIT</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"health_periodic_audit_time",description:'<li><p><a name="health_periodic_audit_time"></a><a href="#health_periodic_audit_time"><code>health_periodic_audit_time</code></a> - <strong>(Optional)</strong> The health check period for instances.\nThe period has four options: 5 minutes (default), 15 minutes, 60 minutes, and 180 minutes.</p>\n</li>',elementType:"li",listDepth:1},{name:"instance_terminate_policy",description:'<li><p><a name="instance_terminate_policy"></a><a href="#instance_terminate_policy"><code>instance_terminate_policy</code></a> - <strong>(Optional)</strong> The instance removal policy. The policy has\nfour options: <code>OLD_CONFIG_OLD_INSTANCE</code> (default), <code>OLD_CONFIG_NEW_INSTANCE</code>,\n<code>OLD_INSTANCE</code>, and <code>NEW_INSTANCE</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"notifications",description:'<li><p><a name="notifications"></a><a href="#notifications"><code>notifications</code></a> - <strong>(Optional)</strong> The notification mode. The system only supports <code>EMAIL</code>\nmode which refers to notification by email.</p>\n</li>',elementType:"li",listDepth:1},{name:"delete_publicip",description:'<li><p><a name="delete_publicip"></a><a href="#delete_publicip"><code>delete_publicip</code></a> - <strong>(Optional)</strong> Whether to delete the elastic IP address bound to the\ninstances of AS group when deleting the instances. The options are <code>true</code> and <code>false</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"delete_instances",description:'<li><p><a name="delete_instances"></a><a href="#delete_instances"><code>delete_instances</code></a> - <strong>(Optional)</strong> Whether to delete the instances in the AS group\nwhen deleting the AS group. The options are <code>yes</code> and <code>no</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>networks</code> block supports:</p>",elementType:"p"},{name:"id",description:"<strong>(Required)</strong> The network UUID.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>security_groups</code> block supports:</p>",elementType:"p"},{name:"id",description:"<strong>(Required)</strong> The UUID of the security group.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/as_group_v1.html",docType:""},{id:4,type:"  opentelekomcloud_as_policy_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"scaling_policy_name",description:'<li><p><a name="scaling_policy_name"></a><a href="#scaling_policy_name"><code>scaling_policy_name</code></a> - <strong>(Required)</strong> The name of the AS policy. The name can contain letters,\ndigits, underscores(_), and hyphens(-),and cannot exceed 64 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"scaling_group_id",description:'<li><p><a name="scaling_group_id"></a><a href="#scaling_group_id"><code>scaling_group_id</code></a> - <strong>(Required)</strong> The AS group ID. Changing this creates a new AS policy.</p>\n</li>',elementType:"li",listDepth:1},{name:"scaling_policy_type",description:'<li><p><a name="scaling_policy_type"></a><a href="#scaling_policy_type"><code>scaling_policy_type</code></a> - <strong>(Required)</strong> The AS policy type. The values can be <code>ALARM</code>, <code>SCHEDULED</code>,\nand <code>RECURRENCE</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"alarm_id",description:'<li><p><a name="alarm_id"></a><a href="#alarm_id"><code>alarm_id</code></a> - <strong>(Optional)</strong> The alarm rule ID. This argument is mandatory\nwhen <code>scaling_policy_type</code> is set to <code>ALARM</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"scheduled_policy",description:'<li><p><a name="scheduled_policy"></a><a href="#scheduled_policy"><code>scheduled_policy</code></a> - <strong>(Optional)</strong> The periodic or scheduled AS policy. This argument is mandatory\nwhen <code>scaling_policy_type</code> is set to <code>SCHEDULED</code> or <code>RECURRENCE</code>. The scheduled_policy structure\nis documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"scaling_policy_action",description:'<li><p><a name="scaling_policy_action"></a><a href="#scaling_policy_action"><code>scaling_policy_action</code></a> - <strong>(Optional)</strong> The action of the AS policy. The scaling_policy_action\nstructure is documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"cool_down_time",description:'<li><p><a name="cool_down_time"></a><a href="#cool_down_time"><code>cool_down_time</code></a> - <strong>(Optional)</strong> The cooling duration (in seconds), and is 900 by default.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>scheduled_policy</code> block supports:</p>",elementType:"p"},{name:"launch_time",description:'<li><p><a name="launch_time"></a><a href="#launch_time"><code>launch_time</code></a> - <strong>(Required)</strong> The time when the scaling action is triggered. If <code>scaling_policy_type</code>\nis set to <code>SCHEDULED</code>, the time format is YYYY-MM-DDThh:mmZ. If <code>scaling_policy_type</code> is set to\n<code>RECURRENCE</code>, the time format is hh:mm.</p>\n</li>',elementType:"li",listDepth:1},{name:"recurrence_type",description:'<li><p><a name="recurrence_type"></a><a href="#recurrence_type"><code>recurrence_type</code></a> - <strong>(Optional)</strong> The periodic triggering type. This argument is mandatory when\n<code>scaling_policy_type</code> is set to <code>RECURRENCE</code>. The options include <code>Daily</code>, <code>Weekly</code>, and <code>Monthly</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"recurrence_value",description:'<li><p><a name="recurrence_value"></a><a href="#recurrence_value"><code>recurrence_value</code></a> - <strong>(Optional)</strong> The frequency at which scaling actions are triggered.</p>\n</li>',elementType:"li",listDepth:1},{name:"start_time",description:'<li><p><a name="start_time"></a><a href="#start_time"><code>start_time</code></a> - <strong>(Optional)</strong> The start time of the scaling action triggered periodically.\nThe time format complies with UTC. The current time is used by default. The time\nformat is YYYY-MM-DDThh:mmZ.</p>\n</li>',elementType:"li",listDepth:1},{name:"end_time",description:'<li><p><a name="end_time"></a><a href="#end_time"><code>end_time</code></a> - <strong>(Optional)</strong> The end time of the scaling action triggered periodically.\nThe time format complies with UTC. This argument is mandatory when <code>scaling_policy_type</code>\nis set to <code>RECURRENCE</code>. The time format is YYYY-MM-DDThh:mmZ.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>scaling_policy_action</code> block supports:</p>",elementType:"p"},{name:"operation",description:'<li><p><a name="operation"></a><a href="#operation"><code>operation</code></a> - <strong>(Optional)</strong> The operation to be performed. The options include <code>ADD</code> (default), <code>REMOVE</code>,\nand <code>SET</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"instance_number",description:'<li><p><a name="instance_number"></a><a href="#instance_number"><code>instance_number</code></a> - <strong>(Optional)</strong> The number of instances to be operated. The default number is 1.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/as_policy_v1.html",docType:""},{id:5,type:"  opentelekomcloud_blockstorage_volume_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"size",description:'<li><p><a name="size"></a><a href="#size"><code>size</code></a> - <strong>(Required)</strong> The size of the volume to create (in gigabytes). Changing\nthis creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"availability_zone",description:'<li><p><a name="availability_zone"></a><a href="#availability_zone"><code>availability_zone</code></a> - <strong>(Optional)</strong> The availability zone for the volume.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"consistency_group_id",description:'<li><p><a name="consistency_group_id"></a><a href="#consistency_group_id"><code>consistency_group_id</code></a> - <strong>(Optional)</strong> The consistency group to place the volume\nin.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the volume. Changing this updates\nthe volume\'s description.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_id",description:'<li><p><a name="image_id"></a><a href="#image_id"><code>image_id</code></a> - <strong>(Optional)</strong> The image ID from which to create the volume.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="metadata"></a><a href="#metadata"><code>metadata</code></a> - (Optional) Metadata key/value pairs to associate with the volume.\nChanging this updates the existing volume metadata.\nThe EVS encryption capability with KMS key can be set with the following parameters:</p>',elementType:"p"},{name:"__system__encrypted",description:"The default value is set to '0', which means\nthe volume is not encrypted, the value '1' indicates volume is encrypted.\n",elementType:"li",listDepth:2},{name:"__system__cmkid",description:"<strong>(Optional)</strong> The ID of the kms key.\n",elementType:"li",listDepth:2},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> Tags key/value pairs to associate with the volume.\nChanging this updates the existing volume tags.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> A unique name for the volume. Changing this updates the\nvolume\'s name.</p>\n</li>',elementType:"li",listDepth:1},{name:"snapshot_id",description:'<li><p><a name="snapshot_id"></a><a href="#snapshot_id"><code>snapshot_id</code></a> - <strong>(Optional)</strong> The snapshot ID from which to create the volume.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"source_replica",description:'<li><p><a name="source_replica"></a><a href="#source_replica"><code>source_replica</code></a> - <strong>(Optional)</strong> The volume ID to replicate with.</p>\n</li>',elementType:"li",listDepth:1},{name:"source_vol_id",description:'<li><p><a name="source_vol_id"></a><a href="#source_vol_id"><code>source_vol_id</code></a> - <strong>(Optional)</strong> The volume ID from which to create the volume.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_type",description:'<li><p><a name="volume_type"></a><a href="#volume_type"><code>volume_type</code></a> - <strong>(Optional)</strong> The type of volume to create.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"device_type",description:'<li><p><a name="device_type"></a><a href="#device_type"><code>device_type</code></a> - <strong>(Optional)</strong> The device type of volume to create. Valid options are VBD and SCSI.\nDefaults to VBD. Changing this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"cascade",description:'<li><p><a name="cascade"></a><a href="#cascade"><code>cascade</code></a> - (Optional, Default:false) Specifies to delete all snapshots associated with the EVS disk.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/blockstorage_volume_v2.html",docType:""},{id:6,type:"  opentelekomcloud_evs_volume_v3",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"availability_zone",description:'<li><p><a name="availability_zone"></a><a href="#availability_zone"><code>availability_zone</code></a> - <strong>(Required)</strong> The availability zone for the volume.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_type",description:'<li><p><a name="volume_type"></a><a href="#volume_type"><code>volume_type</code></a> - <strong>(Required)</strong> The type of volume to create.\nCurrently, the value can be SSD, SAS, SATA, co-p1, or uh-l1.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> A unique name for the volume. Changing this updates the\nvolume\'s name.</p>\n</li>',elementType:"li",listDepth:1},{name:"size",description:'<li><p><a name="size"></a><a href="#size"><code>size</code></a> - <strong>(Optional)</strong> The size of the volume to create (in gigabytes). This parameter is mandatory\nwhen you create an empty EVS disk or use an image or a snapshot to create an EVS disk.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the volume. Changing this updates\nthe volume\'s description.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_id",description:'<li><p><a name="image_id"></a><a href="#image_id"><code>image_id</code></a> - <strong>(Optional)</strong> The image ID from which to create the volume.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"backup_id",description:'<li><p><a name="backup_id"></a><a href="#backup_id"><code>backup_id</code></a> - <strong>(Optional)</strong> The backup ID from which to create the volume.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"snapshot_id",description:'<li><p><a name="snapshot_id"></a><a href="#snapshot_id"><code>snapshot_id</code></a> - <strong>(Optional)</strong> The snapshot ID from which to create the volume.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> Tags key/value pairs to associate with the volume.\nChanging this updates the existing volume tags.</p>\n</li>',elementType:"li",listDepth:1},{name:"multiattach",description:'<li><p><a name="multiattach"></a><a href="#multiattach"><code>multiattach</code></a> - (Optional, Default:false) Specifies the shared EVS disk information.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"cascade",description:'<li><p><a name="cascade"></a><a href="#cascade"><code>cascade</code></a> - (Optional, Default:false) Specifies to delete all snapshots associated with the EVS disk.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/evs_volume_v3.html",docType:""},{id:7,type:"  opentelekomcloud_cce_cluster_v3",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> Cluster name. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"labels",description:'<li><p><a name="labels"></a><a href="#labels"><code>labels</code></a> - <strong>(Optional)</strong> Cluster tag, key/value pair format. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"annotations",description:'<li><p><a name="annotations"></a><a href="#annotations"><code>annotations</code></a> - <strong>(Optional)</strong> Cluster annotation, key/value pair format. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="flavor_id"></a><a href="#flavor_id"><code>flavor_id</code></a> - (Required) Cluster specifications. Changing this parameter will create a new cluster resource.</p>',elementType:"p"},{name:"cce.s1.small",description:"small-scale single cluster (up to 50 nodes).\n",elementType:"li",listDepth:2},{name:"cce.s1.medium",description:"medium-scale single cluster (up to 200 nodes).\n",elementType:"li",listDepth:2},{name:"cce.s1.large",description:"large-scale single cluster (up to 1000 nodes).\n",elementType:"li",listDepth:2},{name:"cce.s2.small",description:"small-scale HA cluster (up to 50 nodes).\n",elementType:"li",listDepth:2},{name:"cce.s2.medium",description:"medium-scale HA cluster (up to 200 nodes).\n",elementType:"li",listDepth:2},{name:"cce.s2.large",description:"large-scale HA cluster (up to 1000 nodes).\n",elementType:"li",listDepth:2},{name:"cce.t1.small",description:"small-scale single physical machine cluster (up to 10 nodes).\n",elementType:"li",listDepth:2},{name:"cce.t1.medium",description:"medium-scale single physical machine cluster (up to 100 nodes).\n",elementType:"li",listDepth:2},{name:"cce.t1.large",description:"large-scale single physical machine cluster (up to 500 nodes).\n",elementType:"li",listDepth:2},{name:"cce.t2.small",description:"small-scale HA physical machine cluster (up to 10 nodes).\n",elementType:"li",listDepth:2},{name:"cce.t2.medium",description:"medium-scale HA physical machine cluster (up to 100 nodes).\n",elementType:"li",listDepth:2},{name:"cce.t2.large",description:"large-scale HA physical machine cluster (up to 500 nodes).\n",elementType:"li",listDepth:2},{name:"cluster_version",description:'<li><p><a name="cluster_version"></a><a href="#cluster_version"><code>cluster_version</code></a> - <strong>(Optional)</strong> For the cluster version, possible values are v1.9.2-r2 or v1.11.3-r1. Changing this parameter will create a new cluster resource.\n<a href="https://docs.otc.t-systems.com/en-us/api2/cce/cce_02_0236.html">OTC-API</a></p>\n</li>',elementType:"li",listDepth:1},{name:"cluster_type",description:'<li><p><a name="cluster_type"></a><a href="#cluster_type"><code>cluster_type</code></a> - <strong>(Required)</strong> Cluster Type, possible values are VirtualMachine and BareMetal. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Cluster description.</p>\n</li>',elementType:"li",listDepth:1},{name:"billing_mode",description:'<li><p><a name="billing_mode"></a><a href="#billing_mode"><code>billing_mode</code></a> - <strong>(Optional)</strong> Charging mode of the cluster, which is 0 (on demand). Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"extend_param",description:'<li><p><a name="extend_param"></a><a href="#extend_param"><code>extend_param</code></a> - <strong>(Optional)</strong> Extended parameter. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"vpc_id",description:'<li><p><a name="vpc_id"></a><a href="#vpc_id"><code>vpc_id</code></a> - <strong>(Required)</strong> The ID of the VPC used to create the node. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"subnet_id",description:'<li><p><a name="subnet_id"></a><a href="#subnet_id"><code>subnet_id</code></a> - <strong>(Required)</strong> The ID of the subnet used to create the node. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"highway_subnet_id",description:'<li><p><a name="highway_subnet_id"></a><a href="#highway_subnet_id"><code>highway_subnet_id</code></a> - <strong>(Optional)</strong> The ID of the high speed network used to create bare metal nodes. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="container_network_type"></a><a href="#container_network_type"><code>container_network_type</code></a> - (Required) Container network type.</p>',elementType:"p"},{name:"overlay_l2",description:"An overlay_l2 network built for containers by using Open vSwitch(OVS)\n",elementType:"li",listDepth:2},{name:"underlay_ipvlan",description:"An underlay_ipvlan network built for bare metal servers by using ipvlan.\n",elementType:"li",listDepth:2},{name:"vpc-router",description:"An vpc-router network built for containers by using ipvlan and custom VPC routes.\n",elementType:"li",listDepth:2},{name:"container_network_cidr",description:'<li><p><a name="container_network_cidr"></a><a href="#container_network_cidr"><code>container_network_cidr</code></a> - <strong>(Optional)</strong> Container network segment. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"authentication_mode",description:'<li><p><a name="authentication_mode"></a><a href="#authentication_mode"><code>authentication_mode</code></a> - <strong>(Optional)</strong> Authentication mode of the cluster, possible values are x509 and rbac. Defaults to x509.\nChanging this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"multi_az",description:'<li><p><a name="multi_az"></a><a href="#multi_az"><code>multi_az</code></a> - <strong>(Optional)</strong> Enable multiple AZs for the cluster, only when using HA flavors. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"eip",description:'<li><p><a name="eip"></a><a href="#eip"><code>eip</code></a> - <strong>(Optional)</strong> EIP address of the cluster. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/cce_cluster_v3.html",docType:""},{id:8,type:"  opentelekomcloud_cce_node_v3",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"cluster_id",description:'<li><p><a name="cluster_id"></a><a href="#cluster_id"><code>cluster_id</code></a> - <strong>(Required)</strong> ID of the cluster. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"billing_mode",description:'<li><p><a name="billing_mode"></a><a href="#billing_mode"><code>billing_mode</code></a> - <strong>(Optional)</strong> Node\'s billing mode: The value is 0 (on demand). Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> Node Name.</p>\n</li>',elementType:"li",listDepth:1},{name:"labels",description:'<li><p><a name="labels"></a><a href="#labels"><code>labels</code></a> - <strong>(Optional)</strong> Node tag, key/value pair format. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"annotations",description:'<li><p><a name="annotations"></a><a href="#annotations"><code>annotations</code></a> - <strong>(Optional)</strong> Node annotation, key/value pair format. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"flavor_id",description:'<li><p><a name="flavor_id"></a><a href="#flavor_id"><code>flavor_id</code></a> - <strong>(Required)</strong> Specifies the flavor id. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"availability_zone",description:'<li><p><a name="availability_zone"></a><a href="#availability_zone"><code>availability_zone</code></a> - <strong>(Required)</strong> specify the name of the available partition (AZ). Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"key_pair",description:'<li><p><a name="key_pair"></a><a href="#key_pair"><code>key_pair</code></a> - <strong>(Required)</strong> Key pair name when logging in to select the key pair mode. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"eip_ids",description:'<li><p><a name="eip_ids"></a><a href="#eip_ids"><code>eip_ids</code></a> - <strong>(Optional)</strong> List of existing elastic IP IDs. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p><strong>Note:</strong>\nIf the eip_ids parameter is configured, you do not need to configure the eip_count and bandwidth parameters: iptype, charge_mode, bandwidth_size and share_type.</p>",elementType:"p"},{name:"eip_count",description:'<li><p><a name="eip_count"></a><a href="#eip_count"><code>eip_count</code></a> - <strong>(Optional)</strong> Number of elastic IPs to be dynamically created. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"iptype",description:'<li><p><a name="iptype"></a><a href="#iptype"><code>iptype</code></a> - <strong>(Required)</strong> Elastic IP type.</p>\n</li>',elementType:"li",listDepth:1},{name:"bandwidth_charge_mode",description:'<li><p><a name="bandwidth_charge_mode"></a><a href="#bandwidth_charge_mode"><code>bandwidth_charge_mode</code></a> - <strong>(Optional)</strong> Bandwidth billing type. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"sharetype",description:'<li><p><a name="sharetype"></a><a href="#sharetype"><code>sharetype</code></a> - <strong>(Required)</strong> Bandwidth sharing type. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"bandwidth_size",description:'<li><p><a name="bandwidth_size"></a><a href="#bandwidth_size"><code>bandwidth_size</code></a> - <strong>(Required)</strong> Bandwidth size. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"extend_param_charging_mode",description:'<li><p><a name="extend_param_charging_mode"></a><a href="#extend_param_charging_mode"><code>extend_param_charging_mode</code></a> - <strong>(Optional)</strong> Node charging mode, 0 is on-demand charging. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"ecs_performance_type",description:'<li><p><a name="ecs_performance_type"></a><a href="#ecs_performance_type"><code>ecs_performance_type</code></a> - <strong>(Optional)</strong> Classification of cloud server specifications. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"order_id",description:'<li><p><a name="order_id"></a><a href="#order_id"><code>order_id</code></a> - <strong>(Optional)</strong> Order ID, mandatory when the node payment type is the automatic payment package period type. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"product_id",description:'<li><p><a name="product_id"></a><a href="#product_id"><code>product_id</code></a> - <strong>(Optional)</strong> The Product ID. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"max_pods",description:'<li><p><a name="max_pods"></a><a href="#max_pods"><code>max_pods</code></a> - <strong>(Optional)</strong> The maximum number of instances a node is allowed to create. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"public_key",description:'<li><p><a name="public_key"></a><a href="#public_key"><code>public_key</code></a> - <strong>(Optional)</strong> The Public key. Changing this parameter will create a new cluster resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p><strong>root_volume</strong> <strong>- (Required)</strong> It corresponds to the system disk related configuration. Changing this parameter will create a new resource.</p>",elementType:"p"},{name:"size",description:'<li><p><a name="size"></a><a href="#size"><code>size</code></a> - <strong>(Required)</strong> Disk size in GB.</p>\n</li>',elementType:"li",listDepth:1},{name:"volumetype",description:'<li><p><a name="volumetype"></a><a href="#volumetype"><code>volumetype</code></a> - <strong>(Required)</strong> Disk type.</p>\n</li>',elementType:"li",listDepth:1},{name:"extend_param",description:'<li><p><a name="extend_param"></a><a href="#extend_param"><code>extend_param</code></a> - <strong>(Optional)</strong> Disk expansion parameters.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p><strong>data_volumes</strong> <strong>- (Required)</strong> Represents the data disk to be created. Changing this parameter will create a new resource.</p>",elementType:"p"},{name:"size",description:'<li><p><a name="size-1"></a><a href="#size-1"><code>size</code></a> - <strong>(Required)</strong> Disk size in GB.</p>\n</li>',elementType:"li",listDepth:1},{name:"volumetype",description:'<li><p><a name="volumetype-1"></a><a href="#volumetype-1"><code>volumetype</code></a> - <strong>(Required)</strong> Disk type.</p>\n</li>',elementType:"li",listDepth:1},{name:"extend_param",description:'<li><p><a name="extend_param-1"></a><a href="#extend_param-1"><code>extend_param</code></a> - <strong>(Optional)</strong> Disk expansion parameters.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/cce_node_v3.html",docType:""},{id:9,type:"  opentelekomcloud_ces_alarmrule",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"alarm_name",description:'<li><p><a name="alarm_name"></a><a href="#alarm_name"><code>alarm_name</code></a> - <strong>(Required)</strong> Specifies the name of an alarm rule. The value can\nbe a string of 1 to 128 characters that can consist of numbers, lowercase letters,\nuppercase letters, underscores (_), or hyphens (-).</p>\n</li>',elementType:"li",listDepth:1},{name:"alarm_description",description:'<li><p><a name="alarm_description"></a><a href="#alarm_description"><code>alarm_description</code></a> - <strong>(Optional)</strong> The value can be a string of 0 to 256 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"metric",description:'<li><p><a name="metric"></a><a href="#metric"><code>metric</code></a> - <strong>(Required)</strong> Specifies the alarm metrics. The structure is described\nbelow.</p>\n</li>',elementType:"li",listDepth:1},{name:"condition",description:'<li><p><a name="condition"></a><a href="#condition"><code>condition</code></a> - <strong>(Required)</strong> Specifies the alarm triggering condition. The structure\nis described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"alarm_actions",description:'<li><p><a name="alarm_actions"></a><a href="#alarm_actions"><code>alarm_actions</code></a> - <strong>(Optional)</strong> Specifies the actions list triggered by an alarm. The\nstructure is described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"insufficientdata_actions",description:'<li><p><a name="insufficientdata_actions"></a><a href="#insufficientdata_actions"><code>insufficientdata_actions</code></a> - <strong>(Optional)</strong> Specifies the actions list triggered by\ndata insufficiency. The structure is described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"ok_actions",description:'<li><p><a name="ok_actions"></a><a href="#ok_actions"><code>ok_actions</code></a> - <strong>(Optional)</strong> Specifies the actions list triggered by the clearing of\nan alarm. The structure is described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"alarm_enabled",description:'<li><p><a name="alarm_enabled"></a><a href="#alarm_enabled"><code>alarm_enabled</code></a> - <strong>(Optional)</strong> Specifies whether to enable the alarm. The default\nvalue is true.</p>\n</li>',elementType:"li",listDepth:1},{name:"alarm_action_enabled",description:'<li><p><a name="alarm_action_enabled"></a><a href="#alarm_action_enabled"><code>alarm_action_enabled</code></a> - <strong>(Optional)</strong> Specifies whether to enable the action\nto be triggered by an alarm. The default value is true.\nNote: If alarm_action_enabled is set to true, at least one of the following\nparameters alarm_actions, insufficientdata_actions, and ok_actions cannot\nbe empty. If alarm_actions, insufficientdata_actions, and ok_actions coexist,\ntheir corresponding notification_list must be of the same value.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>metric</code> block supports:</p>",elementType:"p"},{name:"namespace",description:'<li><p><a name="namespace"></a><a href="#namespace"><code>namespace</code></a> - <strong>(Required)</strong> Specifies the namespace in service.item format. service.item\ncan be a string of 3 to 32 characters that must start with a letter and can\nconsists of uppercase letters, lowercase letters, numbers, or underscores (_).</p>\n</li>',elementType:"li",listDepth:1},{name:"metric_name",description:'<li><p><a name="metric_name"></a><a href="#metric_name"><code>metric_name</code></a> - <strong>(Required)</strong> Specifies the metric name. The value can be a string\nof 1 to 64 characters that must start with a letter and can consists of uppercase\nletters, lowercase letters, numbers, or underscores (_).</p>\n</li>',elementType:"li",listDepth:1},{name:"dimensions",description:'<li><p><a name="dimensions"></a><a href="#dimensions"><code>dimensions</code></a> - <strong>(Required)</strong> Specifies the list of metric dimensions. Currently,\nthe maximum length of the dimesion list that are supported is 3. The structure\nis described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>dimensions</code> block supports:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> Specifies the dimension name. The value can be a string\nof 1 to 32 characters that must start with a letter and can consists of uppercase\nletters, lowercase letters, numbers, underscores (_), or hyphens (-).</p>\n</li>',elementType:"li",listDepth:1},{name:"value",description:'<li><p><a name="value"></a><a href="#value"><code>value</code></a> - <strong>(Required)</strong> Specifies the dimension value. The value can be a string\nof 1 to 64 characters that must start with a letter or a number and can consists\nof uppercase letters, lowercase letters, numbers, underscores (_), or hyphens\n(-).</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>condition</code> block supports:</p>",elementType:"p"},{name:"period",description:'<li><p><a name="period"></a><a href="#period"><code>period</code></a> - <strong>(Required)</strong> Specifies the alarm checking period in seconds. The\nvalue can be 1, 300, 1200, 3600, 14400, and 86400.\nNote: If period is set to 1, the raw metric data is used to determine\nwhether to generate an alarm.</p>\n</li>',elementType:"li",listDepth:1},{name:"filter",description:'<li><p><a name="filter"></a><a href="#filter"><code>filter</code></a> - <strong>(Required)</strong> Specifies the data rollup methods. The value can be\nmax, min, average, sum, and vaiance.</p>\n</li>',elementType:"li",listDepth:1},{name:"comparison_operator",description:'<li><p><a name="comparison_operator"></a><a href="#comparison_operator"><code>comparison_operator</code></a> - <strong>(Required)</strong> Specifies the comparison condition of alarm\nthresholds. The value can be &gt;, =, &lt;, &gt;=, or &lt;=.</p>\n</li>',elementType:"li",listDepth:1},{name:"value",description:'<li><p><a name="value-1"></a><a href="#value-1"><code>value</code></a> - <strong>(Required)</strong> Specifies the alarm threshold. The value ranges from\n0 to Number of 1.7976931348623157e+308.</p>\n</li>',elementType:"li",listDepth:1},{name:"unit",description:'<li><p><a name="unit"></a><a href="#unit"><code>unit</code></a> - <strong>(Optional)</strong> Specifies the data unit.</p>\n</li>',elementType:"li",listDepth:1},{name:"count",description:'<li><p><a name="count"></a><a href="#count"><code>count</code></a> - <strong>(Required)</strong> Specifies the number of consecutive occurrence times.\nThe value ranges from 1 to 5.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>the <code>alarm_actions</code> block supports:</p>",elementType:"p"},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Optional)</strong> specifies the type of action triggered by an alarm. the\nvalue can be notification or autoscaling.\nnotification: indicates that a notification will be sent to the user.\nautoscaling: indicates that a scaling action will be triggered.</p>\n</li>',elementType:"li",listDepth:1},{name:"notification_list",description:'<li><p><a name="notification_list"></a><a href="#notification_list"><code>notification_list</code></a> - <strong>(Required)</strong> specifies the topic urn list of the target\nnotification objects. the maximum length is 5. the topic urn list can be\nobtained from simple message notification (smn) and in the following format:\nurn: smn:([a-z]|[a-z]|[0-9]|-){1,32}:([a-z]|[a-z]|[0-9]){32}:([a-z]|[a-z]|[0-9]|-|_){1,256}.\nif type is set to notification, the value of notification_list cannot be\nempty. if type is set to autoscaling, the value of notification_list must\nbe [] and the value of namespace must be sys.as.\nNote: to enable the as alarm rules take effect, you must bind scaling\npolicies. for details, see the auto scaling api reference.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>the <code>insufficientdata_actions</code> block supports:</p>",elementType:"p"},{name:"type",description:'<li><p><a name="type-1"></a><a href="#type-1"><code>type</code></a> - <strong>(Optional)</strong> specifies the type of action triggered by an alarm. the\nvalue is notification.\nnotification: indicates that a notification will be sent to the user.</p>\n</li>',elementType:"li",listDepth:1},{name:"notification_list",description:'<li><p><a name="notification_list-1"></a><a href="#notification_list-1"><code>notification_list</code></a> - <strong>(Optional)</strong> indicates the list of objects to be notified\nif the alarm status changes. the maximum length is 5.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>the <code>ok_actions</code> block supports:</p>",elementType:"p"},{name:"type",description:'<li><p><a name="type-2"></a><a href="#type-2"><code>type</code></a> - <strong>(Optional)</strong> specifies the type of action triggered by an alarm. the\nvalue is notification.\nnotification: indicates that a notification will be sent to the user.</p>\n</li>',elementType:"li",listDepth:1},{name:"notification_list",description:'<li><p><a name="notification_list-2"></a><a href="#notification_list-2"><code>notification_list</code></a> - <strong>(Optional)</strong> indicates the list of objects to be notified\nif the alarm status changes. the maximum length is 5.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/ces_alarmrule.html",docType:""},{id:10,type:"  opentelekomcloud_elb_loadbalancer",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> Specifies the load balancer name. The name is a string\nof 1 to 64 characters that consist of letters, digits, underscores (_),\nand hyphens (-).</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Provides supplementary information about the\nlistener. The value is a string of 0 to 128 characters and cannot be &lt;&gt;.</p>\n</li>',elementType:"li",listDepth:1},{name:"vpc_id",description:'<li><p><a name="vpc_id"></a><a href="#vpc_id"><code>vpc_id</code></a> - <strong>(Required)</strong> Specifies the VPC ID. Changing this creates a new\nelb loadbalancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"bandwidth",description:'<li><p><a name="bandwidth"></a><a href="#bandwidth"><code>bandwidth</code></a> - <strong>(Optional)</strong> Specifies the bandwidth (Mbit/s). This parameter\nis mandatory when type is set to External, and it is invalid when type\nis set to Internal. The value ranges from 1 to 300.</p>\n</li>',elementType:"li",listDepth:1},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Required)</strong> Specifies the load balancer type. The value can be\nInternal or External. Changing this creates a new elb loadbalancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_state_up",description:'<li><p><a name="admin_state_up"></a><a href="#admin_state_up"><code>admin_state_up</code></a> - <strong>(Required)</strong> Specifies the status of the load balancer.\nValue range: false: indicates that the load balancer is stopped or\nfrozen; true: indicates that the load balancer is running properly.\nOnly tenants are allowed to enter these two values.</p>\n</li>',elementType:"li",listDepth:1},{name:"vip_subnet_id",description:'<li><p><a name="vip_subnet_id"></a><a href="#vip_subnet_id"><code>vip_subnet_id</code></a> - <strong>(Optional)</strong> Specifies the ID of the private network\nto be added. This parameter is mandatory when type is set to Internal,\nand it is invalid when type is set to External. Changing this creates a\nnew elb loadbalancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"az",description:'<li><p><a name="az"></a><a href="#az"><code>az</code></a> - <strong>(Optional)</strong> Specifies the ID of the availability zone (AZ). This\nparameter is mandatory when type is set to Internal, and it is invalid\nwhen type is set to External. Changing this creates a new elb\nloadbalancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_group_id",description:'<li><p><a name="security_group_id"></a><a href="#security_group_id"><code>security_group_id</code></a> - <strong>(Optional)</strong> Specifies the security group ID. The\nvalue is a string of 1 to 200 characters that consists of uppercase and\nlowercase letters, digits, and hyphens (-). This parameter is mandatory\nonly when type is set to Internal. Changing this creates a new elb\nloadbalancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"vip_address",description:'<li><p><a name="vip_address"></a><a href="#vip_address"><code>vip_address</code></a> - <strong>(Optional)</strong> Specifies the IP address provided by ELB.\nWhen type is set to External, the value of this parameter is the elastic\nIP address. When type is set to Internal, the value of this parameter is\nthe private network IP address. You can select an existing elastic IP address\nand create a public network load balancer. When this parameter is configured,\nparameter bandwidth is invalid. Changing this creates a new elb loadbalancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenantid",description:'<li><p><a name="tenantid"></a><a href="#tenantid"><code>tenantid</code></a> - <strong>(Optional)</strong> Specifies the tenant ID. This parameter is mandatory\nonly when type is set to Internal.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/elb_loadbalancer.html",docType:""},{id:11,type:"  opentelekomcloud_elb_listener",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> Specifies the load balancer name. The name is a string\nof 1 to 64 characters that consist of letters, digits, underscores (_), and\nhyphens (-).</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Provides supplementary information about the listener.\nThe value is a string of 0 to 128 characters and cannot be &lt;&gt;.</p>\n</li>',elementType:"li",listDepth:1},{name:"loadbalancer_id",description:'<li><p><a name="loadbalancer_id"></a><a href="#loadbalancer_id"><code>loadbalancer_id</code></a> - <strong>(Required)</strong> Specifies the ID of the load balancer to which\nthe listener belongs.  Changing this creates a new elb listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"protocol",description:'<li><p><a name="protocol"></a><a href="#protocol"><code>protocol</code></a> - <strong>(Required)</strong> Specifies the listening protocol used for layer 4\nor 7. The value can be HTTP, TCP, HTTPS, or UDP.  Changing this creates a\nnew elb listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"protocol_port",description:'<li><p><a name="protocol_port"></a><a href="#protocol_port"><code>protocol_port</code></a> - <strong>(Required)</strong> Specifies the listening port. The value ranges from 1\nto 65535.</p>\n</li>',elementType:"li",listDepth:1},{name:"backend_protocol",description:'<li><p><a name="backend_protocol"></a><a href="#backend_protocol"><code>backend_protocol</code></a> - <strong>(Required)</strong> Specifies the backend protocol. If the value\nof protocol is UDP, the value of this parameter can only be UDP. The value can\nbe HTTP, TCP, or UDP.  Changing this creates a new elb listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"backend_port",description:'<li><p><a name="backend_port"></a><a href="#backend_port"><code>backend_port</code></a> - <strong>(Required)</strong> Specifies the backend port. The value ranges from\n1 to 65535.</p>\n</li>',elementType:"li",listDepth:1},{name:"lb_algorithm",description:'<li><p><a name="lb_algorithm"></a><a href="#lb_algorithm"><code>lb_algorithm</code></a> - <strong>(Required)</strong> Specifies the load balancing algorithm for the\nlistener. The value can be roundrobin, leastconn, or source.</p>\n</li>',elementType:"li",listDepth:1},{name:"session_sticky",description:'<li><p><a name="session_sticky"></a><a href="#session_sticky"><code>session_sticky</code></a> - <strong>(Optional)</strong> Specifies whether to enable sticky session.\nThe value can be true or false. The Sticky session is enabled when the value\nis true, and is disabled when the value is false. If the value of protocol is\nHTTP, HTTPS, or TCP, and the value of lb_algorithm is not roundrobin, the value\nof this parameter can only be false.  Changing this creates a new elb listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"session_sticky_type",description:'<li><p><a name="session_sticky_type"></a><a href="#session_sticky_type"><code>session_sticky_type</code></a> - <strong>(Optional)</strong> Specifies the cookie processing method.\nThe value is insert. insert indicates that the cookie is inserted by the load\nbalancer. This parameter is valid when protocol is set to HTTP, and session_sticky\nto true. The default value is insert. This parameter is invalid when protocol\nis set to TCP or UDP, which means the parameter is empty.  Changing this creates\na new elb listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"cookie_timeout",description:'<li><p><a name="cookie_timeout"></a><a href="#cookie_timeout"><code>cookie_timeout</code></a> - <strong>(Optional)</strong> Specifies the cookie timeout period (minutes).\nThis parameter is valid when protocol is set to HTTP, session_sticky to true,\nand session_sticky_type to insert. This parameter is invalid when protocol is\nset to TCP or UDP. The value ranges from 1 to 1440.  Changing this creates a\nnew elb listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"tcp_timeout",description:'<li><p><a name="tcp_timeout"></a><a href="#tcp_timeout"><code>tcp_timeout</code></a> - <strong>(Optional)</strong> Specifies the TCP timeout period (minutes). This\nparameter is valid when protocol is set to TCP. The value ranges from 1 to 5.</p>\n</li>',elementType:"li",listDepth:1},{name:"tcp_draining",description:'<li><p><a name="tcp_draining"></a><a href="#tcp_draining"><code>tcp_draining</code></a> - <strong>(Optional)</strong> Specifies whether to maintain the TCP connection\nto the backend ECS after the ECS is deleted. This parameter is valid when protocol\nis set to TCP. The value can be true or false.</p>\n</li>',elementType:"li",listDepth:1},{name:"tcp_draining_timeout",description:'<li><p><a name="tcp_draining_timeout"></a><a href="#tcp_draining_timeout"><code>tcp_draining_timeout</code></a> - <strong>(Optional)</strong> Specifies the timeout duration (minutes)\nfor the TCP connection to the backend ECS after the ECS is deleted. This parameter\nis valid when protocol is set to TCP, and tcp_draining to true. The value ranges\nfrom 0 to 60.</p>\n</li>',elementType:"li",listDepth:1},{name:"certificate_id",description:'<li><p><a name="certificate_id"></a><a href="#certificate_id"><code>certificate_id</code></a> - <strong>(Optional)</strong> Specifies the ID of the SSL certificate used\nfor security authentication when HTTPS is used to make API calls. This parameter\nis mandatory if the value of protocol is HTTPS. The value can be obtained by\nviewing the details of the SSL certificate.  Changing this creates a new elb\nlistener.</p>\n</li>',elementType:"li",listDepth:1},{name:"udp_timeout",description:'<li><p><a name="udp_timeout"></a><a href="#udp_timeout"><code>udp_timeout</code></a> - <strong>(Optional)</strong> Specifies the UDP timeout duration (minutes). This\nparameter is valid when protocol is set to UDP. The value ranges from 1 to 1440.</p>\n</li>',elementType:"li",listDepth:1},{name:"ssl_protocols",description:'<li><p><a name="ssl_protocols"></a><a href="#ssl_protocols"><code>ssl_protocols</code></a> - <strong>(Optional)</strong> Specifies the SSL protocol standard supported\nby a tracker, which is used for enabling specified encryption protocols. This\nparameter is valid only when the value of protocol is set to HTTPS. The value\nis TLSv1.2 or TLSv1.2 TLSv1.1 TLSv1. The default value is TLSv1.2. Changing\nthis creates a new elb listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"ssl_ciphers",description:'<li><p><a name="ssl_ciphers"></a><a href="#ssl_ciphers"><code>ssl_ciphers</code></a> - <strong>(Optional)</strong> Specifies the cipher suite of an encryption protocol.\nThis parameter is valid only when the value of protocol is set to HTTPS. The\nvalue is Default, Extended, or Strict. The default value is Default. The value\ncan only be set to Extended if the value of ssl_protocols is set to TLSv1.2\nTLSv1.1 TLSv1.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/elb_listener.html",docType:""},{id:12,type:"  opentelekomcloud_elb_health",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"listener_id",description:'<li><p><a name="listener_id"></a><a href="#listener_id"><code>listener_id</code></a> - <strong>(Required)</strong> Specifies the ID of the listener to which the health\ncheck task belongs. Changing this creates a new elb health.</p>\n</li>',elementType:"li",listDepth:1},{name:"healthcheck_protocol",description:'<li><p><a name="healthcheck_protocol"></a><a href="#healthcheck_protocol"><code>healthcheck_protocol</code></a> - <strong>(Optional)</strong> Specifies the protocol used for the health\ncheck. The value can be HTTP or TCP (case-insensitive).</p>\n</li>',elementType:"li",listDepth:1},{name:"healthcheck_uri",description:'<li><p><a name="healthcheck_uri"></a><a href="#healthcheck_uri"><code>healthcheck_uri</code></a> - <strong>(Optional)</strong> Specifies the URI for health check. This parameter\nis valid when healthcheck_ protocol is HTTP. The value is a string of 1 to 80\ncharacters that must start with a slash (/) and can only contain letters, digits,\nand special characters, such as -/.%?#&amp;.</p>\n</li>',elementType:"li",listDepth:1},{name:"healthcheck_connect_port",description:'<li><p><a name="healthcheck_connect_port"></a><a href="#healthcheck_connect_port"><code>healthcheck_connect_port</code></a> - <strong>(Optional)</strong> Specifies the port used for the health\ncheck. The value ranges from 1 to 65535.</p>\n</li>',elementType:"li",listDepth:1},{name:"healthy_threshold",description:'<li><p><a name="healthy_threshold"></a><a href="#healthy_threshold"><code>healthy_threshold</code></a> - <strong>(Optional)</strong> Specifies the threshold at which the health\ncheck result is success, that is, the number of consecutive successful health\nchecks when the health check result of the backend server changes from fail\nto success. The value ranges from 1 to 10.</p>\n</li>',elementType:"li",listDepth:1},{name:"unhealthy_threshold",description:'<li><p><a name="unhealthy_threshold"></a><a href="#unhealthy_threshold"><code>unhealthy_threshold</code></a> - <strong>(Optional)</strong> Specifies the threshold at which the health\ncheck result is fail, that is, the number of consecutive failed health checks\nwhen the health check result of the backend server changes from success to fail.\nThe value ranges from 1 to 10.</p>\n</li>',elementType:"li",listDepth:1},{name:"healthcheck_timeout",description:'<li><p><a name="healthcheck_timeout"></a><a href="#healthcheck_timeout"><code>healthcheck_timeout</code></a> - <strong>(Optional)</strong> Specifies the maximum timeout duration\n(s) for the health check. The value ranges from 1 to 50.</p>\n</li>',elementType:"li",listDepth:1},{name:"healthcheck_interval",description:'<li><p><a name="healthcheck_interval"></a><a href="#healthcheck_interval"><code>healthcheck_interval</code></a> - <strong>(Optional)</strong> Specifies the maximum interval (s) for\nhealth check. The value ranges from 1 to 5.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/elb_health.html",docType:""},{id:13,type:"  opentelekomcloud_elb_backend",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"listener_id",description:'<li><p><a name="listener_id"></a><a href="#listener_id"><code>listener_id</code></a> - <strong>(Required)</strong> Specifies the listener ID. Changing this creates a new\nelb backend.</p>\n</li>',elementType:"li",listDepth:1},{name:"server_id",description:'<li><p><a name="server_id"></a><a href="#server_id"><code>server_id</code></a> - <strong>(Required)</strong> Specifies the backend member ID. Changing this creates a\n new elb backend.</p>\n</li>',elementType:"li",listDepth:1},{name:"address",description:'<li><p><a name="address"></a><a href="#address"><code>address</code></a> - <strong>(Required)</strong> Specifies the private IP address of the backend member. \nChanging this creates a new elb backend.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/elb_backend.html",docType:""},{id:14,type:"  opentelekomcloud_css_cluster_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> -\n<strong>(Required)</strong>\nCluster name. It contains 4 to 32 characters. Only letters, digits,\nhyphens (-), and underscores (_) are allowed. The value must start\nwith a letter.  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"node_config",description:'<li><p><a name="node_config"></a><a href="#node_config"><code>node_config</code></a> -\n<strong>(Required)</strong>\nInstance object. Structure is documented below. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>node_config</code> block supports:</p>",elementType:"p"},{name:"availability_zone",description:'<li><p><a name="availability_zone"></a><a href="#availability_zone"><code>availability_zone</code></a> -\n<strong>(Optional)</strong>\nAvailability zone (AZ).  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"flavor",description:'<li><p><a name="flavor"></a><a href="#flavor"><code>flavor</code></a> -\n<strong>(Required)</strong>\nInstance flavor name. Value range of flavor css.medium.8: 40 GB\nto 640 GB Value range of flavor css.large.8: 40 GB to 1280 GB\nValue range of flavor css.xlarge.8: 40 GB to 2560 GB Value range\nof flavor css.2xlarge.8: 80 GB to 5120 GB Value range of flavor\ncss.4xlarge.8: 160 GB to 10240 GB  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"network_info",description:'<li><p><a name="network_info"></a><a href="#network_info"><code>network_info</code></a> -\n<strong>(Required)</strong>\nNetwork information. Structure is documented below. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume",description:'<li><p><a name="volume"></a><a href="#volume"><code>volume</code></a> -\n<strong>(Required)</strong>\nInformation about the volume. Structure is documented below. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>network_info</code> block supports:</p>",elementType:"p"},{name:"network_id",description:'<li><p><a name="network_id"></a><a href="#network_id"><code>network_id</code></a> -\n<strong>(Required)</strong>\nNetwork ID. All instances in a cluster must have the same\nnetworks and security groups.  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_group_id",description:'<li><p><a name="security_group_id"></a><a href="#security_group_id"><code>security_group_id</code></a> -\n<strong>(Required)</strong>\nSecurity group ID. All instances in a cluster must have the\nsame subnets and security groups.  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"vpc_id",description:'<li><p><a name="vpc_id"></a><a href="#vpc_id"><code>vpc_id</code></a> -\n<strong>(Required)</strong>\nVPC ID, which is used for configuring cluster network.  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>volume</code> block supports:</p>",elementType:"p"},{name:"encryption_key",description:'<li><p><a name="encryption_key"></a><a href="#encryption_key"><code>encryption_key</code></a> -\n<strong>(Optional)</strong>\nKey ID. The Default Master Keys cannot be used to create\ngrants. Specifically, you cannot use Default Master Keys\nwhose aliases end with /default in KMS to create clusters.\nAfter a cluster is created, do not delete the key used by the\ncluster. Otherwise, the cluster will become unavailable.  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"size",description:'<li><p><a name="size"></a><a href="#size"><code>size</code></a> -\n<strong>(Required)</strong>\nVolume size, which must be a multiple of 4 and 10.  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_type",description:'<li><p><a name="volume_type"></a><a href="#volume_type"><code>volume_type</code></a> -\n<strong>(Required)</strong>\nCOMMON: Common I/O. The SATA disk is used. HIGH: High I/O.\nThe SAS disk is used. ULTRAHIGH: Ultra-high I/O. The\nsolid-state drive (SSD) is used.  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"enable_https",description:'<li><p><a name="enable_https"></a><a href="#enable_https"><code>enable_https</code></a> -\n<strong>(Optional)</strong>\nWhether communication encryption is performed on the cluster.\nAvailable values include true and false. By default, communication\nencryption is enabled. Value true indicates that communication\nencryption is performed on the cluster. Value false indicates that\ncommunication encryption is not performed on the cluster.  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"expect_node_num",description:'<li><p><a name="expect_node_num"></a><a href="#expect_node_num"><code>expect_node_num</code></a> -\n<strong>(Optional)</strong>\nNumber of cluster instances. The value range is 1 to 32.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/css_cluster_v1.html",docType:""},{id:15,type:"  opentelekomcloud_compute_floatingip_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"pool",description:"<strong>(Optional)</strong> The name of the pool from which to obtain the floating\nIP. Default value is admin_external_net. Changing this creates a new floating IP.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/compute_floatingip_v2.html",docType:""},{id:16,type:"  opentelekomcloud_compute_floatingip_associate_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"floating_ip",description:'<li><p><a name="floating_ip"></a><a href="#floating_ip"><code>floating_ip</code></a> - <strong>(Required)</strong> The floating IP to associate.</p>\n</li>',elementType:"li",listDepth:1},{name:"instance_id",description:'<li><p><a name="instance_id"></a><a href="#instance_id"><code>instance_id</code></a> - <strong>(Required)</strong> The instance to associte the floating IP with.</p>\n</li>',elementType:"li",listDepth:1},{name:"fixed_ip",description:'<li><p><a name="fixed_ip"></a><a href="#fixed_ip"><code>fixed_ip</code></a> - <strong>(Optional)</strong> The specific IP address to direct traffic to.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/compute_floatingip_associate_v2.html",docType:""},{id:17,type:"  opentelekomcloud_compute_instance_v2",properties:[{name:"",description:'<div class="alert alert-warning" role="alert">\n<p><strong>NOTE:</strong> The <code>tags</code> attribute has been deprecated and might\nbe removed in future releases, please use <code>tag</code> instead.</p>\n</div>',elementType:"div"},{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> A unique name for the resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_id",description:'<li><p><a name="image_id"></a><a href="#image_id"><code>image_id</code></a> - (Optional; Required if <code>image_name</code> is empty and not booting\nfrom a volume. Do not specify if booting from a volume.) The image ID of\nthe desired image for the server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_name",description:'<li><p><a name="image_name"></a><a href="#image_name"><code>image_name</code></a> - (Optional; Required if <code>image_id</code> is empty and not booting\nfrom a volume. Do not specify if booting from a volume.) The name of the\ndesired image for the server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"flavor_id",description:'<li><p><a name="flavor_id"></a><a href="#flavor_id"><code>flavor_id</code></a> - (Optional; Required if <code>flavor_name</code> is empty) The flavor ID of\nthe desired flavor for the server. Changing this resizes the existing server.</p>\n</li>',elementType:"li",listDepth:1},{name:"flavor_name",description:'<li><p><a name="flavor_name"></a><a href="#flavor_name"><code>flavor_name</code></a> - (Optional; Required if <code>flavor_id</code> is empty) The name of the\ndesired flavor for the server. Changing this resizes the existing server.</p>\n</li>',elementType:"li",listDepth:1},{name:"user_data",description:'<li><p><a name="user_data"></a><a href="#user_data"><code>user_data</code></a> - <strong>(Optional)</strong> The user data to provide when launching the instance.\nChanging this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_groups",description:'<li><p><a name="security_groups"></a><a href="#security_groups"><code>security_groups</code></a> - <strong>(Optional)</strong> An array of one or more security group names\nto associate with the server. Changing this results in adding/removing\nsecurity groups from the existing server. <em>Note</em>: When attaching the\ninstance to networks using Ports, place the security groups on the Port\nand not the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"availability_zone",description:'<li><p><a name="availability_zone"></a><a href="#availability_zone"><code>availability_zone</code></a> - <strong>(Optional)</strong> The availability zone in which to create\nthe server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"network",description:'<li><p><a name="network"></a><a href="#network"><code>network</code></a> - <strong>(Optional)</strong> An array of one or more networks to attach to the\ninstance. Required when there are multiple networks defined for the tenant.\nThe network object structure is documented below. Changing this creates a\nnew server.</p>\n</li>',elementType:"li",listDepth:1},{name:"metadata",description:'<li><p><a name="metadata"></a><a href="#metadata"><code>metadata</code></a> - <strong>(Optional)</strong> Metadata key/value pairs to make available from\nwithin the instance. Changing this updates the existing server metadata.</p>\n</li>',elementType:"li",listDepth:1},{name:"config_drive",description:'<li><p><a name="config_drive"></a><a href="#config_drive"><code>config_drive</code></a> - <strong>(Optional)</strong> Whether to use the config_drive feature to\nconfigure the instance. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_pass",description:'<li><p><a name="admin_pass"></a><a href="#admin_pass"><code>admin_pass</code></a> - <strong>(Optional)</strong> The administrative password to assign to the server.\nChanging this changes the root password on the existing server.</p>\n</li>',elementType:"li",listDepth:1},{name:"key_pair",description:'<li><p><a name="key_pair"></a><a href="#key_pair"><code>key_pair</code></a> - <strong>(Optional)</strong> The name of a key pair to put on the server. The key\npair must already be created and associated with the tenant\'s account.\nChanging this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"block_device",description:'<li><p><a name="block_device"></a><a href="#block_device"><code>block_device</code></a> - <strong>(Optional)</strong> Configuration of block devices. The block_device\nstructure is documented below. Changing this creates a new server.\nYou can specify multiple block devices which will create an instance with\nmultiple disks. This configuration is very flexible, so please see the\nfollowing <a href="http://docs.openstack.org/developer/nova/block_device_mapping.html">reference</a>\nfor more information.</p>\n</li>',elementType:"li",listDepth:1},{name:"scheduler_hints",description:'<li><p><a name="scheduler_hints"></a><a href="#scheduler_hints"><code>scheduler_hints</code></a> - <strong>(Optional)</strong> Provide the Nova scheduler with hints on how\nthe instance should be launched. The available hints are described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>DEPRECATED</strong> <strong>(Optional)</strong> The tags of the image. It must be a list of strings.</p>\n</li>',elementType:"li",listDepth:1},{name:"tag",description:'<li><p><a name="tag"></a><a href="#tag"><code>tag</code></a> - <strong>(Optional)</strong> Tags key/value pairs to associate with the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"stop_before_destroy",description:'<li><p><a name="stop_before_destroy"></a><a href="#stop_before_destroy"><code>stop_before_destroy</code></a> - <strong>(Optional)</strong> Whether to try stop instance gracefully\nbefore destroying it, thus giving chance for guest OS daemons to stop correctly.\nIf instance doesn\'t stop within timeout, it will be destroyed anyway.</p>\n</li>',elementType:"li",listDepth:1},{name:"force_delete",description:'<li><p><a name="force_delete"></a><a href="#force_delete"><code>force_delete</code></a> - <strong>(Optional)</strong> Whether to force the OpenTelekomCloud instance to be\nforcefully deleted. This is useful for environments that have reclaim / soft\ndeletion enabled.</p>\n</li>',elementType:"li",listDepth:1},{name:"auto_recovery",description:'<li><p><a name="auto_recovery"></a><a href="#auto_recovery"><code>auto_recovery</code></a> - <strong>(Optional)</strong> Configures or deletes automatic recovery of an instance</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>network</code> block supports:</p>",elementType:"p"},{name:"uuid",description:'<li><p><a name="uuid"></a><a href="#uuid"><code>uuid</code></a> - (Required unless <code>port</code>  or <code>name</code> is provided) The network UUID to\nattach to the server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name-1"></a><a href="#name-1"><code>name</code></a> - (Required unless <code>uuid</code> or <code>port</code> is provided) The human-readable\nname of the network. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"port",description:'<li><p><a name="port"></a><a href="#port"><code>port</code></a> - (Required unless <code>uuid</code> or <code>name</code> is provided) The port UUID of a\nnetwork to attach to the server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"fixed_ip_v4",description:'<li><p><a name="fixed_ip_v4"></a><a href="#fixed_ip_v4"><code>fixed_ip_v4</code></a> - <strong>(Optional)</strong> Specifies a fixed IPv4 address to be used on this\nnetwork. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"fixed_ip_v6",description:'<li><p><a name="fixed_ip_v6"></a><a href="#fixed_ip_v6"><code>fixed_ip_v6</code></a> - <strong>(Optional)</strong> Specifies a fixed IPv6 address to be used on this\nnetwork. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"access_network",description:'<li><p><a name="access_network"></a><a href="#access_network"><code>access_network</code></a> - <strong>(Optional)</strong> Specifies if this network should be used for\nprovisioning access. Accepts true or false. Defaults to false.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>block_device</code> block supports:</p>",elementType:"p"},{name:"uuid",description:'<li><p><a name="uuid-1"></a><a href="#uuid-1"><code>uuid</code></a> - (Required unless <code>source_type</code> is set to <code>"blank"</code> ) The UUID of\nthe image, volume, or snapshot. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"source_type",description:'<li><p><a name="source_type"></a><a href="#source_type"><code>source_type</code></a> - <strong>(Required)</strong> The source type of the device. Must be one of\n"blank", "image", "volume", or "snapshot". Changing this creates a new\nserver.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_size",description:'<li><p><a name="volume_size"></a><a href="#volume_size"><code>volume_size</code></a> - The size of the volume to create (in gigabytes). Required\nin the following combinations: source=image and destination=volume,\nand source=blank and destination=volume. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_type",description:'<li><p><a name="volume_type"></a><a href="#volume_type"><code>volume_type</code></a> - <strong>(Optional)</strong> Currently, the value can be <code>SSD</code> (ultra-I/O disk type), <code>SAS</code> (high I/O disk type), or <code>SATA</code> (common I/O disk type)\n<a href="https://docs.otc.t-systems.com/en-us/api/ecs/en-us_topic_0065817708.html">OTC-API</a></p>\n</li>',elementType:"li",listDepth:1},{name:"boot_index",description:'<li><p><a name="boot_index"></a><a href="#boot_index"><code>boot_index</code></a> - <strong>(Optional)</strong> The boot index of the volume. It defaults to 0.\nChanging this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"destination_type",description:'<li><p><a name="destination_type"></a><a href="#destination_type"><code>destination_type</code></a> - <strong>(Optional)</strong> The type that gets created. Currently only\nsupport "volume". Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"delete_on_termination",description:'<li><p><a name="delete_on_termination"></a><a href="#delete_on_termination"><code>delete_on_termination</code></a> - <strong>(Optional)</strong> Delete the volume / block device upon\ntermination of the instance. Defaults to false. Changing this creates a\nnew server.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>scheduler_hints</code> block supports:</p>",elementType:"p"},{name:"group",description:'<li><p><a name="group"></a><a href="#group"><code>group</code></a> - <strong>(Optional)</strong> A UUID of a Server Group. The instance will be placed\ninto that group.</p>\n</li>',elementType:"li",listDepth:1},{name:"different_host",description:'<li><p><a name="different_host"></a><a href="#different_host"><code>different_host</code></a> - <strong>(Optional)</strong> A list of instance UUIDs. The instance will\nbe scheduled on a different host than all other instances.</p>\n</li>',elementType:"li",listDepth:1},{name:"same_host",description:'<li><p><a name="same_host"></a><a href="#same_host"><code>same_host</code></a> - <strong>(Optional)</strong> A list of instance UUIDs. The instance will be\nscheduled on the same host of those specified.</p>\n</li>',elementType:"li",listDepth:1},{name:"query",description:'<li><p><a name="query"></a><a href="#query"><code>query</code></a> - <strong>(Optional)</strong> A conditional query that a compute node must pass in\norder to host an instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"target_cell",description:'<li><p><a name="target_cell"></a><a href="#target_cell"><code>target_cell</code></a> - <strong>(Optional)</strong> The name of a cell to host the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="build_near_host_ip"></a><a href="#build_near_host_ip"><code>build_near_host_ip</code></a> - (Optional) An IP Address in CIDR form. The instance\nwill be placed on a compute node that is in the same subnet.</p>',elementType:"p"},{name:"tenancy",description:"<strong>(Optional)</strong> The tenancy specifies whether the ECS is to be created on a Dedicated Host\n(DeH) or in a shared pool.\n",elementType:"li",listDepth:2},{name:"deh_id",description:"<strong>(Optional)</strong> The ID of DeH. This parameter takes effect only when the value\nof tenancy is dedicated.\n",elementType:"li",listDepth:2}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/compute_instance_v2.html",docType:""},{id:18,type:"  opentelekomcloud_compute_keypair_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> A unique name for the keypair. Changing this creates a new\nkeypair.</p>\n</li>',elementType:"li",listDepth:1},{name:"public_key",description:'<li><p><a name="public_key"></a><a href="#public_key"><code>public_key</code></a> - <strong>(Required)</strong> A pregenerated OpenSSH-formatted public key.\nChanging this creates a new keypair.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/compute_keypair_v2.html",docType:""},{id:19,type:"  opentelekomcloud_compute_secgroup_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> A unique name for the security group. Changing this\nupdates the <code>name</code> of an existing security group.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Required)</strong> A description for the security group. Changing this\nupdates the <code>description</code> of an existing security group.</p>\n</li>',elementType:"li",listDepth:1},{name:"rule",description:'<li><p><a name="rule"></a><a href="#rule"><code>rule</code></a> - <strong>(Optional)</strong> A rule describing how the security group operates. The\nrule object structure is documented below. Changing this updates the\nsecurity group rules. As shown in the example above, multiple rule blocks\nmay be used.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>rule</code> block supports:</p>",elementType:"p"},{name:"from_port",description:'<li><p><a name="from_port"></a><a href="#from_port"><code>from_port</code></a> - <strong>(Required)</strong> An integer representing the lower bound of the port\nrange to open. Changing this creates a new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"to_port",description:'<li><p><a name="to_port"></a><a href="#to_port"><code>to_port</code></a> - <strong>(Required)</strong> An integer representing the upper bound of the port\nrange to open. Changing this creates a new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_protocol",description:'<li><p><a name="ip_protocol"></a><a href="#ip_protocol"><code>ip_protocol</code></a> - <strong>(Required)</strong> The protocol type that will be allowed. Changing\nthis creates a new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"cidr",description:'<li><p><a name="cidr"></a><a href="#cidr"><code>cidr</code></a> - <strong>(Optional)</strong> Required if <code>from_group_id</code> or <code>self</code> is empty. The IP range\nthat will be the source of network traffic to the security group. Use 0.0.0.0/0\nto allow all IP addresses. Changing this creates a new security group rule. Cannot\nbe combined with <code>from_group_id</code> or <code>self</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"from_group_id",description:'<li><p><a name="from_group_id"></a><a href="#from_group_id"><code>from_group_id</code></a> - <strong>(Optional)</strong> Required if <code>cidr</code> or <code>self</code> is empty. The ID of a\ngroup from which to forward traffic to the parent group. Changing this creates a\nnew security group rule. Cannot be combined with <code>cidr</code> or <code>self</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"self",description:'<li><p><a name="self"></a><a href="#self"><code>self</code></a> - <strong>(Optional)</strong> Required if <code>cidr</code> and <code>from_group_id</code> is empty. If true,\nthe security group itself will be added as a source to this ingress rule. Cannot\nbe combined with <code>cidr</code> or <code>from_group_id</code>.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/compute_secgroup_v2.html",docType:""},{id:20,type:"  opentelekomcloud_compute_servergroup_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> A unique name for the server group. Changing this creates\na new server group.</p>\n</li>',elementType:"li",listDepth:1},{name:"policies",description:'<li><p><a name="policies"></a><a href="#policies"><code>policies</code></a> - <strong>(Required)</strong> The set of policies for the server group. Only two\ntwo policies are available right now, and both are mutually exclusive. See\nthe Policies section for more information. Changing this creates a new\nserver group.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1},{name:"policies-1",description:'<h2 id="policies-1">\n<a class="anchor" href="#policies-1" name="policies-1">\xbb</a>\n  Policies\n</h2>',elementType:"h2"},{name:"affinity",description:'<li><p><a name="affinity"></a><a href="#affinity"><code>affinity</code></a> - All instances/servers launched in this group will be hosted on\nthe same compute node.</p>\n</li>',elementType:"li",listDepth:1},{name:"anti-affinity",description:'<li><p><a name="anti-affinity"></a><a href="#anti-affinity"><code>anti-affinity</code></a> - All instances/servers launched in this group will be\nhosted on different compute nodes.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/compute_servergroup_v2.html",docType:""},{id:21,type:"  opentelekomcloud_compute_volume_attach_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"instance_id",description:'<li><p><a name="instance_id"></a><a href="#instance_id"><code>instance_id</code></a> - <strong>(Required)</strong> The ID of the Instance to attach the Volume to.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_id",description:'<li><p><a name="volume_id"></a><a href="#volume_id"><code>volume_id</code></a> - <strong>(Required)</strong> The ID of the Volume to attach to an Instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"device",description:'<li><p><a name="device"></a><a href="#device"><code>device</code></a> - <strong>(Optional)</strong> The device of the volume attachment (ex: <code>/dev/vdc</code>).\n<em>NOTE</em>: Being able to specify a device is dependent upon the hypervisor in\nuse. There is a chance that the device specified in Terraform will not be\nthe same device the hypervisor chose. If this happens, Terraform will wish\nto update the device upon subsequent applying which will cause the volume\nto be detached and reattached indefinitely. Please use with caution.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/compute_volume_attach_v2.html",docType:""},{id:22,type:"  opentelekomcloud_compute_bms_server_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the BMS.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_id",description:'<li><p><a name="image_id"></a><a href="#image_id"><code>image_id</code></a> - (Optional; Required if <code>image_name</code> is empty.) Changing this creates a new bms server.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_name",description:'<li><p><a name="image_name"></a><a href="#image_name"><code>image_name</code></a> - (Optional; Required if <code>image_id</code> is empty.) The name of the\ndesired image for the bms server. Changing this creates a new bms server.</p>\n</li>',elementType:"li",listDepth:1},{name:"flavor_id",description:'<li><p><a name="flavor_id"></a><a href="#flavor_id"><code>flavor_id</code></a> - (Optional; Required if <code>flavor_name</code> is empty) The flavor ID of\nthe desired flavor for the bms server. Changing this resizes the existing bms server.</p>\n</li>',elementType:"li",listDepth:1},{name:"flavor_name",description:'<li><p><a name="flavor_name"></a><a href="#flavor_name"><code>flavor_name</code></a> - (Optional; Required if <code>flavor_id</code> is empty) The name of the\ndesired flavor for the bms server. Changing this resizes the existing bms server.</p>\n</li>',elementType:"li",listDepth:1},{name:"user_data",description:'<li><p><a name="user_data"></a><a href="#user_data"><code>user_data</code></a> - <strong>(Optional)</strong> The user data to provide when launching the instance.\nChanging this creates a new bms server.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_groups",description:'<li><p><a name="security_groups"></a><a href="#security_groups"><code>security_groups</code></a> - <strong>(Optional)</strong> An array of one or more security group names\nto associate with the bms server. Changing this results in adding/removing\nsecurity groups from the existing bms server.</p>\n</li>',elementType:"li",listDepth:1},{name:"availability_zone",description:'<li><p><a name="availability_zone"></a><a href="#availability_zone"><code>availability_zone</code></a> - <strong>(Required)</strong> The availability zone in which to create\nthe bms server.</p>\n</li>',elementType:"li",listDepth:1},{name:"network",description:'<li><p><a name="network"></a><a href="#network"><code>network</code></a> - <strong>(Optional)</strong> An array of one or more networks to attach to the\nbms instance. Changing this creates a new bms server.</p>\n</li>',elementType:"li",listDepth:1},{name:"metadata",description:'<li><p><a name="metadata"></a><a href="#metadata"><code>metadata</code></a> - <strong>(Optional)</strong> Metadata key/value pairs to make available from\nwithin the instance. Changing this updates the existing bms server metadata.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_pass",description:'<li><p><a name="admin_pass"></a><a href="#admin_pass"><code>admin_pass</code></a> - <strong>(Optional)</strong> The administrative password to assign to the bms server.\nChanging this changes the root password on the existing server.</p>\n</li>',elementType:"li",listDepth:1},{name:"key_pair",description:'<li><p><a name="key_pair"></a><a href="#key_pair"><code>key_pair</code></a> - <strong>(Optional)</strong> The name of a key pair to put on the bms server. The key\npair must already be created and associated with the tenant\'s account.\nChanging this creates a new bms server.</p>\n</li>',elementType:"li",listDepth:1},{name:"stop_before_destroy",description:'<li><p><a name="stop_before_destroy"></a><a href="#stop_before_destroy"><code>stop_before_destroy</code></a> - <strong>(Optional)</strong> Whether to try stop instance gracefully\nbefore destroying it, thus giving chance for guest OS daemons to stop correctly.\nIf instance doesn\'t stop within timeout, it will be destroyed anyway.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> Tags key/value pairs to associate with the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>network</code> block supports:</p>",elementType:"p"},{name:"uuid",description:'<li><p><a name="uuid"></a><a href="#uuid"><code>uuid</code></a> - (Required unless <code>port</code>  or <code>name</code> is provided) The network UUID to\nattach to the bms server. Changing this creates a new bms server.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name-1"></a><a href="#name-1"><code>name</code></a> - (Required unless <code>uuid</code> or <code>port</code> is provided) The human-readable\nname of the network. Changing this creates a new bms server.</p>\n</li>',elementType:"li",listDepth:1},{name:"port",description:'<li><p><a name="port"></a><a href="#port"><code>port</code></a> - (Required unless <code>uuid</code> or <code>name</code> is provided) The port UUID of a\nnetwork to attach to the bms server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"fixed_ip_v4",description:'<li><p><a name="fixed_ip_v4"></a><a href="#fixed_ip_v4"><code>fixed_ip_v4</code></a> - <strong>(Optional)</strong> Specifies a fixed IPv4 address to be used on this\nnetwork. Changing this creates a new bms server.</p>\n</li>',elementType:"li",listDepth:1},{name:"fixed_ip_v6",description:'<li><p><a name="fixed_ip_v6"></a><a href="#fixed_ip_v6"><code>fixed_ip_v6</code></a> - <strong>(Optional)</strong> Specifies a fixed IPv6 address to be used on this\nnetwork. Changing this creates a new bms server.</p>\n</li>',elementType:"li",listDepth:1},{name:"access_network",description:'<li><p><a name="access_network"></a><a href="#access_network"><code>access_network</code></a> - <strong>(Optional)</strong> Specifies if this network should be used for\nprovisioning access. Accepts true or false. Defaults to false.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/compute_bms_server_v2.html",docType:""},{id:23,type:"  opentelekomcloud_ecs_instance_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> A unique name for the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_id",description:'<li><p><a name="image_id"></a><a href="#image_id"><code>image_id</code></a> - <strong>(Required)</strong> The ID of the desired image for the server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"flavor",description:'<li><p><a name="flavor"></a><a href="#flavor"><code>flavor</code></a> - <strong>(Required)</strong> The name of the desired flavor for the server. Changing this resizes the existing server.</p>\n</li>',elementType:"li",listDepth:1},{name:"user_data",description:'<li><p><a name="user_data"></a><a href="#user_data"><code>user_data</code></a> - <strong>(Optional)</strong> The user data to provide when launching the instance.\nChanging this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"password",description:'<li><p><a name="password"></a><a href="#password"><code>password</code></a> - <strong>(Optional)</strong> The administrative password to assign to the server.\nChanging this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"key_name",description:'<li><p><a name="key_name"></a><a href="#key_name"><code>key_name</code></a> - <strong>(Optional)</strong> The name of a key pair to put on the server. The key\npair must already be created and associated with the tenant\'s account.\nChanging this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"vpc_id",description:'<li><p><a name="vpc_id"></a><a href="#vpc_id"><code>vpc_id</code></a> - <strong>(Required)</strong> The ID of the desired VPC for the server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"nics",description:'<li><p><a name="nics"></a><a href="#nics"><code>nics</code></a> - <strong>(Optional)</strong> An array of one or more networks to attach to the\ninstance. The nics object structure is documented below. Changing this\ncreates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="system_disk_type"></a><a href="#system_disk_type"><code>system_disk_type</code></a> - (Optional) The system disk type of the server. For HANA, HL1, and HL2 ECSs use co-p1 and uh-l1 disks.\nChanging this creates a new server. Available options are:</p>',elementType:"p"},{name:"SATA",description:": common I/O disk type.\n",elementType:"li",listDepth:2},{name:"SAS",description:": high I/O disk type.\n",elementType:"li",listDepth:2},{name:"SSD",description:": ultra-high I/O disk type.\n",elementType:"li",listDepth:2},{name:"co-p1",description:": high I/O(performance-optimized) disk type.\n",elementType:"li",listDepth:2},{name:"uh-l1",description:": ultra-high I/O(latency-optimized) disk type.\n",elementType:"li",listDepth:2},{name:"system_disk_size",description:'<li><p><a name="system_disk_size"></a><a href="#system_disk_size"><code>system_disk_size</code></a> - <strong>(Optional)</strong> The system disk size in GB, The value range is 1 to 1024. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"data_disks",description:'<li><p><a name="data_disks"></a><a href="#data_disks"><code>data_disks</code></a> - <strong>(Optional)</strong> An array of one or more data disks to attach to the\ninstance. The data_disks object structure is documented below. Changing this\ncreates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_groups",description:'<li><p><a name="security_groups"></a><a href="#security_groups"><code>security_groups</code></a> - <strong>(Optional)</strong> An array of one or more security group names\nto associate with the server. Changing this results in adding/removing\nsecurity groups from the existing server.</p>\n</li>',elementType:"li",listDepth:1},{name:"availability_zone",description:'<li><p><a name="availability_zone"></a><a href="#availability_zone"><code>availability_zone</code></a> - <strong>(Required)</strong> The availability zone in which to create the server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"auto_recovery",description:'<li><p><a name="auto_recovery"></a><a href="#auto_recovery"><code>auto_recovery</code></a> - <strong>(Optional)</strong> Whether configure automatic recovery of an instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"delete_disks_on_termination",description:'<li><p><a name="delete_disks_on_termination"></a><a href="#delete_disks_on_termination"><code>delete_disks_on_termination</code></a> - <strong>(Optional)</strong> Delete the data disks upon termination of the instance. Defaults to false. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> Tags key/value pairs to associate with the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>nics</code> block supports:</p>",elementType:"p"},{name:"network_id",description:'<li><p><a name="network_id"></a><a href="#network_id"><code>network_id</code></a> - <strong>(Required)</strong> The network UUID to attach to the server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_address",description:'<li><p><a name="ip_address"></a><a href="#ip_address"><code>ip_address</code></a> - <strong>(Optional)</strong> Specifies a fixed IPv4 address to be used on this\nnetwork. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>data_disks</code> block supports:</p>",elementType:"p"},{name:"list description",description:'<p><a name="type"></a><a href="#type"><code>type</code></a> - (Required) The data disk type of the server. For HANA, HL1, and HL2 ECSs use co-p1 and uh-l1 disks.\nChanging this creates a new server. Available options are:</p>',elementType:"p"},{name:"SATA",description:": common I/O disk type.\n",elementType:"li",listDepth:2},{name:"SAS",description:": high I/O disk type.\n",elementType:"li",listDepth:2},{name:"SSD",description:": ultra-high I/O disk type.\n",elementType:"li",listDepth:2},{name:"co-p1",description:": high I/O(performance-optimized) disk type.\n",elementType:"li",listDepth:2},{name:"uh-l1",description:": ultra-high I/O(latency-optimized) disk type.\n",elementType:"li",listDepth:2},{name:"size",description:'<li><p><a name="size"></a><a href="#size"><code>size</code></a> - <strong>(Required)</strong> The size of the data disk in GB. The value range is 10 to 32768.\nChanging this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"snapshot_id",description:'<li><p><a name="snapshot_id"></a><a href="#snapshot_id"><code>snapshot_id</code></a> - <strong>(Optional)</strong> Specifies the snapshot ID or ID of the original data disk contained in the full-ECS image.\nChanging this creates a new server.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/ecs_instance_v1.html",docType:""},{id:24,type:"  opentelekomcloud_csbs_backup_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"backup_name",description:'<li><p><a name="backup_name"></a><a href="#backup_name"><code>backup_name</code></a> - <strong>(Optional)</strong> Name for the backup. The value consists of 1 to 255 characters and can contain only letters, digits, underscores (_), and hyphens (-). Changing backup_name creates a new backup.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Backup description. The value consists of 0 to 255 characters and must not contain a greater-than sign (&gt;) or less-than sign (&lt;). Changing description creates a new backup.</p>\n</li>',elementType:"li",listDepth:1},{name:"resource_id",description:'<li><p><a name="resource_id"></a><a href="#resource_id"><code>resource_id</code></a> - <strong>(Required)</strong> ID of the target to which the backup is restored. Changing this creates a new backup.</p>\n</li>',elementType:"li",listDepth:1},{name:"resource_type",description:'<li><p><a name="resource_type"></a><a href="#resource_type"><code>resource_type</code></a> - <strong>(Optional)</strong> Type of the target to which the backup is restored. The default value is <strong>OS::Nova::Server</strong> for an ECS. Changing this creates a new backup.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="tags"></a><a href="#tags"><code>tags</code></a> - (Optional) block supports the following arguments:</p>',elementType:"p"},{name:"key",description:"<strong>(Required)</strong> Tag key. It cannot be an empty string.Changing key creates a new backup.\n",elementType:"li",listDepth:2},{name:"value",description:"<strong>(Required)</strong> Tag value. It can be an empty string.Changing value creates a new backup.\n",elementType:"li",listDepth:2}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/csbs_backup_v1.html",docType:""},{id:25,type:"  opentelekomcloud_csbs_backup_policy_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> Specifies the name of backup policy. The value consists of 1 to 255 characters and can contain only letters, digits, underscores (_), and hyphens (-).</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Backup policy description. The value consists of 0 to 255 characters and must not contain a greater-than sign (&gt;) or less-than sign (&lt;).</p>\n</li>',elementType:"li",listDepth:1},{name:"provider_id",description:'<li><p><a name="provider_id"></a><a href="#provider_id"><code>provider_id</code></a> - <strong>(Required)</strong> Specifies backup provider ID. Default value is <strong>fc4d5750-22e7-4798-8a46-f48f62c4c1da</strong></p>\n</li>',elementType:"li",listDepth:1},{name:"common",description:'<li><p><a name="common"></a><a href="#common"><code>common</code></a> - <strong>(Optional)</strong> General backup policy parameters, which are blank by default.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="scheduled_operation"></a><a href="#scheduled_operation"><code>scheduled_operation</code></a> block supports the following arguments:</p>',elementType:"p"},{name:"name",description:"<strong>(Optional)</strong> Specifies Scheduling period name.The value consists of 1 to 255 characters and can contain only letters, digits, underscores (_), and hyphens (-).\n",elementType:"li",listDepth:2},{name:"description",description:"<strong>(Optional)</strong> Specifies Scheduling period description.The value consists of 0 to 255 characters and must not contain a greater-than sign (>) or less-than sign (<).\n",elementType:"li",listDepth:2},{name:"enabled",description:"<strong>(Optional)</strong> Specifies whether the scheduling period is enabled. Default value is <strong>true</strong>\n",elementType:"li",listDepth:2},{name:"max_backups",description:"<strong>(Optional)</strong> Specifies maximum number of backups that can be automatically created for a backup object.\n",elementType:"li",listDepth:2},{name:"retention_duration_days",description:"<strong>(Optional)</strong> Specifies duration of retaining a backup, in days.\n",elementType:"li",listDepth:2},{name:"permanent",description:"<strong>(Optional)</strong> Specifies whether backups are permanently retained.\n",elementType:"li",listDepth:2},{name:"trigger_pattern",description:"<strong>(Required)</strong> Specifies Scheduling policy of the scheduler.\n",elementType:"li",listDepth:2},{name:"operation_type",description:"<strong>(Required)</strong> Specifies Operation type, which can be backup.\n",elementType:"li",listDepth:2},{name:"list description",description:'<p><a name="resource"></a><a href="#resource"><code>resource</code></a> block supports the following arguments:</p>',elementType:"p"},{name:"id",description:"<strong>(Required)</strong> Specifies the ID of the object to be backed up.\n",elementType:"li",listDepth:2},{name:"type",description:"<strong>(Required)</strong> Entity object type of the backup object. If the type is VMs, the value is <strong>OS::Nova::Server</strong>.\n",elementType:"li",listDepth:2},{name:"name",description:"<strong>(Required)</strong> Specifies backup object name.\n",elementType:"li",listDepth:2},{name:"list description",description:'<p><a name="tags"></a><a href="#tags"><code>tags</code></a> block supports the following arguments:</p>',elementType:"p"},{name:"key",description:"<strong>(Required)</strong> Tag key. It cannot be an empty string.\n",elementType:"li",listDepth:2},{name:"value",description:"<strong>(Required)</strong> Tag value. It can be an empty string.\n",elementType:"li",listDepth:2}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/csbs_backup_policy_v1.html",docType:""},{id:26,type:"  opentelekomcloud_cts_tracker_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"bucket_name",description:'<li><p><a name="bucket_name"></a><a href="#bucket_name"><code>bucket_name</code></a> - <strong>(Required)</strong> The OBS bucket name for a tracker.</p>\n</li>',elementType:"li",listDepth:1},{name:"file_prefix_name",description:'<li><p><a name="file_prefix_name"></a><a href="#file_prefix_name"><code>file_prefix_name</code></a> - <strong>(Optional)</strong> The prefix of a log that needs to be stored in an OBS bucket.</p>\n</li>',elementType:"li",listDepth:1},{name:"is_support_smn",description:'<li><p><a name="is_support_smn"></a><a href="#is_support_smn"><code>is_support_smn</code></a> - <strong>(Required)</strong> Specifies whether SMN is supported. When the value is false, topic_id and operations can be left empty.</p>\n</li>',elementType:"li",listDepth:1},{name:"topic_id",description:'<li><p><a name="topic_id"></a><a href="#topic_id"><code>topic_id</code></a> - <strong>(Required)</strong>The theme of the SMN service, Is obtained from SMN and in the format of <strong>urn:smn:([a-z]|[A-Z]|[0-9]|-){1,32}:([a-z]|[A-Z]|[0-9]){32}:([a-z]|[A-Z]|[0-9]|-|_){1,256}</strong>.</p>\n</li>',elementType:"li",listDepth:1},{name:"operations",description:'<li><p><a name="operations"></a><a href="#operations"><code>operations</code></a> - <strong>(Required)</strong> Trigger conditions for sending a notification.</p>\n</li>',elementType:"li",listDepth:1},{name:"is_send_all_key_operation",description:'<li><p><a name="is_send_all_key_operation"></a><a href="#is_send_all_key_operation"><code>is_send_all_key_operation</code></a> - <strong>(Required)</strong> When the value is <strong>false</strong>, operations cannot be left empty.</p>\n</li>',elementType:"li",listDepth:1},{name:"need_notify_user_list",description:'<li><p><a name="need_notify_user_list"></a><a href="#need_notify_user_list"><code>need_notify_user_list</code></a> - <strong>(Optional)</strong> The users using the login function. When these users log in, notifications will be sent.</p>\n</li>',elementType:"li",listDepth:1},{name:"status",description:'<li><p><a name="status"></a><a href="#status"><code>status</code></a> - <strong>(Optional)</strong> The status of a tracker. The value should be <strong>enabled</strong> when creating a tracker, and when updating the value can be enabled or disabled.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/cts_tracker_v1.html",docType:""},{id:27,type:"  opentelekomcloud_rds_instance_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> Specifies the DB instance name. The DB instance name of\nthe same type is unique in the same tenant. The changes of the instance name\nwill be suppressed in HA scenario.</p>\n</li>',elementType:"li",listDepth:1},{name:"datastore",description:'<li><p><a name="datastore"></a><a href="#datastore"><code>datastore</code></a> - <strong>(Required)</strong> Specifies database information. The structure is\ndescribed below.</p>\n</li>',elementType:"li",listDepth:1},{name:"flavorref",description:'<li><p><a name="flavorref"></a><a href="#flavorref"><code>flavorref</code></a> - <strong>(Required)</strong> Specifies the specification ID (flavors.id in the\nresponse message in Obtaining All DB Instance Specifications). If you want\nto enable ha for the rds instance, a flavor with ha speccode is required.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume",description:'<li><p><a name="volume"></a><a href="#volume"><code>volume</code></a> - <strong>(Required)</strong> Specifies the volume information. The structure is described\nbelow.</p>\n</li>',elementType:"li",listDepth:1},{name:"availabilityzone",description:'<li><p><a name="availabilityzone"></a><a href="#availabilityzone"><code>availabilityzone</code></a> - <strong>(Required)</strong> Specifies the ID of the AZ.</p>\n</li>',elementType:"li",listDepth:1},{name:"vpc",description:'<li><p><a name="vpc"></a><a href="#vpc"><code>vpc</code></a> - <strong>(Required)</strong> Specifies the VPC ID. For details about how to obtain this\nparameter value, see section "Virtual Private Cloud" in the Virtual Private\nCloud API Reference.</p>\n</li>',elementType:"li",listDepth:1},{name:"nics",description:'<li><p><a name="nics"></a><a href="#nics"><code>nics</code></a> - <strong>(Required)</strong> Specifies the nics information. For details about how\nto obtain this parameter value, see section "Subnet" in the Virtual Private\nCloud API Reference. The structure is described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"securitygroup",description:'<li><p><a name="securitygroup"></a><a href="#securitygroup"><code>securitygroup</code></a> - <strong>(Required)</strong> Specifies the security group which the RDS DB\ninstance belongs to. The structure is described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"dbport",description:'<li><p><a name="dbport"></a><a href="#dbport"><code>dbport</code></a> - <strong>(Optional)</strong> Specifies the database port number.</p>\n</li>',elementType:"li",listDepth:1},{name:"backupstrategy",description:'<li><p><a name="backupstrategy"></a><a href="#backupstrategy"><code>backupstrategy</code></a> - <strong>(Optional)</strong> Specifies the advanced backup policy. The structure\nis described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"dbrtpd",description:'<li><p><a name="dbrtpd"></a><a href="#dbrtpd"><code>dbrtpd</code></a> - <strong>(Required)</strong> Specifies the password for user root of the database.</p>\n</li>',elementType:"li",listDepth:1},{name:"tag",description:'<li><p><a name="tag"></a><a href="#tag"><code>tag</code></a> - <strong>(Optional)</strong> Tags key/value pairs to associate with the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"ha",description:'<li><p><a name="ha"></a><a href="#ha"><code>ha</code></a> - <strong>(Optional)</strong> Specifies the parameters configured on HA and is used when\ncreating HA DB instances. The structure is described below. NOTICE:\nRDS for Microsoft SQL Server does not support creating HA DB instances and\nthis parameter is not involved.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>datastore</code> block supports:</p>",elementType:"p"},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Required)</strong> Specifies the DB engine. Currently, MySQL, PostgreSQL, and\nMicrosoft SQL Server are supported. The value is MySQL, PostgreSQL, or SQLServer.</p>\n</li>',elementType:"li",listDepth:1},{name:"version",description:'<li><p><a name="version"></a><a href="#version"><code>version</code></a> - <strong>(Required)</strong> Specifies the DB instance version.</p>\n</li>',elementType:"li",listDepth:1},{name:null,description:"<li><p>Available value for attributes</p>\n</li>",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>volume</code> block supports:</p>",elementType:"p"},{name:"type",description:'<li><p><a name="type-1"></a><a href="#type-1"><code>type</code></a> - <strong>(Required)</strong> Specifies the volume type. Valid value:\nIt must be COMMON (SATA) or ULTRAHIGH (SSD) and is case-sensitive.</p>\n</li>',elementType:"li",listDepth:1},{name:"size",description:'<li><p><a name="size"></a><a href="#size"><code>size</code></a> - <strong>(Required)</strong> Specifies the volume size.\nIts value must be a multiple of 10 and the value range is 100 GB to 2000 GB.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>nics</code> block supports:</p>",elementType:"p"},{name:"subnetId",description:"<strong>(Required)</strong> Specifies the subnet ID obtained from the VPC.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>securitygroup</code> block supports:</p>",elementType:"p"},{name:"id",description:"<strong>(Required)</strong> Specifies the ID obtained from the securitygroup.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>backupstrategy</code> block supports:</p>",elementType:"p"},{name:"starttime",description:'<li><p><a name="starttime"></a><a href="#starttime"><code>starttime</code></a> - <strong>(Optional)</strong> Indicates the backup start time that has been set.\nThe backup task will be triggered within one hour after the backup start time.\nValid value: The value cannot be empty. It must use the hh:mm:ss format and\nmust be valid. The current time is the UTC time.</p>\n</li>',elementType:"li",listDepth:1},{name:"keepdays",description:'<li><p><a name="keepdays"></a><a href="#keepdays"><code>keepdays</code></a> - <strong>(Optional)</strong> Specifies the number of days to retain the generated backup files.\nIts value range is 0 to 35. If this parameter is not specified or set to 0, the\nautomated backup policy is disabled.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>ha</code> block supports:</p>",elementType:"p"},{name:"enable",description:'<li><p><a name="enable"></a><a href="#enable"><code>enable</code></a> - <strong>(Optional)</strong> Specifies the configured parameters on the HA.\nValid value: The value is true or false. The value true indicates creating\nHA DB instances. The value false indicates creating a single DB instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"replicationmode",description:'<li><p><a name="replicationmode"></a><a href="#replicationmode"><code>replicationmode</code></a> - <strong>(Optional)</strong> Specifies the replication mode for the standby DB instance.\nThe value cannot be empty.\nFor MySQL, the value is async or semisync.\nFor PostgreSQL, the value is async or sync.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/rds_instance_v1.html",docType:""},{id:28,type:"  opentelekomcloud_rds_instance_v3",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"availability_zone",description:'<li><p><a name="availability_zone"></a><a href="#availability_zone"><code>availability_zone</code></a> -\n<strong>(Required)</strong>\nSpecifies the AZ name. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"db",description:'<li><p><a name="db"></a><a href="#db"><code>db</code></a> -\n<strong>(Required)</strong>\nSpecifies the database information. Structure is documented below. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"flavor",description:'<li><p><a name="flavor"></a><a href="#flavor"><code>flavor</code></a> -\n<strong>(Required)</strong>\nSpecifies the specification code.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> -\n<strong>(Required)</strong>\nSpecifies the DB instance name. The DB instance name of the same type\nmust be unique for the same tenant. The value must be 4 to 64\ncharacters in length and start with a letter. It is case-sensitive\nand can contain only letters, digits, hyphens (-), and underscores\n(_).  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_group_id",description:'<li><p><a name="security_group_id"></a><a href="#security_group_id"><code>security_group_id</code></a> -\n<strong>(Required)</strong>\nSpecifies the security group which the RDS DB instance belongs to.\nChanging this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"subnet_id",description:'<li><p><a name="subnet_id"></a><a href="#subnet_id"><code>subnet_id</code></a> -\n<strong>(Required)</strong>\nSpecifies the subnet id. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume",description:'<li><p><a name="volume"></a><a href="#volume"><code>volume</code></a> -\n<strong>(Required)</strong>\nSpecifies the volume information. Structure is documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"vpc_id",description:'<li><p><a name="vpc_id"></a><a href="#vpc_id"><code>vpc_id</code></a> -\n<strong>(Required)</strong>\nSpecifies the VPC ID. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"backup_strategy",description:'<li><p><a name="backup_strategy"></a><a href="#backup_strategy"><code>backup_strategy</code></a> -\n<strong>(Optional)</strong>\nSpecifies the advanced backup policy. Structure is documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"ha_replication_mode",description:'<li><p><a name="ha_replication_mode"></a><a href="#ha_replication_mode"><code>ha_replication_mode</code></a> -\n<strong>(Optional)</strong>\nSpecifies the replication mode for the standby DB instance. For MySQL, the value\nis async or semisync. For PostgreSQL, the value is async or sync. For\nMicrosoft SQL Server, the value is sync. NOTE: async indicates the\nasynchronous replication mode. semisync indicates the\nsemi-synchronous replication mode. sync indicates the synchronous\nreplication mode.  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"param_group_id",description:'<li><p><a name="param_group_id"></a><a href="#param_group_id"><code>param_group_id</code></a> -\n<strong>(Optional)</strong>\nSpecifies the parameter group ID. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"tag",description:'<li><p><a name="tag"></a><a href="#tag"><code>tag</code></a> - <strong>(Optional)</strong> Tags key/value pairs to associate with the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>db</code> block supports:</p>",elementType:"p"},{name:"password",description:'<li><p><a name="password"></a><a href="#password"><code>password</code></a> -\n<strong>(Required)</strong>\nSpecifies the database password. The value cannot be\nempty and should contain 8 to 32 characters, including uppercase\nand lowercase letters, digits, and the following special\ncharacters: ~!@#%<sup>*-_=+?</sup> You are advised to enter a strong\npassword to improve security, preventing security risks such as\nbrute force cracking.  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"port",description:'<li><p><a name="port"></a><a href="#port"><code>port</code></a> -\n<strong>(Optional)</strong>\nSpecifies the database port information. The MySQL database port\nranges from 1024 to 65535 (excluding 12017 and 33071, which are\noccupied by the RDS system and cannot be used). The PostgreSQL\ndatabase port ranges from 2100 to 9500. The Microsoft SQL Server\ndatabase port can be 1433 or ranges from 2100 to 9500, excluding\n5355 and 5985. If this parameter is not set, the default value is\nas follows: For MySQL, the default value is 3306. For PostgreSQL,\nthe default value is 5432. For Microsoft SQL Server, the default\nvalue is 1433.  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> -\n<strong>(Required)</strong>\nSpecifies the DB engine. Value: MySQL, PostgreSQL, SQLServer. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"user_name",description:'<li><p><a name="user_name"></a><a href="#user_name"><code>user_name</code></a> -\nIndicates the default user name of database.</p>\n</li>',elementType:"li",listDepth:1},{name:"version",description:'<li><p><a name="version"></a><a href="#version"><code>version</code></a> -\n<strong>(Required)</strong>\nSpecifies the database version. MySQL databases support MySQL 5.6\nand 5.7. PostgreSQL databases support\nPostgreSQL 9.5 and 9.6. Microsoft SQL Server\ndatabases support 2014 SE, 2016 SE, and 2016 EE.\nChanging this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>volume</code> block supports:</p>",elementType:"p"},{name:"disk_encryption_id",description:'<li><p><a name="disk_encryption_id"></a><a href="#disk_encryption_id"><code>disk_encryption_id</code></a> -\n<strong>(Optional)</strong>\nSpecifies the key ID for disk encryption. Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"size",description:'<li><p><a name="size"></a><a href="#size"><code>size</code></a> -\n<strong>(Required)</strong>\nSpecifies the volume size. Its value range is from 40 GB to 4000\nGB. The value must be a multiple of 10. Changing this resize the volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"type",description:'<li><p><a name="type-1"></a><a href="#type-1"><code>type</code></a> -\n<strong>(Required)</strong>\nSpecifies the volume type. Its value can be any of the following\nand is case-sensitive: COMMON: indicates the SATA type.<br/>\nULTRAHIGH: indicates the SSD type.  Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>backup_strategy</code> block supports:</p>",elementType:"p"},{name:"keep_days",description:'<li><p><a name="keep_days"></a><a href="#keep_days"><code>keep_days</code></a> -\n<strong>(Optional)</strong>\nSpecifies the retention days for specific backup files. The value\nrange is from 0 to 732. If this parameter is not specified or set\nto 0, the automated backup policy is disabled. NOTICE:\nPrimary/standby DB instances of Microsoft SQL Server do not\nsupport disabling the automated backup policy.</p>\n</li>',elementType:"li",listDepth:1},{name:"start_time",description:'<li><p><a name="start_time"></a><a href="#start_time"><code>start_time</code></a> -\n<strong>(Required)</strong>\nSpecifies the backup time window. Automated backups will be\ntriggered during the backup time window. It must be a valid value in the "hh:mm-HH:MM"\nformat. The current time is in the UTC format. The HH value must\nbe 1 greater than the hh value. The values of mm and MM must be\nthe same and must be set to any of the following: 00, 15, 30, or</p>\n<ol>\n<li>Example value: 08:15-09:15 23:00-00:00.\n</li>\n</ol>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/rds_instance_v3.html",docType:""},{id:29,type:"  opentelekomcloud_rds_parametergroup_v3",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The parameter group name. It contains a maximum of 64 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> The parameter group description. It contains a maximum of 256 characters and cannot contain the following special characters:&gt;!&lt;"&amp;\'= the value is left blank by default.</p>\n</li>',elementType:"li",listDepth:1},{name:"values",description:'<li><p><a name="values"></a><a href="#values"><code>values</code></a> - <strong>(Optional)</strong> Parameter group values key/value pairs defined by users based on the default parameter groups.</p>\n</li>',elementType:"li",listDepth:1},{name:"datastore",description:'<li><p><a name="datastore"></a><a href="#datastore"><code>datastore</code></a> - <strong>(Required)</strong> Database object. The database object structure is documented below. Changing this creates a new parameter group.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>datastore</code> block supports:</p>",elementType:"p"},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Required)</strong> The DB engine. Currently, MySQL, PostgreSQL, and Microsoft SQL Server are supported. The value is case-insensitive and can be mysql, postgresql, or sqlserver.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="version"></a><a href="#version"><code>version</code></a> - (Required) Specifies the database version.</p>',elementType:"p"},{name:"MySQL databases support MySQL 5.6 and 5.7. Example value: 5.7.\n",description:"<li>MySQL databases support MySQL 5.6 and 5.7. Example value: 5.7.\n</li>",elementType:"li",listDepth:2},{name:"PostgreSQL databases support PostgreSQL 9.5 and 9.6. Example value: 9.5.\n",description:"<li>PostgreSQL databases support PostgreSQL 9.5 and 9.6. Example value: 9.5.\n</li>",elementType:"li",listDepth:2},{name:"Microsoft SQL Server databases support 2014 SE, 2016 SE, and 2016 EE. Example value: 2014_SE.\n",description:"<li>Microsoft SQL Server databases support 2014 SE, 2016 SE, and 2016 EE. Example value: 2014_SE.\n</li>",elementType:"li",listDepth:2}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/rds_parametergroup_v3.html",docType:""},{id:30,type:"  opentelekomcloud_dcs_instance_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> Indicates the name of an instance. An instance name starts with a letter,\nconsists of 4 to 64 characters, and supports only letters, digits, and hyphens (-).</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Indicates the description of an instance. It is a character\nstring containing not more than 1024 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"engine",description:'<li><p><a name="engine"></a><a href="#engine"><code>engine</code></a> - <strong>(Required)</strong> Indicates a cache engine. Only Redis is supported. Changing this\ncreates a new instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"engine_version",description:'<li><p><a name="engine_version"></a><a href="#engine_version"><code>engine_version</code></a> - <strong>(Required)</strong> Indicates the version of a cache engine, which is 3.0.7.\nChanging this creates a new instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"capacity",description:'<li><p><a name="capacity"></a><a href="#capacity"><code>capacity</code></a> - <strong>(Required)</strong> Indicates the Cache capacity. Unit: GB.\nFor a DCS Redis or Memcached instance in single-node or master/standby mode, the cache\ncapacity can be 2 GB, 4 GB, 8 GB, 16 GB, 32 GB, or 64 GB.\nFor a DCS Redis instance in cluster mode, the cache capacity can be 64, 128, 256, 512GB.\nChanging this creates a new instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"access_user",description:'<li><p><a name="access_user"></a><a href="#access_user"><code>access_user</code></a> - <strong>(Optional)</strong> Username used for accessing a DCS instance after password\nauthentication. A username starts with a letter, consists of 1 to 64 characters,\nand supports only letters, digits, and hyphens (-).\nChanging this creates a new instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"password",description:'<li><p><a name="password"></a><a href="#password"><code>password</code></a> - <strong>(Required)</strong> Password of a DCS instance.\nThe password of a DCS Redis instance must meet the following complexity requirements:\nChanging this creates a new instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"vpc_id",description:'<li><p><a name="vpc_id"></a><a href="#vpc_id"><code>vpc_id</code></a> - <strong>(Required)</strong> Tenant\'s VPC ID. For details on how to create VPCs, see the\nVirtual Private Cloud API Reference.\nChanging this creates a new instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_group_id",description:'<li><p><a name="security_group_id"></a><a href="#security_group_id"><code>security_group_id</code></a> - <strong>(Required)</strong> Tenant\'s security group ID. For details on how to\ncreate security groups, see the Virtual Private Cloud API Reference.</p>\n</li>',elementType:"li",listDepth:1},{name:"subnet_id",description:'<li><p><a name="subnet_id"></a><a href="#subnet_id"><code>subnet_id</code></a> - <strong>(Required)</strong> Subnet ID. For details on how to create subnets, see the\nVirtual Private Cloud API Reference.\nChanging this creates a new instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"available_zones",description:'<li><p><a name="available_zones"></a><a href="#available_zones"><code>available_zones</code></a> - <strong>(Required)</strong> IDs of the AZs where cache nodes reside. For details\non how to query AZs, see Querying AZ Information.\nChanging this creates a new instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"product_id",description:'<li><p><a name="product_id"></a><a href="#product_id"><code>product_id</code></a> - <strong>(Required)</strong> Product ID used to differentiate DCS instance types.\nChanging this creates a new instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"maintain_begin",description:'<li><p><a name="maintain_begin"></a><a href="#maintain_begin"><code>maintain_begin</code></a> - <strong>(Optional)</strong> Indicates the time at which a maintenance time window starts.\nFormat: HH:mm:ss.\nThe start time and end time of a maintenance time window must indicate the time segment of\na supported maintenance time window. For details, see section Querying Maintenance Time Windows.\nThe start time must be set to 22:00, 02:00, 06:00, 10:00, 14:00, or 18:00.\nParameters maintain_begin and maintain_end must be set in pairs. If parameter maintain_begin\nis left blank, parameter maintain_end is also blank. In this case, the system automatically\nallocates the default start time 02:00.</p>\n</li>',elementType:"li",listDepth:1},{name:"maintain_end",description:'<li><p><a name="maintain_end"></a><a href="#maintain_end"><code>maintain_end</code></a> - <strong>(Optional)</strong> Indicates the time at which a maintenance time window ends.\nFormat: HH:mm:ss.\nThe start time and end time of a maintenance time window must indicate the time segment of\na supported maintenance time window. For details, see section Querying Maintenance Time Windows.\nThe end time is four hours later than the start time. For example, if the start time is 22:00,\nthe end time is 02:00.\nParameters maintain_begin and maintain_end must be set in pairs. If parameter maintain_end is left\nblank, parameter maintain_begin is also blank. In this case, the system automatically allocates\nthe default end time 06:00.</p>\n</li>',elementType:"li",listDepth:1},{name:"save_days",description:'<li><p><a name="save_days"></a><a href="#save_days"><code>save_days</code></a> - <strong>(Required)</strong> Retention time. Unit: day. Range: 1\u20137.\nChanging this creates a new instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"backup_type",description:'<li><p><a name="backup_type"></a><a href="#backup_type"><code>backup_type</code></a> - <strong>(Required)</strong> Backup type. Options:\nauto: automatic backup.\nmanual: manual backup.\nChanging this creates a new instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"begin_at",description:'<li><p><a name="begin_at"></a><a href="#begin_at"><code>begin_at</code></a> - <strong>(Required)</strong> Time at which backup starts. "00:00-01:00" indicates that backup\nstarts at 00:00:00.\nChanging this creates a new instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"period_type",description:'<li><p><a name="period_type"></a><a href="#period_type"><code>period_type</code></a> - <strong>(Required)</strong> Interval at which backup is performed. Currently, only weekly\nbackup is supported.\nChanging this creates a new instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"backup_at",description:'<li><p><a name="backup_at"></a><a href="#backup_at"><code>backup_at</code></a> - <strong>(Required)</strong> Day in a week on which backup starts. Range: 1\u20137. Where: 1\nindicates Monday; 7 indicates Sunday.\nChanging this creates a new instance.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/dcs_instance_v1.html",docType:""},{id:31,type:"opentelekomcloud_deh_host_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> <strong>(Required)</strong> - The name of the Dedicated Host.</p>\n</li>',elementType:"li",listDepth:1},{name:"auto_placement",description:'<li><p><a name="auto_placement"></a><a href="#auto_placement"><code>auto_placement</code></a> <strong>(Optional)</strong> - Allows a instance to be automatically placed onto the available Dedicated Hosts. The default value is <strong>on</strong>.</p>\n</li>',elementType:"li",listDepth:1},{name:"availability_zone",description:'<li><p><a name="availability_zone"></a><a href="#availability_zone"><code>availability_zone</code></a> <strong>(Required)</strong> - The Availability Zone to which the Dedicated Host belongs. Changing this parameter creates a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"host_type",description:'<li><p><a name="host_type"></a><a href="#host_type"><code>host_type</code></a> <strong>(Required)</strong> - The Dedicated Host type. Expected values are <strong>h1, general</strong> and <strong>d1</strong>. Changing this parameter creates a new resource.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/deh_host_v1.html",docType:""},{id:32,type:"  opentelekomcloud_dms_queue_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> Indicates the unique name of a queue. A string of 1 to 64\ncharacters that contain a-z, A-Z, 0-9, hyphens (-), and underscores (_).\nThe name cannot be modified once specified.</p>\n</li>',elementType:"li",listDepth:1},{name:"queue_mode",description:"<li><p><a name=\"queue_mode\"></a><a href=\"#queue_mode\"><code>queue_mode</code></a> - <strong>(Optional)</strong> Indicates the queue type. It only support 'NORMAL' and 'FIFO'.\nNORMAL: Standard queue. Best-effort ordering. Messages might be retrieved in an order\ndifferent from which they were sent. Select standard queues when throughput is important.\nFIFO: First-ln-First-out (FIFO) queue. FIFO delivery. Messages are retrieved in the\norder they were sent. Select FIFO queues when the order of messages is important.\nDefault value: NORMAL.</p>\n</li>",elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Indicates the basic information about a queue. The queue\ndescription must be 0 to 160 characters in length, and does not contain angle\nbrackets (&lt;) and (&gt;).</p>\n</li>',elementType:"li",listDepth:1},{name:"redrive_policy",description:"<li><p><a name=\"redrive_policy\"></a><a href=\"#redrive_policy\"><code>redrive_policy</code></a> - <strong>(Optional)</strong> Indicates whether to enable dead letter messages.\nDead letter messages indicate messages that cannot be normally consumed.\nThe redrive_policy should be set to 'enable' or 'disable'. The default value is 'disable'.</p>\n</li>",elementType:"li",listDepth:1},{name:"max_consume_count",description:'<li><p><a name="max_consume_count"></a><a href="#max_consume_count"><code>max_consume_count</code></a> - <strong>(Optional)</strong> This parameter is mandatory only when redrive_policy is\nset to enable. This parameter indicates the maximum number of allowed message consumption\nfailures. When a message fails to be consumed after the number of consumption attempts of\nthis message reaches this value, DMS stores this message into the dead letter queue.\nThe max_consume_count value range is 1\u2013100.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/dms_queue_v1.html",docType:""},{id:33,type:"  opentelekomcloud_dms_group_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> Indicates the unique name of a group. A string of 1 to 64\ncharacters that contain a-z, A-Z, 0-9, hyphens (-), and underscores (_).\nThe name cannot be modified once specified.</p>\n</li>',elementType:"li",listDepth:1},{name:"queue_id",description:'<li><p><a name="queue_id"></a><a href="#queue_id"><code>queue_id</code></a> - <strong>(Required)</strong> Indicates the ID of a specified queue.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/dms_group_v1.html",docType:""},{id:34,type:"  opentelekomcloud_dns_recordset_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"zone_id",description:'<li><p><a name="zone_id"></a><a href="#zone_id"><code>zone_id</code></a> - <strong>(Required)</strong> The ID of the zone in which to create the record set.\nChanging this creates a new DNS  record set.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the record set. Note the <code>.</code> at the end of the name.\nChanging this creates a new DNS  record set.</p>\n</li>',elementType:"li",listDepth:1},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Optional)</strong> The type of record set. Examples: "A", "MX".\nChanging this creates a new DNS  record set.</p>\n</li>',elementType:"li",listDepth:1},{name:"ttl",description:'<li><p><a name="ttl"></a><a href="#ttl"><code>ttl</code></a> - <strong>(Optional)</strong> The time to live (TTL) of the record set.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the  record set.</p>\n</li>',elementType:"li",listDepth:1},{name:"records",description:'<li><p><a name="records"></a><a href="#records"><code>records</code></a> - <strong>(Optional)</strong> An array of DNS records.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options. Changing this creates a\nnew record set.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/dns_recordset_v2.html",docType:""},{id:35,type:"  opentelekomcloud_dns_zone_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the zone. Note the <code>.</code> at the end of the name.\nChanging this creates a new DNS zone.</p>\n</li>',elementType:"li",listDepth:1},{name:"email",description:'<li><p><a name="email"></a><a href="#email"><code>email</code></a> - <strong>(Optional)</strong> The email contact for the zone record.</p>\n</li>',elementType:"li",listDepth:1},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Optional)</strong> The type of zone. Can either be <code>public</code> or <code>private</code>.\nChanging this creates a new zone.</p>\n</li>',elementType:"li",listDepth:1},{name:"ttl",description:'<li><p><a name="ttl"></a><a href="#ttl"><code>ttl</code></a> - <strong>(Optional)</strong> The time to live (TTL) of the zone.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the zone.</p>\n</li>',elementType:"li",listDepth:1},{name:"router",description:'<li><p><a name="router"></a><a href="#router"><code>router</code></a> <strong>(Optional)</strong> The Router(VPC) configuration for the private zone.\nit is required when type is <code>private</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"masters",description:'<li><p><a name="masters"></a><a href="#masters"><code>masters</code></a> - <strong>(Optional)</strong> An array of master DNS servers.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options. Changing this creates a\nnew zone.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>router</code> block supports:</p>",elementType:"p"},{name:"router_id",description:'<li><p><a name="router_id"></a><a href="#router_id"><code>router_id</code></a> <strong>(Required)</strong> The Router(VPC) ID. which VPC network will assicate with.</p>\n</li>',elementType:"li",listDepth:1},{name:"router_region",description:'<li><p><a name="router_region"></a><a href="#router_region"><code>router_region</code></a> <strong>(Required)</strong> The Region name for this private zone.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/dns_zone_v2.html",docType:""},{id:36,type:"  opentelekomcloud_vpc_eip_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"publicip",description:'<li><p><a name="publicip"></a><a href="#publicip"><code>publicip</code></a> - <strong>(Required)</strong> The elastic IP address object.</p>\n</li>',elementType:"li",listDepth:1},{name:"bandwidth",description:'<li><p><a name="bandwidth"></a><a href="#bandwidth"><code>bandwidth</code></a> - <strong>(Required)</strong> The bandwidth object.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>publicip</code> block supports:</p>",elementType:"p"},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Required)</strong> The value must be a type supported by the system. Only\n<code>5_bgp</code> supported now. Changing this creates a new eip.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_address",description:'<li><p><a name="ip_address"></a><a href="#ip_address"><code>ip_address</code></a> - <strong>(Optional)</strong> The value must be a valid IP address in the available\nIP address segment. Changing this creates a new eip.</p>\n</li>',elementType:"li",listDepth:1},{name:"port_id",description:'<li><p><a name="port_id"></a><a href="#port_id"><code>port_id</code></a> - <strong>(Optional)</strong> The port id which this eip will associate with. If the value\nis "" or this not specified, the eip will be in unbind state.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>bandwidth</code> block supports:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The bandwidth name, which is a string of 1 to 64 characters\nthat contain letters, digits, underscores (_), and hyphens (-).</p>\n</li>',elementType:"li",listDepth:1},{name:"size",description:'<li><p><a name="size"></a><a href="#size"><code>size</code></a> - <strong>(Required)</strong> The bandwidth size. The value ranges from 1 to 300 Mbit/s.</p>\n</li>',elementType:"li",listDepth:1},{name:"share_type",description:'<li><p><a name="share_type"></a><a href="#share_type"><code>share_type</code></a> - <strong>(Required)</strong> Whether the bandwidth is shared or exclusive. Changing\nthis creates a new eip.</p>\n</li>',elementType:"li",listDepth:1},{name:"charge_mode",description:'<li><p><a name="charge_mode"></a><a href="#charge_mode"><code>charge_mode</code></a> - <strong>(Optional)</strong> This is a reserved field. If the system supports charging\nby traffic and this field is specified, then you are charged by traffic for elastic\nIP addresses. Changing this creates a new eip.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/vpc_eip_v1.html",docType:""},{id:37,type:"  opentelekomcloud_lb_loadbalancer_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"vip_subnet_id",description:'<li><p><a name="vip_subnet_id"></a><a href="#vip_subnet_id"><code>vip_subnet_id</code></a> - <strong>(Required)</strong> The network on which to allocate the\nLoadbalancer\'s address. A tenant can only create Loadbalancers on networks\nauthorized by policy (e.g. networks that belong to them or networks that\nare shared).  Changing this creates a new loadbalancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> Human-readable name for the Loadbalancer. Does not have\nto be unique.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Human-readable description for the Loadbalancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> Required for admins. The UUID of the tenant who owns\nthe Loadbalancer.  Only administrative users can specify a tenant UUID\nother than their own.  Changing this creates a new loadbalancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"vip_address",description:'<li><p><a name="vip_address"></a><a href="#vip_address"><code>vip_address</code></a> - <strong>(Optional)</strong> The ip address of the load balancer.\nChanging this creates a new loadbalancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_state_up",description:'<li><p><a name="admin_state_up"></a><a href="#admin_state_up"><code>admin_state_up</code></a> - <strong>(Optional)</strong> The administrative state of the Loadbalancer.\nA valid value is only true (UP).</p>\n</li>',elementType:"li",listDepth:1},{name:"loadbalancer_provider",description:'<li><p><a name="loadbalancer_provider"></a><a href="#loadbalancer_provider"><code>loadbalancer_provider</code></a> - <strong>(Optional)</strong> The name of the provider. Changing this\ncreates a new loadbalancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_group_ids",description:'<li><p><a name="security_group_ids"></a><a href="#security_group_ids"><code>security_group_ids</code></a> - <strong>(Optional)</strong> A list of security group IDs to apply to the\nloadbalancer. The security groups must be specified by ID and not name (as\nopposed to how they are configured with the Compute Instance).</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/lb_loadbalancer_v2.html",docType:""},{id:38,type:"  opentelekomcloud_lb_listener_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"protocol",description:'<li><p><a name="protocol"></a><a href="#protocol"><code>protocol</code></a> - <strong>(Required)</strong> The protocol - can either be TCP, HTTP, HTTPS or TERMINATED_HTTPS.\nChanging this creates a new Listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"protocol_port",description:'<li><p><a name="protocol_port"></a><a href="#protocol_port"><code>protocol_port</code></a> - <strong>(Required)</strong> The port on which to listen for client traffic.\nChanging this creates a new Listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> Required for admins. The UUID of the tenant who owns\nthe Listener.  Only administrative users can specify a tenant UUID\nother than their own. Changing this creates a new Listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"loadbalancer_id",description:'<li><p><a name="loadbalancer_id"></a><a href="#loadbalancer_id"><code>loadbalancer_id</code></a> - <strong>(Required)</strong> The load balancer on which to provision this\nListener. Changing this creates a new Listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> Human-readable name for the Listener. Does not have\nto be unique.</p>\n</li>',elementType:"li",listDepth:1},{name:"default_pool_id",description:'<li><p><a name="default_pool_id"></a><a href="#default_pool_id"><code>default_pool_id</code></a> - <strong>(Optional)</strong> The ID of the default pool with which the\nListener is associated. Changing this creates a new Listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Human-readable description for the Listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"default_tls_container_ref",description:'<li><p><a name="default_tls_container_ref"></a><a href="#default_tls_container_ref"><code>default_tls_container_ref</code></a> - <strong>(Optional)</strong> A reference to a Barbican Secrets\ncontainer which stores TLS information. This is required if the protocol\nis <code>TERMINATED_HTTPS</code>. See\n<a href="https://wiki.openstack.org/wiki/Network/LBaaS/docs/how-to-create-tls-loadbalancer">here</a>\nfor more information.</p>\n</li>',elementType:"li",listDepth:1},{name:"sni_container_refs",description:'<li><p><a name="sni_container_refs"></a><a href="#sni_container_refs"><code>sni_container_refs</code></a> - <strong>(Optional)</strong> A list of references to Barbican Secrets\ncontainers which store SNI information. See\n<a href="https://wiki.openstack.org/wiki/Network/LBaaS/docs/how-to-create-tls-loadbalancer">here</a>\nfor more information.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_state_up",description:'<li><p><a name="admin_state_up"></a><a href="#admin_state_up"><code>admin_state_up</code></a> - <strong>(Optional)</strong> The administrative state of the Listener.\nA valid value is true (UP) or false (DOWN).</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/lb_listener_v2.html",docType:""},{id:39,type:"  opentelekomcloud_lb_pool_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> Required for admins. The UUID of the tenant who owns\nthe pool.  Only administrative users can specify a tenant UUID\nother than their own. Changing this creates a new pool.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> Human-readable name for the pool.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Human-readable description for the pool.</p>\n</li>',elementType:"li",listDepth:1},{name:"protocol",description:'<li><p><a name="protocol"></a><a href="#protocol"><code>protocol</code></a> = <strong>(Required)</strong> The protocol - can either be TCP, HTTP or HTTPS.\nChanging this creates a new pool.</p>\n</li>',elementType:"li",listDepth:1},{name:"loadbalancer_id",description:'<li><p><a name="loadbalancer_id"></a><a href="#loadbalancer_id"><code>loadbalancer_id</code></a> - <strong>(Optional)</strong> The load balancer on which to provision this\npool. Changing this creates a new pool.\nNote:  One of LoadbalancerID or ListenerID must be provided.</p>\n</li>',elementType:"li",listDepth:1},{name:"listener_id",description:'<li><p><a name="listener_id"></a><a href="#listener_id"><code>listener_id</code></a> - <strong>(Optional)</strong> The Listener on which the members of the pool\nwill be associated with. Changing this creates a new pool.\nNote:  One of LoadbalancerID or ListenerID must be provided.</p>\n</li>',elementType:"li",listDepth:1},{name:"lb_method",description:'<li><p><a name="lb_method"></a><a href="#lb_method"><code>lb_method</code></a> - <strong>(Required)</strong> The load balancing algorithm to\ndistribute traffic to the pool\'s members. Must be one of\nROUND_ROBIN, LEAST_CONNECTIONS, or SOURCE_IP.</p>\n</li>',elementType:"li",listDepth:1},{name:"persistence",description:'<li><p><a name="persistence"></a><a href="#persistence"><code>persistence</code></a> - Omit this field to prevent session persistence.  Indicates\nwhether connections in the same session will be processed by the same Pool\nmember or not. Changing this creates a new pool.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_state_up",description:'<li><p><a name="admin_state_up"></a><a href="#admin_state_up"><code>admin_state_up</code></a> - <strong>(Optional)</strong> The administrative state of the pool.\nA valid value is true (UP) or false (DOWN).</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>persistence</code> argument supports:</p>",elementType:"p"},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Required)</strong> The type of persistence mode. The current specification\nsupports SOURCE_IP, HTTP_COOKIE, and APP_COOKIE.</p>\n</li>',elementType:"li",listDepth:1},{name:"cookie_name",description:'<li><p><a name="cookie_name"></a><a href="#cookie_name"><code>cookie_name</code></a> - <strong>(Optional)</strong> The name of the cookie if persistence mode is set\nappropriately. Required if <code>type = APP_COOKIE</code>.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/lb_pool_v2.html",docType:""},{id:40,type:"  opentelekomcloud_lb_member_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"pool_id",description:'<li><p><a name="pool_id"></a><a href="#pool_id"><code>pool_id</code></a> - <strong>(Required)</strong> The id of the pool that this member will be\nassigned to.</p>\n</li>',elementType:"li",listDepth:1},{name:"subnet_id",description:'<li><p><a name="subnet_id"></a><a href="#subnet_id"><code>subnet_id</code></a> - <strong>(Required)</strong> The subnet in which to access the member</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> Human-readable name for the member.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> Required for admins. The UUID of the tenant who owns\nthe member.  Only administrative users can specify a tenant UUID\nother than their own. Changing this creates a new member.</p>\n</li>',elementType:"li",listDepth:1},{name:"address",description:'<li><p><a name="address"></a><a href="#address"><code>address</code></a> - <strong>(Required)</strong> The IP address of the member to receive traffic from\nthe load balancer. Changing this creates a new member.</p>\n</li>',elementType:"li",listDepth:1},{name:"protocol_port",description:'<li><p><a name="protocol_port"></a><a href="#protocol_port"><code>protocol_port</code></a> - <strong>(Required)</strong> The port on which to listen for client traffic.\nChanging this creates a new member.</p>\n</li>',elementType:"li",listDepth:1},{name:"weight",description:'<li><p><a name="weight"></a><a href="#weight"><code>weight</code></a> - <strong>(Optional)</strong>  A positive integer value that indicates the relative\nportion of traffic that this member should receive from the pool. For\nexample, a member with a weight of 10 receives five times as much traffic\nas a member with a weight of 2.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_state_up",description:'<li><p><a name="admin_state_up"></a><a href="#admin_state_up"><code>admin_state_up</code></a> - <strong>(Optional)</strong> The administrative state of the member.\nA valid value is true (UP) or false (DOWN).</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/lb_member_v2.html",docType:""},{id:41,type:"  opentelekomcloud_lb_monitor_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"pool_id",description:'<li><p><a name="pool_id"></a><a href="#pool_id"><code>pool_id</code></a> - <strong>(Required)</strong> The id of the pool that this monitor will be assigned to.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> The Name of the Monitor.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> Required for admins. The UUID of the tenant who owns\nthe monitor.  Only administrative users can specify a tenant UUID\nother than their own. Changing this creates a new monitor.</p>\n</li>',elementType:"li",listDepth:1},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Required)</strong> The type of probe, which is PING, TCP, HTTP, or HTTPS,\nthat is sent by the load balancer to verify the member state. Changing this\ncreates a new monitor.</p>\n</li>',elementType:"li",listDepth:1},{name:"delay",description:'<li><p><a name="delay"></a><a href="#delay"><code>delay</code></a> - <strong>(Required)</strong> The time, in seconds, between sending probes to members.</p>\n</li>',elementType:"li",listDepth:1},{name:"timeout",description:'<li><p><a name="timeout"></a><a href="#timeout"><code>timeout</code></a> - <strong>(Required)</strong> Maximum number of seconds for a monitor to wait for a\nping reply before it times out. The value must be less than the delay\nvalue.</p>\n</li>',elementType:"li",listDepth:1},{name:"max_retries",description:'<li><p><a name="max_retries"></a><a href="#max_retries"><code>max_retries</code></a> - <strong>(Required)</strong> Number of permissible ping failures before\nchanging the member\'s status to INACTIVE. Must be a number between 1\nand 10..</p>\n</li>',elementType:"li",listDepth:1},{name:"url_path",description:'<li><p><a name="url_path"></a><a href="#url_path"><code>url_path</code></a> - <strong>(Optional)</strong> Required for HTTP(S) types. URI path that will be\naccessed if monitor type is HTTP or HTTPS.</p>\n</li>',elementType:"li",listDepth:1},{name:"http_method",description:'<li><p><a name="http_method"></a><a href="#http_method"><code>http_method</code></a> - <strong>(Optional)</strong> Required for HTTP(S) types. The HTTP method used\nfor requests by the monitor. If this attribute is not specified, it\ndefaults to "GET".</p>\n</li>',elementType:"li",listDepth:1},{name:"expected_codes",description:'<li><p><a name="expected_codes"></a><a href="#expected_codes"><code>expected_codes</code></a> - <strong>(Optional)</strong> Required for HTTP(S) types. Expected HTTP codes\nfor a passing HTTP(S) monitor. You can either specify a single status like\n"200", or a range like "200-202".</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_state_up",description:'<li><p><a name="admin_state_up"></a><a href="#admin_state_up"><code>admin_state_up</code></a> - <strong>(Optional)</strong> The administrative state of the monitor.\nA valid value is true (UP) or false (DOWN).</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/lb_monitor_v2.html",docType:""},{id:42,type:"  opentelekomcloud_fw_firewall_group_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"ingress_policy_id",description:'<li><p><a name="ingress_policy_id"></a><a href="#ingress_policy_id"><code>ingress_policy_id</code></a> - The ingress policy resource id for the firewall group. Changing\nthis updates the <code>ingress_policy_id</code> of an existing firewall group.</p>\n</li>',elementType:"li",listDepth:1},{name:"egress_policy_id",description:'<li><p><a name="egress_policy_id"></a><a href="#egress_policy_id"><code>egress_policy_id</code></a> - The egress policy resource id for the firewall group. Changing\nthis updates the <code>egress_policy_id</code> of an existing firewall group.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> A name for the firewall group. Changing this\nupdates the <code>name</code> of an existing firewall group.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Required)</strong> A description for the firewall group. Changing this\nupdates the <code>description</code> of an existing firewall group.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_state_up",description:'<li><p><a name="admin_state_up"></a><a href="#admin_state_up"><code>admin_state_up</code></a> - <strong>(Optional)</strong> Administrative up/down status for the firewall group\n(must be "true" or "false" if provided - defaults to "true").\nChanging this updates the <code>admin_state_up</code> of an existing firewall group.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The owner of the floating IP. Required if admin wants\nto create a firewall group for another tenant. Changing this creates a new\nfirewall group.</p>\n</li>',elementType:"li",listDepth:1},{name:"ports",description:'<li><p><a name="ports"></a><a href="#ports"><code>ports</code></a> - <strong>(Optional)</strong> Port(s) to associate this firewall group instance\nwith. Must be a list of strings. Changing this updates the associated routers\nof an existing firewall group.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/fw_firewall_group_v2.html",docType:""},{id:43,type:"  opentelekomcloud_fw_policy_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> A name for the firewall policy. Changing this\nupdates the <code>name</code> of an existing firewall policy.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description for the firewall policy. Changing\nthis updates the <code>description</code> of an existing firewall policy.</p>\n</li>',elementType:"li",listDepth:1},{name:"rules",description:'<li><p><a name="rules"></a><a href="#rules"><code>rules</code></a> - <strong>(Optional)</strong> An array of one or more firewall rules that comprise\nthe policy. Changing this results in adding/removing rules from the\nexisting firewall policy.</p>\n</li>',elementType:"li",listDepth:1},{name:"audited",description:'<li><p><a name="audited"></a><a href="#audited"><code>audited</code></a> - <strong>(Optional)</strong> Audit status of the firewall policy\n(must be "true" or "false" if provided - defaults to "false").\nThis status is set to "false" whenever the firewall policy or any of its\nrules are changed. Changing this updates the <code>audited</code> status of an existing\nfirewall policy.</p>\n</li>',elementType:"li",listDepth:1},{name:"shared",description:'<li><p><a name="shared"></a><a href="#shared"><code>shared</code></a> - <strong>(Optional)</strong> Sharing status of the firewall policy (must be "true"\nor "false" if provided). If this is "true" the policy is visible to, and\ncan be used in, firewalls in other tenants. Changing this updates the\n<code>shared</code> status of an existing firewall policy. Only administrative users\ncan specify if the policy should be shared.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/fw_policy_v2.html",docType:""},{id:44,type:"  opentelekomcloud_fw_rule_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> A unique name for the firewall rule. Changing this\nupdates the <code>name</code> of an existing firewall rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description for the firewall rule. Changing this\nupdates the <code>description</code> of an existing firewall rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"protocol",description:'<li><p><a name="protocol"></a><a href="#protocol"><code>protocol</code></a> - <strong>(Required)</strong> The protocol type on which the firewall rule operates.\nValid values are: <code>tcp</code>, <code>udp</code>, <code>icmp</code>, and <code>any</code>. Changing this updates the\n<code>protocol</code> of an existing firewall rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"action",description:'<li><p><a name="action"></a><a href="#action"><code>action</code></a> - <strong>(Required)</strong> Action to be taken ( must be "allow" or "deny") when the\nfirewall rule matches. Changing this updates the <code>action</code> of an existing\nfirewall rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_version",description:'<li><p><a name="ip_version"></a><a href="#ip_version"><code>ip_version</code></a> - <strong>(Optional)</strong> IP version, either 4 (default) or 6. Changing this\nupdates the <code>ip_version</code> of an existing firewall rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"source_ip_address",description:'<li><p><a name="source_ip_address"></a><a href="#source_ip_address"><code>source_ip_address</code></a> - <strong>(Optional)</strong> The source IP address on which the firewall\nrule operates. Changing this updates the <code>source_ip_address</code> of an existing\nfirewall rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"destination_ip_address",description:'<li><p><a name="destination_ip_address"></a><a href="#destination_ip_address"><code>destination_ip_address</code></a> - <strong>(Optional)</strong> The destination IP address on which the\nfirewall rule operates. Changing this updates the <code>destination_ip_address</code>\nof an existing firewall rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"source_port",description:'<li><p><a name="source_port"></a><a href="#source_port"><code>source_port</code></a> - <strong>(Optional)</strong> The source port on which the firewall\nrule operates. Changing this updates the <code>source_port</code> of an existing\nfirewall rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"destination_port",description:'<li><p><a name="destination_port"></a><a href="#destination_port"><code>destination_port</code></a> - <strong>(Optional)</strong> The destination port on which the firewall\nrule operates. Changing this updates the <code>destination_port</code> of an existing\nfirewall rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"enabled",description:'<li><p><a name="enabled"></a><a href="#enabled"><code>enabled</code></a> - <strong>(Optional)</strong> Enabled status for the firewall rule (must be "true"\nor "false" if provided - defaults to "true"). Changing this updates the\n<code>enabled</code> status of an existing firewall rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The owner of the firewall rule. Required if admin\nwants to create a firewall rule for another tenant. Changing this creates a\nnew firewall rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/fw_rule_v2.html",docType:""},{id:45,type:"  opentelekomcloud_identity_agency_v3",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of agency. The name is a string of 1 to 64\ncharacters.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Provides supplementary information about the\nagency. The value is a string of 0 to 255 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"delegated_domain_name",description:'<li><p><a name="delegated_domain_name"></a><a href="#delegated_domain_name"><code>delegated_domain_name</code></a> - <strong>(Required)</strong> The name of delegated domain.</p>\n</li>',elementType:"li",listDepth:1},{name:"project_role",description:'<li><p><a name="project_role"></a><a href="#project_role"><code>project_role</code></a> - <strong>(Optional)</strong> An array of roles and projects which are used to\ngrant permissions to agency on project. The structure is documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"domain_roles",description:'<li><p><a name="domain_roles"></a><a href="#domain_roles"><code>domain_roles</code></a> - (optional) An array of role names which stand for the\npermissionis to be granted to agency on domain.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>project_role</code> block supports:</p>",elementType:"p"},{name:"project",description:'<li><p><a name="project"></a><a href="#project"><code>project</code></a> - <strong>(Required)</strong> The name of project</p>\n</li>',elementType:"li",listDepth:1},{name:"roles",description:'<li><p><a name="roles"></a><a href="#roles"><code>roles</code></a> - <strong>(Required)</strong> An array of role names</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p><strong>note</strong>:\n    one or both of <code>project_role</code> and <code>domain_roles</code> must be input when\ncreating an agency.</p>",elementType:"p"}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/identity_agency_v3.html",docType:""},{id:46,type:"  opentelekomcloud_identity_project_v3",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the project. it must start with \nID of an existing region_ and be less than or equal to 64 characters.\nExample: eu-de_project1.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the project.</p>\n</li>',elementType:"li",listDepth:1},{name:"domain_id",description:'<li><p><a name="domain_id"></a><a href="#domain_id"><code>domain_id</code></a> - <strong>(Optional)</strong> The domain this project belongs to. Changing this\ncreates a new Project.</p>\n</li>',elementType:"li",listDepth:1},{name:"parent_id",description:'<li><p><a name="parent_id"></a><a href="#parent_id"><code>parent_id</code></a> - <strong>(Optional)</strong> The parent of this project. Changing this creates\na new Project.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/identity_project_v3.html",docType:""},{id:47,type:"  opentelekomcloud_identity_user_v3",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the user. The user name consists of 5 to 32\n characters. It can contain only uppercase letters, lowercase letters, \n digits, spaces, and special characters (-_) and cannot start with a digit.</p>\n</li>',elementType:"li",listDepth:1},{name:"default_project_id",description:'<li><p><a name="default_project_id"></a><a href="#default_project_id"><code>default_project_id</code></a> - <strong>(Optional)</strong> The default project this user belongs to.</p>\n</li>',elementType:"li",listDepth:1},{name:"domain_id",description:'<li><p><a name="domain_id"></a><a href="#domain_id"><code>domain_id</code></a> - <strong>(Optional)</strong> The domain this user belongs to.</p>\n</li>',elementType:"li",listDepth:1},{name:"enabled",description:'<li><p><a name="enabled"></a><a href="#enabled"><code>enabled</code></a> - <strong>(Optional)</strong> Whether the user is enabled or disabled. Valid\nvalues are <code>true</code> and <code>false</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"password",description:'<li><p><a name="password"></a><a href="#password"><code>password</code></a> - <strong>(Optional)</strong> The password for the user. It must contain at least \n two of the following character types: uppercase letters, lowercase letters, \n digits, and special characters.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/identity_user_v3.html",docType:""},{id:48,type:"  opentelekomcloud_identity_group_v3",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the group.The length is less than or equal \n to 64 bytes</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the group.</p>\n</li>',elementType:"li",listDepth:1},{name:"domain_id",description:'<li><p><a name="domain_id"></a><a href="#domain_id"><code>domain_id</code></a> - <strong>(Optional)</strong> The domain this group belongs to.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/identity_group_v3.html",docType:""},{id:49,type:"  opentelekomcloud_identity_group_membership_v3",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"group",description:'<li><p><a name="group"></a><a href="#group"><code>group</code></a> - <strong>(Required)</strong> The group ID of this membership.</p>\n</li>',elementType:"li",listDepth:1},{name:"users",description:'<li><p><a name="users"></a><a href="#users"><code>users</code></a> - <strong>(Required)</strong> A List of user IDs to associate to the group.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/identity_group_membership_v3.html",docType:""},{id:50,type:"  opentelekomcloud_identity_role_assignment_v3",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"domain_id",description:'<li><p><a name="domain_id"></a><a href="#domain_id"><code>domain_id</code></a> - (Optional; Required if <code>project_id</code> is empty) The domain to assign the role in.</p>\n</li>',elementType:"li",listDepth:1},{name:"group_id",description:'<li><p><a name="group_id"></a><a href="#group_id"><code>group_id</code></a> - (Optional; Required if <code>user_id</code> is empty) The group to assign the role to.</p>\n</li>',elementType:"li",listDepth:1},{name:"project_id",description:'<li><p><a name="project_id"></a><a href="#project_id"><code>project_id</code></a> - (Optional; Required if <code>domain_id</code> is empty) The project to assign the role in.</p>\n</li>',elementType:"li",listDepth:1},{name:"user_id",description:'<li><p><a name="user_id"></a><a href="#user_id"><code>user_id</code></a> - (Optional; Required if <code>group_id</code> is empty) The user to assign the role in.</p>\n</li>',elementType:"li",listDepth:1},{name:"role_id",description:'<li><p><a name="role_id"></a><a href="#role_id"><code>role_id</code></a> - <strong>(Required)</strong> The role to assign.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/identity_role_assignment_v3.html",docType:""},{id:51,type:"  opentelekomcloud_identity_role_v3",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> -\n<strong>(Required)</strong>\nDescription of a role. The value cannot exceed 256 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"display_layer",description:'<li><p><a name="display_layer"></a><a href="#display_layer"><code>display_layer</code></a> -\n<strong>(Required)</strong>\nDisplay layer of a role.\\ndomain - A role is displayed at the domain\nlayer.\\nproject - A role is displayed at the project layer.</p>\n</li>',elementType:"li",listDepth:1},{name:"display_name",description:'<li><p><a name="display_name"></a><a href="#display_name"><code>display_name</code></a> -\n<strong>(Required)</strong>\nDisplayed name of a role. The value cannot exceed 64 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"statement",description:'<li><p><a name="statement"></a><a href="#statement"><code>statement</code></a> -\n<strong>(Required)</strong>\nStatement: The Statement field contains the Effect and Action\nelements. Effect indicates whether the policy allows or denies\naccess. Action indicates authorization items. The number of\nstatements cannot exceed 8. Structure is documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>statement</code> block supports:</p>",elementType:"p"},{name:"action",description:'<li><p><a name="action"></a><a href="#action"><code>action</code></a> -\n<strong>(Required)</strong>\nPermission set, which specifies the operation permissions on\nresources. The number of permission sets cannot exceed 100.\nFormat:  The value format is Service name:Resource type:Action,\nfor example, vpc:ports:create.  Service name: indicates the\nproduct name, such as ecs, evs, or vpc. Only lowercase letters\nare allowed.  Resource type and Action: The values are\ncase-insensitive, and the wildcard (<em>) are allowed. A wildcard\n(</em>) can represent all or part of information about resource\ntypes and actions for the specific service.</p>\n</li>',elementType:"li",listDepth:1},{name:"effect",description:'<li><p><a name="effect"></a><a href="#effect"><code>effect</code></a> -\n<strong>(Required)</strong>\nThe value can be Allow and Deny. If both Allow and Deny are\nfound in statements, the policy evaluation starts with Deny.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/identity_role_v3.html",docType:""},{id:52,type:"  opentelekomcloud_images_image_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"container_format",description:'<li><p><a name="container_format"></a><a href="#container_format"><code>container_format</code></a> - <strong>(Required)</strong> The container format. Must be one of\n"ami", "ari", "aki", "bare", "ovf".</p>\n</li>',elementType:"li",listDepth:1},{name:"disk_format",description:'<li><p><a name="disk_format"></a><a href="#disk_format"><code>disk_format</code></a> - <strong>(Required)</strong> The disk format. Must be one of\n"ami", "ari", "aki", "vhd", "vmdk", "raw", "qcow2", "vdi", "iso".</p>\n</li>',elementType:"li",listDepth:1},{name:"local_file_path",description:'<li><p><a name="local_file_path"></a><a href="#local_file_path"><code>local_file_path</code></a> - <strong>(Optional)</strong> This is the filepath of the raw image file\nthat will be uploaded to Glance. Conflicts with <code>image_source_url</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_cache_path",description:'<li><p><a name="image_cache_path"></a><a href="#image_cache_path"><code>image_cache_path</code></a> - <strong>(Optional)</strong> This is the directory where the images will\nbe downloaded. Images will be stored with a filename corresponding to\nthe url\'s md5 hash. Defaults to "$HOME/.terraform/image_cache"</p>\n</li>',elementType:"li",listDepth:1},{name:"image_source_url",description:'<li><p><a name="image_source_url"></a><a href="#image_source_url"><code>image_source_url</code></a> - <strong>(Optional)</strong> This is the url of the raw image that will\nbe downloaded in the <code>image_cache_path</code> before being uploaded to Glance.\nGlance is able to download image from internet but the <code>gophercloud</code> library\ndoes not yet provide a way to do so.\nConflicts with <code>local_file_path</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"min_disk_gb",description:'<li><p><a name="min_disk_gb"></a><a href="#min_disk_gb"><code>min_disk_gb</code></a> - <strong>(Optional)</strong> Amount of disk space (in GB) required to boot image.\nDefaults to 0.</p>\n</li>',elementType:"li",listDepth:1},{name:"min_ram_mb",description:'<li><p><a name="min_ram_mb"></a><a href="#min_ram_mb"><code>min_ram_mb</code></a> - <strong>(Optional)</strong> Amount of ram (in MB) required to boot image.\nDefauts to 0.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the image.</p>\n</li>',elementType:"li",listDepth:1},{name:"protected",description:'<li><p><a name="protected"></a><a href="#protected"><code>protected</code></a> - <strong>(Optional)</strong> If true, image will not be deletable.\nDefaults to false.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> The tags of the image. It must be a list of strings.\nAt this time, it is not possible to delete all tags of an image.</p>\n</li>',elementType:"li",listDepth:1},{name:"visibility",description:'<li><p><a name="visibility"></a><a href="#visibility"><code>visibility</code></a> - <strong>(Optional)</strong> The visibility of the image. Must be one of\n"public", "private", "community", or "shared". The ability to set the\nvisibility depends upon the configuration of the OpenTelekomCloud cloud.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>Note: The <code>properties</code> attribute handling in the gophercloud library is currently buggy\nand needs to be fixed before being implemented in this resource.</p>",elementType:"p"}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/images_image_v2.html",docType:""},{id:53,type:"  opentelekomcloud_ims_data_image_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the image.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the image. Changing this creates a new image.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> The tags of the image.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_id",description:'<li><p><a name="volume_id"></a><a href="#volume_id"><code>volume_id</code></a> - <strong>(Optional)</strong> The ID of the ECS atatched volume that needs to be converted into an image.\nThis parameter is mandatory when you create a privete image from an ECS.\nChanging this creates a new image.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_url",description:'<li><p><a name="image_url"></a><a href="#image_url"><code>image_url</code></a> - <strong>(Optional)</strong> The URL of the external image file in the OBS bucket.\nThis parameter is mandatory when you create a private image from an external file\nuploaded to an OBS bucket. The format is <em>OBS bucket name:Image file name</em>.\nChanging this creates a new image.</p>\n</li>',elementType:"li",listDepth:1},{name:"min_disk",description:'<li><p><a name="min_disk"></a><a href="#min_disk"><code>min_disk</code></a> - <strong>(Optional)</strong> The minimum size of the system disk in the unit of GB.\nThis parameter is mandatory when you create a private image from an external file\nuploaded to an OBS bucket. The value ranges from 1 GB to 1024 GB.\nChanging this creates a new image.</p>\n</li>',elementType:"li",listDepth:1},{name:"os_type",description:'<li><p><a name="os_type"></a><a href="#os_type"><code>os_type</code></a> - <strong>(Optional)</strong> The OS type. It can only be Windows or Linux.\nThis parameter is valid when you create a private image from an external file\nuploaded to an OBS bucket. Changing this creates a new image.</p>\n</li>',elementType:"li",listDepth:1},{name:"cmk_id",description:'<li><p><a name="cmk_id"></a><a href="#cmk_id"><code>cmk_id</code></a> - <strong>(Optional)</strong> The master key used for encrypting an image.\nChanging this creates a new image.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/ims_data_image_v2.html",docType:""},{id:54,type:"  opentelekomcloud_ims_image_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the image.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the image. Changing this creates a new image.</p>\n</li>',elementType:"li",listDepth:1},{name:"min_ram",description:'<li><p><a name="min_ram"></a><a href="#min_ram"><code>min_ram</code></a> - <strong>(Optional)</strong> The minimum memory of the image in the unit of MB.\nThe default value is 0, indicating that the memory is not restricted.\nChanging this creates a new image.</p>\n</li>',elementType:"li",listDepth:1},{name:"max_ram",description:'<li><p><a name="max_ram"></a><a href="#max_ram"><code>max_ram</code></a> - <strong>(Optional)</strong> The maximum memory of the image in the unit of MB.\nChanging this creates a new image.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> The tags of the image.</p>\n</li>',elementType:"li",listDepth:1},{name:"instance_id",description:'<li><p><a name="instance_id"></a><a href="#instance_id"><code>instance_id</code></a> - <strong>(Optional)</strong> The ID of the ECS that needs to be converted into an image.\nThis parameter is mandatory when you create a privete image from an ECS.\nChanging this creates a new image.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_url",description:'<li><p><a name="image_url"></a><a href="#image_url"><code>image_url</code></a> - <strong>(Optional)</strong> The URL of the external image file in the OBS bucket.\nThis parameter is mandatory when you create a private image from an external file\nuploaded to an OBS bucket. The format is <em>OBS bucket name:Image file name</em>.\nChanging this creates a new image.</p>\n</li>',elementType:"li",listDepth:1},{name:"min_disk",description:'<li><p><a name="min_disk"></a><a href="#min_disk"><code>min_disk</code></a> - <strong>(Optional)</strong> The minimum size of the system disk in the unit of GB.\nThis parameter is mandatory when you create a private image from an external file\nuploaded to an OBS bucket. The value ranges from 1 GB to 1024 GB.\nChanging this creates a new image.</p>\n</li>',elementType:"li",listDepth:1},{name:"os_version",description:'<li><p><a name="os_version"></a><a href="#os_version"><code>os_version</code></a> - <strong>(Optional)</strong> The OS version.\nThis parameter is valid when you create a private image from an external file\nuploaded to an OBS bucket. Changing this creates a new image.</p>\n</li>',elementType:"li",listDepth:1},{name:"is_config",description:'<li><p><a name="is_config"></a><a href="#is_config"><code>is_config</code></a> - <strong>(Optional)</strong> If automatic configuration is required, set the value to true.\nOtherwise, set the value to false. Changing this creates a new image.</p>\n</li>',elementType:"li",listDepth:1},{name:"cmk_id",description:'<li><p><a name="cmk_id"></a><a href="#cmk_id"><code>cmk_id</code></a> - <strong>(Optional)</strong> The master key used for encrypting an image.\nChanging this creates a new image.</p>\n</li>',elementType:"li",listDepth:1},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Optional)</strong> The image type. Must be one of "ECS", "FusionCompute", "BMS",\nor "Ironic". Changing this creates a new image.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/ims_image_v2.html",docType:""},{id:55,type:"  opentelekomcloud_kms_key_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"key_alias",description:'<li><p><a name="key_alias"></a><a href="#key_alias"><code>key_alias</code></a> - <strong>(Required)</strong> The alias in which to create the key. It is required when\nwe create a new key. Changing this updates the alias of key.</p>\n</li>',elementType:"li",listDepth:1},{name:"key_description",description:'<li><p><a name="key_description"></a><a href="#key_description"><code>key_description</code></a> - <strong>(Optional)</strong> The description of the key as viewed in OpenTelekomCloud console.\nChanging this updates the description of key.</p>\n</li>',elementType:"li",listDepth:1},{name:"realm",description:'<li><p><a name="realm"></a><a href="#realm"><code>realm</code></a> - <strong>(Optional)</strong> Region where a key resides. Changing this creates a new key.</p>\n</li>',elementType:"li",listDepth:1},{name:"pending_days",description:'<li><p><a name="pending_days"></a><a href="#pending_days"><code>pending_days</code></a> - <strong>(Optional)</strong> Duration in days after which the key is deleted\nafter destruction of the resource, must be between 7 and 1096 days. Defaults to 7.\nIt only be used when delete a key.</p>\n</li>',elementType:"li",listDepth:1},{name:"is_enabled",description:'<li><p><a name="is_enabled"></a><a href="#is_enabled"><code>is_enabled</code></a> - <strong>(Optional)</strong> Specifies whether the key is enabled. Defaults to true.\nChanging this updates the state of existing key.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/kms_key_v1.html",docType:""},{id:56,type:"  opentelekomcloud_maas_task_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"src_node",description:'<li><p><a name="src_node"></a><a href="#src_node"><code>src_node</code></a> - <strong>(Required)</strong> Specifies the source node information.</p>\n</li>',elementType:"li",listDepth:1},{name:"dst_node",description:'<li><p><a name="dst_node"></a><a href="#dst_node"><code>dst_node</code></a> - <strong>(Required)</strong> Specifies the destination node information.</p>\n</li>',elementType:"li",listDepth:1},{name:"enable_kms",description:'<li><p><a name="enable_kms"></a><a href="#enable_kms"><code>enable_kms</code></a> - <strong>(Required)</strong> Specifies whether to use KMS encryption.</p>\n</li>',elementType:"li",listDepth:1},{name:"thread_num",description:'<li><p><a name="thread_num"></a><a href="#thread_num"><code>thread_num</code></a> - <strong>(Required)</strong> Specifies the number of threads used by the migration\ntask. The value cannot exceed 50.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Specifies tasks description, which cannot exceed 255\ncharacters. The following special characters are not allowed: &lt;&gt;()"&amp;</p>\n</li>',elementType:"li",listDepth:1},{name:"smn_info",description:'<li><p><a name="smn_info"></a><a href="#smn_info"><code>smn_info</code></a> - <strong>(Optional)</strong> Specifies the field used for sending messages using the\nSimple Message Notification (SMN) service.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>src_node</code> block supports:</p>",elementType:"p"},{name:"ak",description:"<strong>(Required)</strong> Specifies the source bucket Access Key.\n",elementType:"li",listDepth:1},{name:"sk",description:"<strong>(Required)</strong> Specifies the source bucket Secret Key.\n",elementType:"li",listDepth:1},{name:"object_key",description:"<strong>(Required)</strong> Specifies the name of the object to be selected in the\nsource bucket.\n",elementType:"li",listDepth:1},{name:"bucket",description:"<strong>(Required)</strong> Specifies the name of the source bucket.\n",elementType:"li",listDepth:1},{name:"cloud_type",description:"<strong>(Optional)</strong> Specifies the source cloud vendor. The default value is\nAWS and only AWS is supported now.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>dst_node</code> block supports:</p>",elementType:"p"},{name:"ak",description:"<strong>(Required)</strong> Specifies the destination bucket Access Key.\n",elementType:"li",listDepth:1},{name:"sk",description:"<strong>(Required)</strong> Specifies the destination bucket Secret Key.\n",elementType:"li",listDepth:1},{name:"object_key",description:"<strong>(Optional)</strong> Specifies the name of the object to be selected in the\ndestination bucket.\n",elementType:"li",listDepth:1},{name:"bucket",description:"<strong>(Required)</strong> Specifies the name of the destination bucket.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>smn_info</code> block supports:</p>",elementType:"p"},{name:"topic_urn",description:"<strong>(Required)</strong> Specifies the SMN message topic URN bound to a migration\ntask.\n",elementType:"li",listDepth:1},{name:"language",description:"<strong>(Optional)</strong> Specifies the management console language used by the\ncurrent users. Users can select en-us.\n",elementType:"li",listDepth:1},{name:"trigger_conditions",description:"<strong>(Required)</strong> Specifies the trigger conditions of sending messages\nusing SMN. The value depending on the state of a migration task. The migration task\nstatus can be SUCCESS or FAIL.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/maas_task_v1.html",docType:""},{id:57,type:"  opentelekomcloud_mrs_cluster_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"billing_type",description:'<li><p><a name="billing_type"></a><a href="#billing_type"><code>billing_type</code></a> - <strong>(Required)</strong> The value is 12, indicating on-demand payment.</p>\n</li>',elementType:"li",listDepth:1},{name:"master_node_num",description:'<li><p><a name="master_node_num"></a><a href="#master_node_num"><code>master_node_num</code></a> - <strong>(Required)</strong> Number of Master nodes The value is 2.</p>\n</li>',elementType:"li",listDepth:1},{name:"master_node_size",description:'<li><p><a name="master_node_size"></a><a href="#master_node_size"><code>master_node_size</code></a> - <strong>(Required)</strong> Best match based on several years of commissioning\nexperience. MRS supports specifications of hosts, and host specifications are\ndetermined by CPUs, memory, and disks space. Master nodes support h1.2xlarge.linux.mrs\nh1.4xlarge.linux.mrs, h1.8xlarge.linux.mrs, s1.4xlarge.linux.mrs,\nand s1.8xlarge.linux.mrs. Core nodes of a streaming cluster support all specifications\nc2.2xlarge.linux.mrs, c2.4xlarge.linux.mrs, s1.xlarge.linux.mrs, s1.4xlarge.linux.mrs,\ns1.8xlarge.linux.mrs, d1.xlarge.linux.mrs, d1.2xlarge.linux.mrs, d1.4xlarge.linux.mrs,\nd1.8xlarge.linux.mrs, h1.2xlarge.linux.mrs, h1.4xlarge.linux.mrs and h1.8xlarge.linux.mrs.\nTask nodes support c2.2xlarge.linux.mrs, c2.4xlarge.linux.mrs, s1.xlarge.linux.mrs,\ns1.4xlarge.linux.mrs, s1.8xlarge.linux.mrs, h1.2xlarge.linux.mrs, h1.4xlarge.linux.mrs,\nand h1.8xlarge.linux.mrs.</p>\n</li>',elementType:"li",listDepth:1},{name:"core_node_num",description:'<li><p><a name="core_node_num"></a><a href="#core_node_num"><code>core_node_num</code></a> - <strong>(Required)</strong> Number of Core nodes Value range: 1 to 500 A\nmaximum of 500 Core nodes are supported by default. If more than 500 Core nodes\nare required, contact technical support engineers or invoke background APIs\nto modify the database.</p>\n</li>',elementType:"li",listDepth:1},{name:"core_node_size",description:'<li><p><a name="core_node_size"></a><a href="#core_node_size"><code>core_node_size</code></a> - <strong>(Required)</strong> Instance specification of a Core node Configuration\nmethod of this parameter is identical to that of master_node_size.</p>\n</li>',elementType:"li",listDepth:1},{name:"available_zone_id",description:'<li><p><a name="available_zone_id"></a><a href="#available_zone_id"><code>available_zone_id</code></a> - <strong>(Required)</strong> ID of an available zone. Obtain the value\nfrom Regions and Endpoints.</p>\n</li>',elementType:"li",listDepth:1},{name:"cluster_name",description:'<li><p><a name="cluster_name"></a><a href="#cluster_name"><code>cluster_name</code></a> - <strong>(Required)</strong> Cluster name, which is globally unique and contains\nonly 1 to 64 letters, digits, hyphens (-), and underscores (_).</p>\n</li>',elementType:"li",listDepth:1},{name:"vpc_id",description:'<li><p><a name="vpc_id"></a><a href="#vpc_id"><code>vpc_id</code></a> - <strong>(Required)</strong> ID of the VPC where the subnet locates Obtain the VPC\nID from the management console as follows: Register an account and log in to\nthe management console. Click Virtual Private Cloud and select Virtual Private\nCloud from the left list. On the Virtual Private Cloud page, obtain the VPC\nID from the list.</p>\n</li>',elementType:"li",listDepth:1},{name:"subnet_id",description:'<li><p><a name="subnet_id"></a><a href="#subnet_id"><code>subnet_id</code></a> - <strong>(Required)</strong> Subnet ID Obtain the subnet ID from the management\nconsole as follows: Register an account and log in to the management console.\nClick Virtual Private Cloud and select Virtual Private Cloud from the left list.\nOn the Virtual Private Cloud page, obtain the subnet ID from the list.</p>\n</li>',elementType:"li",listDepth:1},{name:"cluster_version",description:'<li><p><a name="cluster_version"></a><a href="#cluster_version"><code>cluster_version</code></a> - <strong>(Optional)</strong> Version of the clusters Currently, MRS 1.2, MRS 1.3.0,\nMRS 1.5.0, MRS 1.6.0 and MRS 1.6.3 are supported. The latest version of MRS is used\nby default. Currently, the latest version is MRS 1.6.3.</p>\n</li>',elementType:"li",listDepth:1},{name:"cluster_type",description:'<li><p><a name="cluster_type"></a><a href="#cluster_type"><code>cluster_type</code></a> - <strong>(Optional)</strong> Type of clusters 0: analysis cluster 1: streaming\ncluster The default value is 0.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_type",description:'<li><p><a name="volume_type"></a><a href="#volume_type"><code>volume_type</code></a> - <strong>(Optional)</strong> Type of disks SATA, SAS and SSD are supported. SATA:\ncommon I/O, SAS: High I/O, SSD: Ultra-high I/O.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_size",description:'<li><p><a name="volume_size"></a><a href="#volume_size"><code>volume_size</code></a> - <strong>(Optional)</strong> Data disk storage space of a Core node Users can\nadd disks to expand storage capacity when creating a cluster. There are the\nfollowing scenarios: Separation of data storage and computing: Data is stored\nin the OBS system. Costs of clusters are relatively low but computing performance\nis poor. The clusters can be deleted at any time. It is recommended when data\ncomputing is not frequently performed. Integration of data storage and computing:\nData is stored in the HDFS system. Costs of clusters are relatively high but\ncomputing performance is good. The clusters cannot be deleted in a short term.\nIt is recommended when data computing is frequently performed. Value range:\n100 GB to 32000 GB</p>\n</li>',elementType:"li",listDepth:1},{name:"master_data_volume_type",description:'<li><p><a name="master_data_volume_type"></a><a href="#master_data_volume_type"><code>master_data_volume_type</code></a> - <strong>(Optional)</strong> Data disk storage type of the Master node,\nsupporting SATA, SAS and SSD. SATA: Common I/O, SAS: High I/O, SSD: Ultra-high I/O.\nThis parameter is a multi-disk parameter available for MRS 1.6.0 or later versions.</p>\n</li>',elementType:"li",listDepth:1},{name:"master_data_volume_size",description:'<li><p><a name="master_data_volume_size"></a><a href="#master_data_volume_size"><code>master_data_volume_size</code></a> - <strong>(Optional)</strong> Data disk size of the Master node.\nValue range: 100 GB to 32000 GB. This parameter is a multi-disk parameter available\nfor MRS 1.6.0 or later versions.</p>\n</li>',elementType:"li",listDepth:1},{name:"master_data_volume_count",description:'<li><p><a name="master_data_volume_count"></a><a href="#master_data_volume_count"><code>master_data_volume_count</code></a> - <strong>(Optional)</strong> Number of data disks of the Master node.\nThe value can be set to 1 only. This parameter is a multi-disk parameter available\nfor MRS 1.6.0 or later versions.</p>\n</li>',elementType:"li",listDepth:1},{name:"core_data_volume_type",description:'<li><p><a name="core_data_volume_type"></a><a href="#core_data_volume_type"><code>core_data_volume_type</code></a> - <strong>(Optional)</strong> Data disk storage type of the Core node,\nsupporting SATA, SAS and SSD. SATA: Common I/O, SAS: High I/O, SSD: Ultra-high I/O.\nThis parameter is a multi-disk parameter available for MRS 1.6.0 or later versions.</p>\n</li>',elementType:"li",listDepth:1},{name:"core_data_volume_size",description:'<li><p><a name="core_data_volume_size"></a><a href="#core_data_volume_size"><code>core_data_volume_size</code></a> - <strong>(Optional)</strong> Data disk size of the Core node.\nValue range: 100 GB to 32000 GB. This parameter is a multi-disk parameter available\nfor MRS 1.6.0 or later versions.</p>\n</li>',elementType:"li",listDepth:1},{name:"core_data_volume_count",description:'<li><p><a name="core_data_volume_count"></a><a href="#core_data_volume_count"><code>core_data_volume_count</code></a> - <strong>(Optional)</strong> Number of data disks of the Core node.\nValue range: 1 to 10. This parameter is a multi-disk parameter available\nfor MRS 1.6.0 or later versions.</p>\n</li>',elementType:"li",listDepth:1},{name:"node_public_cert_name",description:'<li><p><a name="node_public_cert_name"></a><a href="#node_public_cert_name"><code>node_public_cert_name</code></a> - <strong>(Required)</strong> Name of a key pair You can use a key\nto log in to the Master node in the cluster.</p>\n</li>',elementType:"li",listDepth:1},{name:"safe_mode",description:'<li><p><a name="safe_mode"></a><a href="#safe_mode"><code>safe_mode</code></a> - <strong>(Required)</strong> MRS cluster running mode 0: common mode The value\nindicates that the Kerberos authentication is disabled. Users can use all functions\nprovided by the cluster. 1: safe mode The value indicates that the Kerberos\nauthentication is enabled. Common users cannot use the file management or job\nmanagement functions of an MRS cluster and cannot view cluster resource usage\nor the job records of Hadoop and Spark. To use these functions, the users must\nobtain the relevant permissions from the MRS Manager administrator. The request\nhas the cluster_admin_secret parameter only when safe_mode is set to 1.</p>\n</li>',elementType:"li",listDepth:1},{name:"cluster_admin_secret",description:'<li><p><a name="cluster_admin_secret"></a><a href="#cluster_admin_secret"><code>cluster_admin_secret</code></a> - <strong>(Optional)</strong> Indicates the password of the MRS Manager\nadministrator. The password for MRS 1.5.0: Must contain 6 to 32 characters.\nMust contain at least two types of the following: Lowercase letters Uppercase\nletters Digits Special characters of <code>~!@#$%^&amp;*()-_=+\\|[{}];:\'",&lt;.&gt;/? Spaces\nMust be different from the username. Must be different from the username written\nin reverse order. The password for MRS 1.3.0: Must contain 8 to 64 characters.\nMust contain at least four types of the following: Lowercase letters Uppercase\nletters Digits Special characters of</code>~!@#$%<sup>&amp;*()-_=+|[{}];:\'",&lt;.&gt;/?</sup> Spaces\nMust be different from the username. Must be different from the username written\nin reverse order. This parameter needs to be configured only when safe_mode\nis set to 1.</p>\n</li>',elementType:"li",listDepth:1},{name:"log_collection",description:'<li><p><a name="log_collection"></a><a href="#log_collection"><code>log_collection</code></a> - <strong>(Optional)</strong> Indicates whether logs are collected when cluster\ninstallation fails. 0: not collected 1: collected The default value is 0. If\nlog_collection is set to 1, OBS buckets will be created to collect the MRS logs.\nThese buckets will be charged.</p>\n</li>',elementType:"li",listDepth:1},{name:"component_list",description:'<li><p><a name="component_list"></a><a href="#component_list"><code>component_list</code></a> - <strong>(Required)</strong> Service component list.</p>\n</li>',elementType:"li",listDepth:1},{name:"add_jobs",description:'<li><p><a name="add_jobs"></a><a href="#add_jobs"><code>add_jobs</code></a> - <strong>(Optional)</strong> You can submit a job when you create a cluster to\nsave time and use MRS easily. Only one job can be added.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>component_list</code> block supports:</p>",elementType:"p"},{name:"component_name",description:"<strong>(Required)</strong> Component name Currently, Hadoop, Spark, HBase,\nHive, Hue, Loader, Flume, Kafka and Storm are supported. Loader and Flume are\nnot supported by MRS 1.3.0. Kafka and Storm are not supported by MRS 1.2.\n",elementType:"li",listDepth:1},{name:"componentId",description:"Component ID Component IDs supported by MRS 1.5.0 include:\nMRS 1.5.0_001: Hadoop MRS 1.5.0_002: Spark MRS 1.5.0_003: HBase MRS 1.5.0_004:\nHive MRS 1.5.0_005: Hue MRS 1.5.0_006: Kafka MRS 1.5.0_007: Storm MRS 1.5.0_008:\nLoader MRS 1.5.0_009: Flume Component IDs supported by MRS 1.3.0 include: MRS\n1.3.0_001: Hadoop MRS 1.3.0_002: Spark MRS 1.3.0_003: HBase MRS 1.3.0_004: Hive\nMRS 1.3.0_005: Hue MRS 1.3.0_006: Kafka MRS 1.3.0_007: Storm For example, the\ncomponent ID of Hadoop is MRS 1.5.0_001, or MRS 1.3.0_001.\n",elementType:"li",listDepth:1},{name:"componentName",description:"Component name Currently, Hadoop, Spark, HBase, Hive, Hue,\nLoader, Flume, Kafka and Storm are supported. Loader and Flume are not supported\nby MRS 1.3.0.\n",elementType:"li",listDepth:1},{name:"componentVersion",description:"Component version MRS 1.5.0 supports the following component\nversion: Component version of an analysis cluster: Hadoop: 2.7.2 Spark: 2.1.0\nHBase: 1.0.2 Hive: 1.2.1 Hue: 3.11.0 Loader: 2.0.0 Component version of a streaming\ncluster: Kafka: 0.10.0.0 Storm: 1.0.2 Flume: 1.6.0 MRS 1.3.0 supports the following\ncomponent version: Component version of an analysis cluster: Hadoop: 2.7.2 Spark:\n1.5.1 HBase: 1.0.2 Hive: 1.2.1 Hue: 3.11.0 Component version of a streaming\ncluster: Kafka: 0.10.0.0 Storm: 1.0.2\n",elementType:"li",listDepth:1},{name:"componentDesc",description:"Component description\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>add_jobs</code> block supports:\n* <code>job_type</code> - (Required) Job type 1: MapReduce 2: Spark 3: Hive Script 4: HiveQL\n    (not supported currently) 5: DistCp, importing and exporting data (not supported\n    in this API currently). 6: Spark Script 7: Spark SQL, submitting Spark SQL statements\n    (not supported in this API currently). NOTE: Spark and Hive jobs can be added\n    to only clusters including Spark and Hive components.</p>",elementType:"p"},{name:"job_name",description:'<li><p><a name="job_name"></a><a href="#job_name"><code>job_name</code></a> - <strong>(Required)</strong> Job name It contains only 1 to 64 letters, digits,\nhyphens (-), and underscores (_). NOTE: Identical job names are allowed but\nnot recommended.</p>\n</li>',elementType:"li",listDepth:1},{name:"jar_path",description:'<li><p><a name="jar_path"></a><a href="#jar_path"><code>jar_path</code></a> - <strong>(Required)</strong> Path of the .jar file or .sql file for program execution\nThe parameter must meet the following requirements: Contains a maximum of 1023\ncharacters, excluding special characters such as ;|&amp;&gt;&lt;\'$. The address cannot\nbe empty or full of spaces. Starts with / or s3a://. Spark Script must end with\n.sql; while MapReduce and Spark Jar must end with .jar. sql and jar are case-insensitive.</p>\n</li>',elementType:"li",listDepth:1},{name:"arguments",description:'<li><p><a name="arguments"></a><a href="#arguments"><code>arguments</code></a> - <strong>(Optional)</strong> Key parameter for program execution The parameter\nis specified by the function of the user\'s program. MRS is only responsible\nfor loading the parameter. The parameter contains a maximum of 2047 characters,\nexcluding special characters such as ;|&amp;&gt;\'&lt;$, and can be empty.</p>\n</li>',elementType:"li",listDepth:1},{name:"input",description:'<li><p><a name="input"></a><a href="#input"><code>input</code></a> - <strong>(Optional)</strong> Path for inputting data, which must start with / or s3a://.\nA correct OBS path is required. The parameter contains a maximum of 1023 characters,\nexcluding special characters such as ;|&amp;&gt;\'&lt;$, and can be empty.</p>\n</li>',elementType:"li",listDepth:1},{name:"output",description:'<li><p><a name="output"></a><a href="#output"><code>output</code></a> - <strong>(Optional)</strong> Path for outputting data, which must start with / or\ns3a://. A correct OBS path is required. If the path does not exist, the system\nautomatically creates it. The parameter contains a maximum of 1023 characters,\nexcluding special characters such as ;|&amp;&gt;\'&lt;$, and can be empty.</p>\n</li>',elementType:"li",listDepth:1},{name:"job_log",description:'<li><p><a name="job_log"></a><a href="#job_log"><code>job_log</code></a> - <strong>(Optional)</strong> Path for storing job logs that record job running status.\nThis path must start with / or s3a://. A correct OBS path is required. The parameter\ncontains a maximum of 1023 characters, excluding special characters such as\n;|&amp;&gt;\'&lt;$, and can be empty.</p>\n</li>',elementType:"li",listDepth:1},{name:"shutdown_cluster",description:'<li><p><a name="shutdown_cluster"></a><a href="#shutdown_cluster"><code>shutdown_cluster</code></a> - <strong>(Optional)</strong> Whether to delete the cluster after the jobs\nare complete true: Yes false: No</p>\n</li>',elementType:"li",listDepth:1},{name:"file_action",description:'<li><p><a name="file_action"></a><a href="#file_action"><code>file_action</code></a> - <strong>(Optional)</strong> Data import and export import export</p>\n</li>',elementType:"li",listDepth:1},{name:"submit_job_once_cluster_run",description:'<li><p><a name="submit_job_once_cluster_run"></a><a href="#submit_job_once_cluster_run"><code>submit_job_once_cluster_run</code></a> - <strong>(Required)</strong> true: A job is submitted when a\ncluster is created. false: A job is submitted separately. The parameter is set\nto true in this example.</p>\n</li>',elementType:"li",listDepth:1},{name:"hql",description:'<li><p><a name="hql"></a><a href="#hql"><code>hql</code></a> - <strong>(Optional)</strong> HiveQL statement</p>\n</li>',elementType:"li",listDepth:1},{name:"hive_script_path",description:'<li><p><a name="hive_script_path"></a><a href="#hive_script_path"><code>hive_script_path</code></a> - <strong>(Optional)</strong> SQL program path This parameter is needed\nby Spark Script and Hive Script jobs only and must meet the following requirements:\nContains a maximum of 1023 characters, excluding special characters such as\n;|&amp;&gt;&lt;\'$. The address cannot be empty or full of spaces. Starts with / or s3a://.\nEnds with .sql. sql is case-insensitive.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/mrs_cluster_v1.html",docType:""},{id:58,type:"  opentelekomcloud_mrs_job_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"job_type",description:'<li><p><a name="job_type"></a><a href="#job_type"><code>job_type</code></a> - <strong>(Required)</strong> Job type 1: MapReduce 2: Spark 3: Hive Script 4: HiveQL\n(not supported currently) 5: DistCp, importing and exporting data.  6: Spark\nScript 7: Spark SQL, submitting Spark SQL statements. (not supported in this\nAPIcurrently) NOTE: Spark and Hive jobs can be added to only clusters including\nSpark and Hive components.</p>\n</li>',elementType:"li",listDepth:1},{name:"job_name",description:'<li><p><a name="job_name"></a><a href="#job_name"><code>job_name</code></a> - <strong>(Required)</strong> Job name Contains only 1 to 64 letters, digits, hyphens\n(-), and underscores (_). NOTE: Identical job names are allowed but not recommended.</p>\n</li>',elementType:"li",listDepth:1},{name:"cluster_id",description:'<li><p><a name="cluster_id"></a><a href="#cluster_id"><code>cluster_id</code></a> - <strong>(Required)</strong> Cluster ID</p>\n</li>',elementType:"li",listDepth:1},{name:"jar_path",description:'<li><p><a name="jar_path"></a><a href="#jar_path"><code>jar_path</code></a> - <strong>(Required)</strong> Path of the .jar package or .sql file for program\nexecution The parameter must meet the following requirements: Contains a maximum\nof 1023 characters, excluding special characters such as ;|&amp;&gt;&lt;\'$. The address\ncannot be empty or full of spaces. Starts with / or s3a://. Spark Script must\nend with .sql; while MapReduce and Spark Jar must end with .jar. sql and jar\nare case-insensitive.</p>\n</li>',elementType:"li",listDepth:1},{name:"arguments",description:'<li><p><a name="arguments"></a><a href="#arguments"><code>arguments</code></a> - <strong>(Optional)</strong> Key parameter for program execution. The parameter\nis specified by the function of the user\'s program. MRS is only responsible\nfor loading the parameter. The parameter contains a maximum of 2047 characters,\nexcluding special characters such as ;|&amp;&gt;\'&lt;$, and can be empty.</p>\n</li>',elementType:"li",listDepth:1},{name:"input",description:'<li><p><a name="input"></a><a href="#input"><code>input</code></a> - <strong>(Optional)</strong> Path for inputting data, which must start with / or s3a://.\nA correct OBS path is required. The parameter contains a maximum of 1023 characters,\nexcluding special characters such as ;|&amp;&gt;\'&lt;$, and can be empty.</p>\n</li>',elementType:"li",listDepth:1},{name:"output",description:'<li><p><a name="output"></a><a href="#output"><code>output</code></a> - <strong>(Optional)</strong> Path for outputting data, which must start with / or\ns3a://. A correct OBS path is required. If the path does not exist, the system\nautomatically creates it. The parameter contains a maximum of 1023 characters,\nexcluding special characters such as ;|&amp;&gt;\'&lt;$, and can be empty.</p>\n</li>',elementType:"li",listDepth:1},{name:"job_log",description:'<li><p><a name="job_log"></a><a href="#job_log"><code>job_log</code></a> - <strong>(Optional)</strong> Path for storing job logs that record job running status.\nThis path must start with / or s3a://. A correct OBS path is required. The parameter\ncontains a maximum of 1023 characters, excluding special characters such as\n;|&amp;&gt;\'&lt;$, and can be empty.</p>\n</li>',elementType:"li",listDepth:1},{name:"hive_script_path",description:'<li><p><a name="hive_script_path"></a><a href="#hive_script_path"><code>hive_script_path</code></a> - <strong>(Optional)</strong> SQL program path This parameter is needed\nby Spark Script and Hive Script jobs only and must meet the following requirements:\nContains a maximum of 1023 characters, excluding special characters such as\n;|&amp;&gt;&lt;\'$. The address cannot be empty or full of spaces. Starts with / or s3a://.\nEnds with .sql. sql is case-insensitive.</p>\n</li>',elementType:"li",listDepth:1},{name:"is_protected",description:'<li><p><a name="is_protected"></a><a href="#is_protected"><code>is_protected</code></a> - <strong>(Optional)</strong> Whether a job is protected true false The current\nversion does not support this function.</p>\n</li>',elementType:"li",listDepth:1},{name:"is_public",description:'<li><p><a name="is_public"></a><a href="#is_public"><code>is_public</code></a> - <strong>(Optional)</strong> Whether a job is public true false The current version\ndoes not support this function.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/mrs_job_v1.html",docType:""},{id:59,type:"  opentelekomcloud_nat_gateway_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the nat gateway.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> The description of the nat gateway.</p>\n</li>',elementType:"li",listDepth:1},{name:"spec",description:'<li><p><a name="spec"></a><a href="#spec"><code>spec</code></a> - <strong>(Required)</strong> The specification of the nat gateway, valid values are "1",\n"2", "3", "4".</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The target tenant ID in which to allocate the nat\ngateway. Changing this creates a new nat gateway.</p>\n</li>',elementType:"li",listDepth:1},{name:"router_id",description:'<li><p><a name="router_id"></a><a href="#router_id"><code>router_id</code></a> - <strong>(Required)</strong> ID of the router this nat gateway belongs to. Changing\nthis creates a new nat gateway.</p>\n</li>',elementType:"li",listDepth:1},{name:"internal_network_id",description:'<li><p><a name="internal_network_id"></a><a href="#internal_network_id"><code>internal_network_id</code></a> - <strong>(Required)</strong> ID of the network this nat gateway connects to.\nChanging this creates a new nat gateway.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/nat_gateway_v2.html",docType:""},{id:60,type:"  opentelekomcloud_nat_snat_rule_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"nat_gateway_id",description:'<li><p><a name="nat_gateway_id"></a><a href="#nat_gateway_id"><code>nat_gateway_id</code></a> - <strong>(Required)</strong> ID of the nat gateway this snat rule belongs to.\nChanging this creates a new snat rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"network_id",description:'<li><p><a name="network_id"></a><a href="#network_id"><code>network_id</code></a> - <strong>(Optional)</strong> ID of the network this snat rule connects to. This parameter\nand cidr are alternative. Changing this creates a new snat rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"source_type",description:'<li><p><a name="source_type"></a><a href="#source_type"><code>source_type</code></a> - <strong>(Optional)</strong> 0: Either network_id or cidr can be specified in a VPC. 1:\nOnly cidr can be specified over a dedicated network. Changing this creates a new snat rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"cidr",description:'<li><p><a name="cidr"></a><a href="#cidr"><code>cidr</code></a> - <strong>(Optional)</strong> Specifies CIDR, which can be in the format of a network segment or\na host IP address. This parameter and network_id are alternative. If the value of\nsource_type is 0, the CIDR block must be a subset of the VPC subnet CIDR block. If\nthe value of source_type is 1, the CIDR block must be a CIDR block of Direct Connect\nand cannot conflict with the VPC CIDR blocks. Changing this creates a new snat rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"floating_ip_id",description:'<li><p><a name="floating_ip_id"></a><a href="#floating_ip_id"><code>floating_ip_id</code></a> - <strong>(Required)</strong> ID of the floating ip this snat rule connets to.\nChanging this creates a new snat rule.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/nat_snat_rule_v2.html",docType:""},{id:61,type:"  opentelekomcloud_networking_floatingip_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"pool",description:'<li><p><a name="pool"></a><a href="#pool"><code>pool</code></a> - <strong>(Optional)</strong> The name of the pool from which to obtain the floating\nIP. Default value is admin_external_net. Changing this creates a new floating IP.</p>\n</li>',elementType:"li",listDepth:1},{name:"port_id",description:'<li><p><a name="port_id"></a><a href="#port_id"><code>port_id</code></a> - <strong>(Optional)</strong> ID of an existing port with at least one IP address to\nassociate with this floating IP.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The target tenant ID in which to allocate the floating\nIP, if you specify this together with a port_id, make sure the target port\nbelongs to the same tenant. Changing this creates a new floating IP (which\nmay or may not have a different address)</p>\n</li>',elementType:"li",listDepth:1},{name:"fixed_ip",description:'<li><p><a name="fixed_ip"></a><a href="#fixed_ip"><code>fixed_ip</code></a> - Fixed IP of the port to associate with this floating IP. Required if\nthe port has multiple fixed IPs.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/networking_floatingip_v2.html",docType:""},{id:62,type:"  opentelekomcloud_networking_floatingip_associate_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"floating_ip",description:'<li><p><a name="floating_ip"></a><a href="#floating_ip"><code>floating_ip</code></a> - <strong>(Required)</strong> IP Address of an existing floating IP.</p>\n</li>',elementType:"li",listDepth:1},{name:"port_id",description:'<li><p><a name="port_id"></a><a href="#port_id"><code>port_id</code></a> - <strong>(Required)</strong> ID of an existing port with at least one IP address to\nassociate with this floating IP.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/networking_floatingip_associate_v2.html",docType:""},{id:63,type:"  opentelekomcloud_networking_network_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> The name of the network. Changing this updates the name of\nthe existing network.</p>\n</li>',elementType:"li",listDepth:1},{name:"shared",description:'<li><p><a name="shared"></a><a href="#shared"><code>shared</code></a> - <strong>(Optional)</strong>  Specifies whether the network resource can be accessed\nby any tenant or not. Changing this updates the sharing capabalities of the\nexisting network.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The owner of the network. Required if admin wants to\ncreate a network for another tenant. Changing this creates a new network.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_state_up",description:'<li><p><a name="admin_state_up"></a><a href="#admin_state_up"><code>admin_state_up</code></a> - <strong>(Optional)</strong> The administrative state of the network.\nAcceptable values are "true" and "false". Changing this value updates the\nstate of the existing network.</p>\n</li>',elementType:"li",listDepth:1},{name:"segments",description:'<li><p><a name="segments"></a><a href="#segments"><code>segments</code></a> - <strong>(Optional)</strong> An array of one or more provider segment objects.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>segments</code> block supports:</p>",elementType:"p"},{name:"physical_network",description:"The phisical network where this network is implemented.\n",elementType:"li",listDepth:1},{name:"segmentation_id",description:"An isolated segment on the physical network.\n",elementType:"li",listDepth:1},{name:"network_type",description:"The type of physical network.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/networking_network_v2.html",docType:""},{id:64,type:"  opentelekomcloud_networking_port_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> A unique name for the port. Changing this\nupdates the <code>name</code> of an existing port.</p>\n</li>',elementType:"li",listDepth:1},{name:"network_id",description:'<li><p><a name="network_id"></a><a href="#network_id"><code>network_id</code></a> - <strong>(Required)</strong> The ID of the network to attach the port to. Changing\nthis creates a new port.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_state_up",description:'<li><p><a name="admin_state_up"></a><a href="#admin_state_up"><code>admin_state_up</code></a> - <strong>(Optional)</strong> Administrative up/down status for the port\n(must be "true" or "false" if provided). Changing this updates the\n<code>admin_state_up</code> of an existing port.</p>\n</li>',elementType:"li",listDepth:1},{name:"mac_address",description:'<li><p><a name="mac_address"></a><a href="#mac_address"><code>mac_address</code></a> - <strong>(Optional)</strong> Specify a specific MAC address for the port. Changing\nthis creates a new port.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The owner of the Port. Required if admin wants\nto create a port for another tenant. Changing this creates a new port.</p>\n</li>',elementType:"li",listDepth:1},{name:"device_owner",description:'<li><p><a name="device_owner"></a><a href="#device_owner"><code>device_owner</code></a> - <strong>(Optional)</strong> The device owner of the Port. Changing this creates\na new port.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_group_ids",description:'<li><p><a name="security_group_ids"></a><a href="#security_group_ids"><code>security_group_ids</code></a> - <strong>(Optional)</strong> A list of security group IDs to apply to the\nport. The security groups must be specified by ID and not name (as opposed\nto how they are configured with the Compute Instance).</p>\n</li>',elementType:"li",listDepth:1},{name:"device_id",description:'<li><p><a name="device_id"></a><a href="#device_id"><code>device_id</code></a> - <strong>(Optional)</strong> The ID of the device attached to the port. Changing this\ncreates a new port.</p>\n</li>',elementType:"li",listDepth:1},{name:"fixed_ip",description:'<li><p><a name="fixed_ip"></a><a href="#fixed_ip"><code>fixed_ip</code></a> - <strong>(Optional)</strong> An array of desired IPs for this port. The structure is\ndescribed below.</p>\n</li>',elementType:"li",listDepth:1},{name:"allowed_address_pairs",description:'<li><p><a name="allowed_address_pairs"></a><a href="#allowed_address_pairs"><code>allowed_address_pairs</code></a> - <strong>(Optional)</strong> An IP/MAC Address pair of additional IP\naddresses that can be active on this port. The structure is described\nbelow.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>fixed_ip</code> block supports:</p>",elementType:"p"},{name:"subnet_id",description:'<li><p><a name="subnet_id"></a><a href="#subnet_id"><code>subnet_id</code></a> - <strong>(Required)</strong> Subnet in which to allocate IP address for\nthis port.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_address",description:'<li><p><a name="ip_address"></a><a href="#ip_address"><code>ip_address</code></a> - <strong>(Optional)</strong> IP address desired in the subnet for this port. If\nyou don\'t specify <code>ip_address</code>, an available IP address from the specified\nsubnet will be allocated to this port.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>allowed_address_pairs</code> block supports:</p>",elementType:"p"},{name:"ip_address",description:'<li><p><a name="ip_address-1"></a><a href="#ip_address-1"><code>ip_address</code></a> - <strong>(Required)</strong> The additional IP address.</p>\n</li>',elementType:"li",listDepth:1},{name:"mac_address",description:'<li><p><a name="mac_address-1"></a><a href="#mac_address-1"><code>mac_address</code></a> - <strong>(Optional)</strong> The additional MAC address.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/networking_port_v2.html",docType:""},{id:65,type:"  opentelekomcloud_networking_router_interface_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"router_id",description:'<li><p><a name="router_id"></a><a href="#router_id"><code>router_id</code></a> - <strong>(Required)</strong> ID of the router this interface belongs to. Changing\nthis creates a new router interface.</p>\n</li>',elementType:"li",listDepth:1},{name:"subnet_id",description:'<li><p><a name="subnet_id"></a><a href="#subnet_id"><code>subnet_id</code></a> - ID of the subnet this interface connects to. Changing\nthis creates a new router interface.</p>\n</li>',elementType:"li",listDepth:1},{name:"port_id",description:'<li><p><a name="port_id"></a><a href="#port_id"><code>port_id</code></a> - ID of the port this interface connects to. Changing\nthis creates a new router interface.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/networking_router_interface_v2.html",docType:""},{id:66,type:"  opentelekomcloud_networking_router_route_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"router_id",description:'<li><p><a name="router_id"></a><a href="#router_id"><code>router_id</code></a> - <strong>(Required)</strong> ID of the router this routing entry belongs to. Changing\nthis creates a new routing entry.</p>\n</li>',elementType:"li",listDepth:1},{name:"destination_cidr",description:'<li><p><a name="destination_cidr"></a><a href="#destination_cidr"><code>destination_cidr</code></a> - <strong>(Required)</strong> CIDR block to match on the packet\u2019s destination IP. Changing\nthis creates a new routing entry.</p>\n</li>',elementType:"li",listDepth:1},{name:"next_hop",description:'<li><p><a name="next_hop"></a><a href="#next_hop"><code>next_hop</code></a> - <strong>(Required)</strong> IP address of the next hop gateway.  Changing\nthis creates a new routing entry.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/networking_router_route_v2.html",docType:""},{id:67,type:"  opentelekomcloud_networking_router_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> A unique name for the router. Changing this\nupdates the <code>name</code> of an existing router.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_state_up",description:'<li><p><a name="admin_state_up"></a><a href="#admin_state_up"><code>admin_state_up</code></a> - <strong>(Optional)</strong> Administrative up/down status for the router\n(must be "true" or "false" if provided). Changing this updates the\n<code>admin_state_up</code> of an existing router.</p>\n</li>',elementType:"li",listDepth:1},{name:"distributed",description:'<li><p><a name="distributed"></a><a href="#distributed"><code>distributed</code></a> - <strong>(Optional)</strong> Indicates whether or not to create a\ndistributed router. The default policy setting in Neutron restricts\nusage of this property to administrative users only.</p>\n</li>',elementType:"li",listDepth:1},{name:"external_gateway",description:'<li><p><a name="external_gateway"></a><a href="#external_gateway"><code>external_gateway</code></a> - <strong>(Optional)</strong> The network UUID of an external gateway for\nthe router. A router with an external gateway is required if any compute\ninstances or load balancers will be using floating IPs. Changing this\nupdates the <code>external_gateway</code> of an existing router.</p>\n</li>',elementType:"li",listDepth:1},{name:"enable_snat",description:'<li><p><a name="enable_snat"></a><a href="#enable_snat"><code>enable_snat</code></a> - <strong>(Optional)</strong> Enable Source NAT for the router. Valid values are\n"true" or "false". An <code>external_gateway</code> has to be set in order to set this\nproperty. Changing this updates the <code>enable_snat</code> of the router.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The owner of the floating IP. Required if admin wants\nto create a router for another tenant. Changing this creates a new router.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional driver-specific options.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/networking_router_v2.html",docType:""},{id:68,type:"  opentelekomcloud_networking_subnet_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"network_id",description:'<li><p><a name="network_id"></a><a href="#network_id"><code>network_id</code></a> - <strong>(Required)</strong> The UUID of the parent network. Changing this\ncreates a new subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"cidr",description:'<li><p><a name="cidr"></a><a href="#cidr"><code>cidr</code></a> - <strong>(Required)</strong> CIDR representing IP range for this subnet, based on IP\nversion. Changing this creates a new subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_version",description:'<li><p><a name="ip_version"></a><a href="#ip_version"><code>ip_version</code></a> - <strong>(Optional)</strong> IP version, either 4 (default) or 6. Changing this creates a\nnew subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> The name of the subnet. Changing this updates the name of\nthe existing subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The owner of the subnet. Required if admin wants to\ncreate a subnet for another tenant. Changing this creates a new subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"allocation_pools",description:'<li><p><a name="allocation_pools"></a><a href="#allocation_pools"><code>allocation_pools</code></a> - <strong>(Optional)</strong> An array of sub-ranges of CIDR available for\ndynamic allocation to ports. The allocation_pool object structure is\ndocumented below. Changing this creates a new subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"gateway_ip",description:'<li><p><a name="gateway_ip"></a><a href="#gateway_ip"><code>gateway_ip</code></a> - <strong>(Optional)</strong>  Default gateway used by devices in this subnet.\nLeaving this blank and not setting <code>no_gateway</code> will cause a default\ngateway of <code>.1</code> to be used. Changing this updates the gateway IP of the\nexisting subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"no_gateway",description:'<li><p><a name="no_gateway"></a><a href="#no_gateway"><code>no_gateway</code></a> - <strong>(Optional)</strong> Do not set a gateway IP on this subnet. Changing\nthis removes or adds a default gateway IP of the existing subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"enable_dhcp",description:'<li><p><a name="enable_dhcp"></a><a href="#enable_dhcp"><code>enable_dhcp</code></a> - <strong>(Optional)</strong> The administrative state of the network.\nAcceptable values are "true" and "false". Changing this value enables or\ndisables the DHCP capabilities of the existing subnet. Defaults to true.</p>\n</li>',elementType:"li",listDepth:1},{name:"dns_nameservers",description:'<li><p><a name="dns_nameservers"></a><a href="#dns_nameservers"><code>dns_nameservers</code></a> - <strong>(Optional)</strong> An array of DNS name server names used by hosts\nin this subnet. Changing this updates the DNS name servers for the existing\nsubnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"host_routes",description:'<li><p><a name="host_routes"></a><a href="#host_routes"><code>host_routes</code></a> - <strong>(Optional)</strong> An array of routes that should be used by devices\nwith IPs from this subnet (not including local subnet route). The host_route\nobject structure is documented below. Changing this updates the host routes\nfor the existing subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>allocation_pools</code> block supports:</p>",elementType:"p"},{name:"start",description:'<li><p><a name="start"></a><a href="#start"><code>start</code></a> - <strong>(Required)</strong> The starting address.</p>\n</li>',elementType:"li",listDepth:1},{name:"end",description:'<li><p><a name="end"></a><a href="#end"><code>end</code></a> - <strong>(Required)</strong> The ending address.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>host_routes</code> block supports:</p>",elementType:"p"},{name:"destination_cidr",description:'<li><p><a name="destination_cidr"></a><a href="#destination_cidr"><code>destination_cidr</code></a> - <strong>(Required)</strong> The destination CIDR.</p>\n</li>',elementType:"li",listDepth:1},{name:"next_hop",description:'<li><p><a name="next_hop"></a><a href="#next_hop"><code>next_hop</code></a> - <strong>(Required)</strong> The next hop in the route.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/networking_subnet_v2.html",docType:""},{id:69,type:"  opentelekomcloud_networking_secgroup_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> A unique name for the security group.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A unique name for the security group.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The owner of the security group. Required if admin\nwants to create a port for another tenant. Changing this creates a new\nsecurity group.</p>\n</li>',elementType:"li",listDepth:1},{name:"delete_default_rules",description:'<li><p><a name="delete_default_rules"></a><a href="#delete_default_rules"><code>delete_default_rules</code></a> - <strong>(Optional)</strong> Whether or not to delete the default\negress security rules. This is <code>false</code> by default. See the below note\nfor more information.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/networking_secgroup_v2.html",docType:""},{id:70,type:"  opentelekomcloud_networking_secgroup_rule_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"direction",description:'<li><p><a name="direction"></a><a href="#direction"><code>direction</code></a> - <strong>(Required)</strong> The direction of the rule, valid values are <strong>ingress</strong>\nor <strong>egress</strong>. Changing this creates a new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"ethertype",description:'<li><p><a name="ethertype"></a><a href="#ethertype"><code>ethertype</code></a> - <strong>(Required)</strong> The layer 3 protocol type, valid values are <strong>IPv4</strong>\nor <strong>IPv6</strong>. Changing this creates a new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="protocol"></a><a href="#protocol"><code>protocol</code></a> - (Optional) The layer 4 protocol type, valid values are following. Changing this creates a new security group rule. This is required if you want to specify a port range.</p>',elementType:"p"},{name:null,description:"<li><strong>tcp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>udp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>icmp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ah</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>dccp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>egp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>esp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>gre</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>igmp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ipv6-encap</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ipv6-frag</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ipv6-icmp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ipv6-nonxt</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ipv6-opts</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ipv6-route</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ospf</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>pgm</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>rsvp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>sctp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>udplite</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>vrrp</strong>\n</li>",elementType:"li",listDepth:2},{name:"port_range_min",description:'<li><p><a name="port_range_min"></a><a href="#port_range_min"><code>port_range_min</code></a> - <strong>(Optional)</strong> The lower part of the allowed port range, valid\ninteger value needs to be between 1 and 65535. Changing this creates a new\nsecurity group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"port_range_max",description:'<li><p><a name="port_range_max"></a><a href="#port_range_max"><code>port_range_max</code></a> - <strong>(Optional)</strong> The higher part of the allowed port range, valid\ninteger value needs to be between 1 and 65535. Changing this creates a new\nsecurity group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"remote_ip_prefix",description:'<li><p><a name="remote_ip_prefix"></a><a href="#remote_ip_prefix"><code>remote_ip_prefix</code></a> - <strong>(Optional)</strong> The remote CIDR, the value needs to be a valid\nCIDR (i.e. 192.168.0.0/16). Changing this creates a new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"remote_group_id",description:'<li><p><a name="remote_group_id"></a><a href="#remote_group_id"><code>remote_group_id</code></a> - <strong>(Optional)</strong> The remote group id, the value needs to be an\nOpenTelekomCloud ID of a security group in the same tenant. Changing this creates\na new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_group_id",description:'<li><p><a name="security_group_id"></a><a href="#security_group_id"><code>security_group_id</code></a> - <strong>(Required)</strong> The security group id the rule should belong\nto, the value needs to be an OpenTelekomCloud ID of a security group in the same\ntenant. Changing this creates a new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The owner of the security group. Required if admin\nwants to create a port for another tenant. Changing this creates a new\nsecurity group rule.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/networking_secgroup_rule_v2.html",docType:""},{id:71,type:"  opentelekomcloud_vpc_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"cidr",description:'<li><p><a name="cidr"></a><a href="#cidr"><code>cidr</code></a> - <strong>(Required)</strong> The range of available subnets in the VPC. The value ranges from 10.0.0.0/8 to 10.255.255.0/24, 172.16.0.0/12 to 172.31.255.0/24, or 192.168.0.0/16 to 192.168.255.0/24.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the VPC. The name must be unique for a tenant. The value is a string of no more than 64 characters and can contain digits, letters, underscores (_), and hyphens (-). Changing this updates the name of the existing VPC.</p>\n</li>',elementType:"li",listDepth:1},{name:"shared",description:'<li><p><a name="shared"></a><a href="#shared"><code>shared</code></a> - <strong>(Optional)</strong> Specifies whether the shared SNAT should be used or not. Is also required  for cross-tenant sharing.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/vpc_v1.html",docType:""},{id:72,type:"  opentelekomcloud_vpc_subnet_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> <strong>(Required)</strong> - The subnet name. The value is a string of 1 to 64 characters that can contain letters, digits, underscores (_), and hyphens (-).</p>\n</li>',elementType:"li",listDepth:1},{name:"cidr",description:'<li><p><a name="cidr"></a><a href="#cidr"><code>cidr</code></a> <strong>(Required)</strong> - Specifies the network segment on which the subnet resides. The value must be in CIDR format. The value must be within the CIDR block of the VPC. The subnet mask cannot be greater than 28. Changing this creates a new Subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"gateway_ip",description:'<li><p><a name="gateway_ip"></a><a href="#gateway_ip"><code>gateway_ip</code></a> <strong>(Required)</strong> - Specifies the gateway of the subnet. The value must be a valid IP address. The value must be an IP address in the subnet segment. Changing this creates a new Subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"vpc_id",description:'<li><p><a name="vpc_id"></a><a href="#vpc_id"><code>vpc_id</code></a> <strong>(Required)</strong> - Specifies the ID of the VPC to which the subnet belongs. Changing this creates a new Subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"dhcp_enable",description:'<li><p><a name="dhcp_enable"></a><a href="#dhcp_enable"><code>dhcp_enable</code></a> <strong>(Optional)</strong> - Specifies whether the DHCP function is enabled for the subnet. The value can be true or false. If this parameter is left blank, it is set to true by default.</p>\n</li>',elementType:"li",listDepth:1},{name:"primary_dns",description:'<li><p><a name="primary_dns"></a><a href="#primary_dns"><code>primary_dns</code></a> <strong>(Optional)</strong> - Specifies the IP address of DNS server 1 on the subnet. The value must be a valid IP address.</p>\n</li>',elementType:"li",listDepth:1},{name:"secondary_dns",description:'<li><p><a name="secondary_dns"></a><a href="#secondary_dns"><code>secondary_dns</code></a> <strong>(Optional)</strong> - Specifies the IP address of DNS server 2 on the subnet. The value must be a valid IP address.</p>\n</li>',elementType:"li",listDepth:1},{name:"dns_list",description:'<li><p><a name="dns_list"></a><a href="#dns_list"><code>dns_list</code></a> <strong>(Optional)</strong> - Specifies the DNS server address list of a subnet. This field is required if you need to use more than two DNS servers. This parameter value is the superset of both DNS server address 1 and DNS server address 2.</p>\n</li>',elementType:"li",listDepth:1},{name:"availability_zone",description:'<li><p><a name="availability_zone"></a><a href="#availability_zone"><code>availability_zone</code></a> <strong>(Optional)</strong> - Identifies the availability zone (AZ) to which the subnet belongs. The value must be an existing AZ in the system. Changing this creates a new Subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"ntp_addresses",description:'<li><p><a name="ntp_addresses"></a><a href="#ntp_addresses"><code>ntp_addresses</code></a> <strong>(Optional)</strong> - Specifies the NTP server address configured for the subnet.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/vpc_subnet_v1.html",docType:""},{id:73,type:"  opentelekomcloud_vpc_route_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"destination",description:'<li><p><a name="destination"></a><a href="#destination"><code>destination</code></a> <strong>(Required)</strong> - Specifies the destination IP address or CIDR block. Changing this creates a new Route.</p>\n</li>',elementType:"li",listDepth:1},{name:"nexthop",description:'<li><p><a name="nexthop"></a><a href="#nexthop"><code>nexthop</code></a> <strong>(Required)</strong> - Specifies the next hop. If the route type is peering, enter the VPC peering connection ID. Changing this creates a new Route.</p>\n</li>',elementType:"li",listDepth:1},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> <strong>(Required)</strong> - Specifies the route type. Currently, the value can only be <strong>peering</strong>. Changing this creates a new Route.</p>\n</li>',elementType:"li",listDepth:1},{name:"vpc_id",description:'<li><p><a name="vpc_id"></a><a href="#vpc_id"><code>vpc_id</code></a> <strong>(Required)</strong> - Specifies the VPC for which a route is to be added. Changing this creates a new Route.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> <strong>(Optional)</strong> - Specifies the tenant ID. Only the administrator can specify the tenant ID of other tenant. Changing this creates a new Route.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/vpc_route_v2.html",docType:""},{id:74,type:"  opentelekomcloud_vpc_peering_connection_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> <strong>(Required)</strong> - Specifies the name of the VPC peering connection. The value can contain 1 to 64 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"vpc_id",description:'<li><p><a name="vpc_id"></a><a href="#vpc_id"><code>vpc_id</code></a> <strong>(Required)</strong> - Specifies the ID of a VPC involved in a VPC peering connection. Changing this creates a new VPC peering connection.</p>\n</li>',elementType:"li",listDepth:1},{name:"peer_vpc_id",description:'<li><p><a name="peer_vpc_id"></a><a href="#peer_vpc_id"><code>peer_vpc_id</code></a> <strong>(Required)</strong> - Specifies the VPC ID of the accepter tenant. Changing this creates a new VPC peering connection.</p>\n</li>',elementType:"li",listDepth:1},{name:"peer_tenant_id",description:'<li><p><a name="peer_tenant_id"></a><a href="#peer_tenant_id"><code>peer_tenant_id</code></a> <strong>(Optional)</strong> - Specified the Tenant Id of the accepter tenant. Changing this creates a new VPC peering connection.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/vpc_peering_v2.html",docType:""},{id:75,type:"  opentelekomcloud_vpc_peering_connection_accepter_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"vpc_peering_connection_id",description:'<li><p><a name="vpc_peering_connection_id"></a><a href="#vpc_peering_connection_id"><code>vpc_peering_connection_id</code></a> <strong>(Required)</strong> - The VPC Peering Connection ID to manage. Changing this creates a new VPC peering connection accepter.</p>\n</li>',elementType:"li",listDepth:1},{name:"accept",description:'<li><p><a name="accept"></a><a href="#accept"><code>accept</code></a> <strong>(Optional)</strong>- Whether or not to accept the peering request. Defaults to <code>false</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"removing-opentelekomcloud_vpc_peering_connection_accepter_v2-from-your-configuration",description:'<h2 id="removing-opentelekomcloud_vpc_peering_connection_accepter_v2-from-your-configuration">\n<a class="anchor" href="#removing-opentelekomcloud_vpc_peering_connection_accepter_v2-from-your-configuration" name="removing-opentelekomcloud_vpc_peering_connection_accepter_v2-from-your-configuration">\xbb</a>\n  Removing opentelekomcloud_vpc_peering_connection_accepter_v2 from your configuration\n</h2>',elementType:"h2"},{name:"",description:"<p>OpenTelekomCloud allows a cross-tenant VPC Peering Connection to be deleted from either the requester's or accepter's side. However, Terraform only allows the VPC Peering Connection to be deleted from the requester's side by removing the corresponding <code>opentelekomcloud_vpc_peering_connection_v2</code> resource from your configuration. Removing a <code>opentelekomcloud_vpc_peering_connection_accepter_v2</code> resource from your configuration will remove it from your state file and management, but will not destroy the VPC Peering Connection.</p>",elementType:"p"}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/vpc_peering_accepter_v2.html",docType:""},{id:76,type:"  opentelekomcloud_networking_vip_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"network_id",description:'<li><p><a name="network_id"></a><a href="#network_id"><code>network_id</code></a> - <strong>(Required)</strong> The ID of the network to attach the vip to.\nChanging this creates a new vip.</p>\n</li>',elementType:"li",listDepth:1},{name:"subnet_id",description:'<li><p><a name="subnet_id"></a><a href="#subnet_id"><code>subnet_id</code></a> - <strong>(Required)</strong> Subnet in which to allocate IP address for this vip.\nChanging this creates a new vip.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_address",description:'<li><p><a name="ip_address"></a><a href="#ip_address"><code>ip_address</code></a> - <strong>(Optional)</strong> IP address desired in the subnet for this vip.\nIf you don\'t specify <code>ip_address</code>, an available IP address from\nthe specified subnet will be allocated to this vip.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> A unique name for the vip.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/networking_vip_v2.html",docType:""},{id:77,type:"  opentelekomcloud_networking_vip_associate_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"vip_id",description:'<li><p><a name="vip_id"></a><a href="#vip_id"><code>vip_id</code></a> - <strong>(Required)</strong> The ID of vip to attach the port to.\nChanging this creates a new vip associate.</p>\n</li>',elementType:"li",listDepth:1},{name:"port_ids",description:'<li><p><a name="port_ids"></a><a href="#port_ids"><code>port_ids</code></a> - <strong>(Required)</strong> An array of one or more IDs of the ports to attach the vip to.\nChanging this creates a new vip associate.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/networking_vip_associate_v2.html",docType:""},{id:78,type:"  opentelekomcloud_rts_stack_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> A unique name for the stack. The value must meet the regular expression rule (<code>^[a-zA-Z][a-zA-Z0-9_.-]{0,254}$</code>). Changing this creates a new stack.</p>\n</li>',elementType:"li",listDepth:1},{name:"template_body",description:'<li><p><a name="template_body"></a><a href="#template_body"><code>template_body</code></a> - (Optional; Required if <code>template_url</code> is empty) Structure containing the template body. The template content must use the yaml syntax.</p>\n</li>',elementType:"li",listDepth:1},{name:"template_url",description:'<li><p><a name="template_url"></a><a href="#template_url"><code>template_url</code></a> - (Optional; Required if <code>template_body</code> is empty) Location of a file containing the template body.</p>\n</li>',elementType:"li",listDepth:1},{name:"environment",description:'<li><p><a name="environment"></a><a href="#environment"><code>environment</code></a> - <strong>(Optional)</strong> Tthe environment information about the stack.</p>\n</li>',elementType:"li",listDepth:1},{name:"files",description:'<li><p><a name="files"></a><a href="#files"><code>files</code></a> - <strong>(Optional)</strong> Files used in the environment.</p>\n</li>',elementType:"li",listDepth:1},{name:"parameters",description:'<li><p><a name="parameters"></a><a href="#parameters"><code>parameters</code></a> - <strong>(Optional)</strong> A list of Parameter structures that specify input parameters for the stack.</p>\n</li>',elementType:"li",listDepth:1},{name:"disable_rollback",description:'<li><p><a name="disable_rollback"></a><a href="#disable_rollback"><code>disable_rollback</code></a> - <strong>(Optional)</strong> Set to true to disable rollback of the stack if stack creation failed.</p>\n</li>',elementType:"li",listDepth:1},{name:"timeout_mins",description:'<li><p><a name="timeout_mins"></a><a href="#timeout_mins"><code>timeout_mins</code></a> - <strong>(Optional)</strong> Specifies the timeout duration.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/rts_stack_v1.html",docType:""},{id:79,type:"  opentelekomcloud_rts_software_config_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the software configuration.</p>\n</li>',elementType:"li",listDepth:1},{name:"group",description:'<li><p><a name="group"></a><a href="#group"><code>group</code></a> - <strong>(Optional)</strong> The namespace that groups this software configuration by when it is delivered to a server.</p>\n</li>',elementType:"li",listDepth:1},{name:"input_values",description:'<li><p><a name="input_values"></a><a href="#input_values"><code>input_values</code></a> - <strong>(Optional)</strong> A list of software configuration inputs.</p>\n</li>',elementType:"li",listDepth:1},{name:"output_values",description:'<li><p><a name="output_values"></a><a href="#output_values"><code>output_values</code></a> - <strong>(Optional)</strong> A list of software configuration outputs.</p>\n</li>',elementType:"li",listDepth:1},{name:"config",description:'<li><p><a name="config"></a><a href="#config"><code>config</code></a> - <strong>(Optional)</strong> The software configuration code.</p>\n</li>',elementType:"li",listDepth:1},{name:"options",description:'<li><p><a name="options"></a><a href="#options"><code>options</code></a> - <strong>(Optional)</strong> The software configuration options.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/rts_software_config_v1.html",docType:""},{id:80,type:"  opentelekomcloud_rts_software_deployment_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"config_id",description:'<li><p><a name="config_id"></a><a href="#config_id"><code>config_id</code></a> - <strong>(Required)</strong> The id of the software configuration resource running on an instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"server_id",description:'<li><p><a name="server_id"></a><a href="#server_id"><code>server_id</code></a> - <strong>(Required)</strong> The id of the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"status",description:'<li><p><a name="status"></a><a href="#status"><code>status</code></a> -  <strong>(Optional)</strong> The current status of deployment resources.</p>\n</li>',elementType:"li",listDepth:1},{name:"action",description:'<li><p><a name="action"></a><a href="#action"><code>action</code></a> - <strong>(Optional)</strong> The stack action that triggers this deployment resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"input_values",description:'<li><p><a name="input_values"></a><a href="#input_values"><code>input_values</code></a> - <strong>(Optional)</strong> The input data stored in the form of a key-value pair.</p>\n</li>',elementType:"li",listDepth:1},{name:"output_values",description:'<li><p><a name="output_values"></a><a href="#output_values"><code>output_values</code></a> - <strong>(Optional)</strong> The output data stored in the form of a key-value pair.</p>\n</li>',elementType:"li",listDepth:1},{name:"status_reason",description:'<li><p><a name="status_reason"></a><a href="#status_reason"><code>status_reason</code></a> - <strong>(Optional)</strong> The cause of the current deployment resource status.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The id of the authenticated tenant who can perform operations on the deployment resources.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/rts_software_deployment_v1.html",docType:""},{id:81,type:"  opentelekomcloud_s3_bucket",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"bucket",description:"(Optional, Forces new resource) The name of the bucket. If omitted, Terraform will assign a random, unique name.\n",elementType:"li",listDepth:1},{name:"bucket_prefix",description:"(Optional, Forces new resource) Creates a unique bucket name beginning with the specified prefix. Conflicts with <code>bucket</code>.\n",elementType:"li",listDepth:1},{name:"acl",description:'<strong>(Optional)</strong> The <a href="https://docs.aws.amazon.com/AmazonS3/latest/dev/acl-overview.html#canned-acl">canned ACL</a> to apply. Defaults to "private".\n',elementType:"li",listDepth:1},{name:"policy",description:'<li><p><a name="policy"></a><a href="#policy"><code>policy</code></a> - <strong>(Optional)</strong> A valid <a href="https://docs.aws.amazon.com/AmazonS3/latest/dev/example-bucket-policies.html">bucket policy</a> JSON document. Note that if the policy document is not specific enough (but still valid), Terraform may view the policy as constantly changing in a <code>terraform plan</code>. In this case, please make sure you use the verbose/specific version of the policy.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> A mapping of tags to assign to the bucket.</p>\n</li>',elementType:"li",listDepth:1},{name:"force_destroy",description:'<li><p><a name="force_destroy"></a><a href="#force_destroy"><code>force_destroy</code></a> - (Optional, Default:false ) A boolean that indicates all objects should be deleted from the bucket so that the bucket can be destroyed without error. These objects are <em>not</em> recoverable.</p>\n</li>',elementType:"li",listDepth:1},{name:"website",description:'<li><p><a name="website"></a><a href="#website"><code>website</code></a> - <strong>(Optional)</strong> A website object (documented below).</p>\n</li>',elementType:"li",listDepth:1},{name:"cors_rule",description:'<li><p><a name="cors_rule"></a><a href="#cors_rule"><code>cors_rule</code></a> - <strong>(Optional)</strong> A rule of <a href="https://docs.aws.amazon.com/AmazonS3/latest/dev/cors.html">Cross-Origin Resource Sharing</a> (documented below).</p>\n</li>',elementType:"li",listDepth:1},{name:"versioning",description:'<li><p><a name="versioning"></a><a href="#versioning"><code>versioning</code></a> - <strong>(Optional)</strong> A state of <a href="https://docs.aws.amazon.com/AmazonS3/latest/dev/Versioning.html">versioning</a> (documented below)</p>\n</li>',elementType:"li",listDepth:1},{name:"logging",description:'<li><p><a name="logging"></a><a href="#logging"><code>logging</code></a> - <strong>(Optional)</strong> A settings of <a href="https://docs.aws.amazon.com/AmazonS3/latest/UG/ManagingBucketLogging.html">bucket logging</a> (documented below).</p>\n</li>',elementType:"li",listDepth:1},{name:"lifecycle_rule",description:'<li><p><a name="lifecycle_rule"></a><a href="#lifecycle_rule"><code>lifecycle_rule</code></a> - <strong>(Optional)</strong> A configuration of <a href="http://docs.aws.amazon.com/AmazonS3/latest/dev/object-lifecycle-mgmt.html">object lifecycle management</a> (documented below).\nThe <code>website</code> object supports the following:</p>\n</li>',elementType:"li",listDepth:1},{name:"index_document",description:'<li><p><a name="index_document"></a><a href="#index_document"><code>index_document</code></a> - (Required, unless using <code>redirect_all_requests_to</code>) Amazon S3 returns this index document when requests are made to the root domain or any of the subfolders.</p>\n</li>',elementType:"li",listDepth:1},{name:"error_document",description:'<li><p><a name="error_document"></a><a href="#error_document"><code>error_document</code></a> - <strong>(Optional)</strong> An absolute path to the document to return in case of a 4XX error.</p>\n</li>',elementType:"li",listDepth:1},{name:"redirect_all_requests_to",description:'<li><p><a name="redirect_all_requests_to"></a><a href="#redirect_all_requests_to"><code>redirect_all_requests_to</code></a> - <strong>(Optional)</strong> A hostname to redirect all website requests for this bucket to. Hostname can optionally be prefixed with a protocol (<code>http://</code> or <code>https://</code>) to use when redirecting requests. The default is the protocol that is used in the original request.</p>\n</li>',elementType:"li",listDepth:1},{name:"routing_rules",description:'<li><p><a name="routing_rules"></a><a href="#routing_rules"><code>routing_rules</code></a> - <strong>(Optional)</strong> A json array containing <a href="https://docs.aws.amazon.com/AWSCloudFormation/latest/UserGuide/aws-properties-s3-websiteconfiguration-routingrules.html">routing rules</a>\ndescribing redirect behavior and when redirects are applied.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>cors_rule</code> object supports the following:</p>",elementType:"p"},{name:"allowed_headers",description:" <strong>(Optional)</strong> Specifies which headers are allowed.\n",elementType:"li",listDepth:1},{name:"allowed_methods",description:" <strong>(Required)</strong> Specifies which methods are allowed. Can be <code>GET</code>, <code>PUT</code>, <code>POST</code>, <code>DELETE</code> or <code>HEAD</code>.\n",elementType:"li",listDepth:1},{name:"allowed_origins",description:" <strong>(Required)</strong> Specifies which origins are allowed.\n",elementType:"li",listDepth:1},{name:"expose_headers",description:" <strong>(Optional)</strong> Specifies expose header in the response.\n",elementType:"li",listDepth:1},{name:"max_age_seconds",description:" <strong>(Optional)</strong> Specifies time in seconds that browser can cache the response for a preflight request.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>versioning</code> object supports the following:</p>",elementType:"p"},{name:"enabled",description:"<strong>(Optional)</strong> Enable versioning. Once you version-enable a bucket, it can never return to an unversioned state. You can, however, suspend versioning on that bucket.\n",elementType:"li",listDepth:1},{name:"mfa_delete",description:"<strong>(Optional)</strong> Enable MFA delete for either <code>Change the versioning state of your bucket</code> or <code>Permanently delete an object version</code>. Default is <code>false</code>.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>logging</code> object supports the following:</p>",elementType:"p"},{name:"target_bucket",description:"<strong>(Required)</strong> The name of the bucket that will receive the log objects.\n",elementType:"li",listDepth:1},{name:"target_prefix",description:"<strong>(Optional)</strong> To specify a key prefix for log objects.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>lifecycle_rule</code> object supports the following:</p>",elementType:"p"},{name:"id",description:"<strong>(Optional)</strong> Unique identifier for the rule.\n",elementType:"li",listDepth:1},{name:"prefix",description:"<strong>(Optional)</strong> Object key prefix identifying one or more objects to which the rule applies.\n",elementType:"li",listDepth:1},{name:"enabled",description:"<strong>(Required)</strong> Specifies lifecycle rule status.\n",elementType:"li",listDepth:1},{name:"abort_incomplete_multipart_upload_days",description:" <strong>(Optional)</strong> Specifies the number of days after initiating a multipart upload when the multipart upload must be completed.\n",elementType:"li",listDepth:1},{name:"expiration",description:"<strong>(Optional)</strong> Specifies a period in the object's expire (documented below).\n",elementType:"li",listDepth:1},{name:"noncurrent_version_expiration",description:"<strong>(Optional)</strong> Specifies when noncurrent object versions expire (documented below).\n",elementType:"li",listDepth:1},{name:"",description:"<p>At least one of <code>expiration</code>, <code>noncurrent_version_expiration</code> must be specified.</p>",elementType:"p"},{name:"",description:"<p>The <code>expiration</code> object supports the following</p>",elementType:"p"},{name:"date",description:" <strong>(Optional)</strong> Specifies the date after which you want the corresponding action to take effect.\n",elementType:"li",listDepth:1},{name:"days",description:" <strong>(Optional)</strong> Specifies the number of days after object creation when the specific rule action takes effect.\n",elementType:"li",listDepth:1},{name:"expired_object_delete_marker",description:" <strong>(Optional)</strong> On a versioned bucket (versioning-enabled or versioning-suspended bucket), you can add this element in the lifecycle configuration to direct Amazon S3 to delete expired object delete markers.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>noncurrent_version_expiration</code> object supports the following</p>",elementType:"p"},{name:"days",description:" <strong>(Required)</strong> Specifies the number of days an object is noncurrent object versions expire.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/s3_bucket.html",docType:""},{id:82,type:"  opentelekomcloud_s3_bucket_object",properties:[{name:"",description:'<div class="alert alert-info" role="alert">\n<p><strong>Note:</strong> If you specify <code>content_encoding</code> you are responsible for encoding the body appropriately (i.e. <code>source</code> and <code>content</code> both expect already encoded/compressed bytes)</p>\n</div>',elementType:"div"},{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"bucket",description:"<strong>(Required)</strong> The name of the bucket to put the file in.\n",elementType:"li",listDepth:1},{name:"key",description:"<strong>(Required)</strong> The name of the object once it is in the bucket.\n",elementType:"li",listDepth:1},{name:"source",description:"<strong>(Required)</strong> The path to the source file being uploaded to the bucket.\n",elementType:"li",listDepth:1},{name:"content",description:"(Required unless <code>source</code> given) The literal content being uploaded to the bucket.\n",elementType:"li",listDepth:1},{name:"acl",description:'<strong>(Optional)</strong> The <a href="https://docs.aws.amazon.com/AmazonS3/latest/dev/acl-overview.html#canned-acl">canned ACL</a> to apply. Defaults to "private".\n',elementType:"li",listDepth:1},{name:"cache_control",description:'<strong>(Optional)</strong> Specifies caching behavior along the request/reply chain Read <a href="http://www.w3.org/Protocols/rfc2616/rfc2616-sec14.html#sec14.9">w3c cache_control</a> for further details.\n',elementType:"li",listDepth:1},{name:"content_disposition",description:'<strong>(Optional)</strong> Specifies presentational information for the object. Read <a href="http://www.w3.org/Protocols/rfc2616/rfc2616-sec19.html#sec19.5.1">wc3 content_disposition</a> for further information.\n',elementType:"li",listDepth:1},{name:"content_encoding",description:'<strong>(Optional)</strong> Specifies what content encodings have been applied to the object and thus what decoding mechanisms must be applied to obtain the media-type referenced by the Content-Type header field. Read <a href="http://www.w3.org/Protocols/rfc2616/rfc2616-sec14.html#sec14.11">w3c content encoding</a> for further information.\n',elementType:"li",listDepth:1},{name:"content_language",description:"<strong>(Optional)</strong> The language the content is in e.g. en-US or en-GB.\n",elementType:"li",listDepth:1},{name:"content_type",description:"<strong>(Optional)</strong> A standard MIME type describing the format of the object data, e.g. application/octet-stream. All Valid MIME Types are valid for this input.\n",elementType:"li",listDepth:1},{name:"website_redirect",description:'<strong>(Optional)</strong> Specifies a target URL for <a href="http://docs.aws.amazon.com/AmazonS3/latest/dev/how-to-page-redirect.html">website redirect</a>.\n',elementType:"li",listDepth:1},{name:"etag",description:'<strong>(Optional)</strong> Used to trigger updates. The only meaningful value is <code>${md5(file("path/to/file"))}</code>.\nThis attribute is not compatible with <code>kms_key_id</code>.\n',elementType:"li",listDepth:1},{name:"server_side_encryption",description:'<strong>(Optional)</strong> Specifies server-side encryption of the object in S3. Valid values are "<code>AES256</code>" and "<code>aws:kms</code>".\n',elementType:"li",listDepth:1},{name:"",description:"<p>Either <code>source</code> or <code>content</code> must be provided to specify the bucket content.\nThese two arguments are mutually-exclusive.</p>",elementType:"p"}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/s3_bucket_object.html",docType:""},{id:83,type:"  opentelekomcloud_s3_bucket_policy",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"bucket",description:"<strong>(Required)</strong> The name of the bucket to which to apply the policy.\n",elementType:"li",listDepth:1},{name:"policy",description:"<strong>(Required)</strong> The text of the policy.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/s3_bucket_policy.html",docType:""},{id:84,type:"  opentelekomcloud_sfs_file_system_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"size",description:'<li><p><a name="size"></a><a href="#size"><code>size</code></a> - <strong>(Required)</strong> The size (GB) of the shared file system.</p>\n</li>',elementType:"li",listDepth:1},{name:"share_proto",description:'<li><p><a name="share_proto"></a><a href="#share_proto"><code>share_proto</code></a> - <strong>(Optional)</strong> The protocol for sharing file systems. The default value is NFS.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> The name of the shared file system.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Describes the shared file system.</p>\n</li>',elementType:"li",listDepth:1},{name:"is_public",description:'<li><p><a name="is_public"></a><a href="#is_public"><code>is_public</code></a> - <strong>(Optional)</strong> The level of visibility for the shared file system.</p>\n</li>',elementType:"li",listDepth:1},{name:"metadata",description:'<li><p><a name="metadata"></a><a href="#metadata"><code>metadata</code></a> - <strong>(Optional)</strong> Metadata key and value pairs as a dictionary of strings.Changing this will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"availability_zone",description:'<li><p><a name="availability_zone"></a><a href="#availability_zone"><code>availability_zone</code></a> - <strong>(Optional)</strong> The availability zone name.Changing this parameter will create a new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"access_level",description:'<li><p><a name="access_level"></a><a href="#access_level"><code>access_level</code></a> - <strong>(Required)</strong> The access level of the shared file system. Changing this will create a new access rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"access_type",description:'<li><p><a name="access_type"></a><a href="#access_type"><code>access_type</code></a> - <strong>(Optional)</strong> The type of the share access rule. Changing this will create a new access rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"access_to",description:'<li><p><a name="access_to"></a><a href="#access_to"><code>access_to</code></a> - <strong>(Required)</strong> The access that the back end grants or denies. Changing this will create a new access rule</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/sfs_file_system_v2.html",docType:""},{id:85,type:"  opentelekomcloud_smn_subscription_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"topic_urn",description:'<li><p><a name="topic_urn"></a><a href="#topic_urn"><code>topic_urn</code></a> - <strong>(Required)</strong> Resource identifier of a topic, which is unique.</p>\n</li>',elementType:"li",listDepth:1},{name:"endpoint",description:'<li><p><a name="endpoint"></a><a href="#endpoint"><code>endpoint</code></a> - <strong>(Required)</strong> Message endpoint.\n For an HTTP subscription, the endpoint starts with http://.\n For an HTTPS subscription, the endpoint starts with https://.\n For an email subscription, the endpoint is a mail address.\n For an SMS message subscription, the endpoint is a phone number.</p>\n</li>',elementType:"li",listDepth:1},{name:"protocol",description:'<li><p><a name="protocol"></a><a href="#protocol"><code>protocol</code></a> - <strong>(Required)</strong> Protocol of the message endpoint. Currently, email,\n sms, http, and https are supported.</p>\n</li>',elementType:"li",listDepth:1},{name:"remark",description:'<li><p><a name="remark"></a><a href="#remark"><code>remark</code></a> - <strong>(Optional)</strong> Remark information. The remarks must be a UTF-8-coded\n character string containing 128 bytes.</p>\n</li>',elementType:"li",listDepth:1},{name:"subscription_urn",description:'<li><p><a name="subscription_urn"></a><a href="#subscription_urn"><code>subscription_urn</code></a> - <strong>(Optional)</strong> Resource identifier of a subscription, which\n is unique.</p>\n</li>',elementType:"li",listDepth:1},{name:"owner",description:'<li><p><a name="owner"></a><a href="#owner"><code>owner</code></a> - <strong>(Optional)</strong> Project ID of the topic creator.</p>\n</li>',elementType:"li",listDepth:1},{name:"status",description:'<li><p><a name="status"></a><a href="#status"><code>status</code></a> - <strong>(Optional)</strong> Subscription status.\n 0 indicates that the subscription is not confirmed.\n 1 indicates that the subscription is confirmed.\n 3 indicates that the subscription is canceled.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/smn_subscription_v2.html",docType:""},{id:86,type:"  opentelekomcloud_smn_topic_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the topic to be created.</p>\n</li>',elementType:"li",listDepth:1},{name:"display_name",description:'<li><p><a name="display_name"></a><a href="#display_name"><code>display_name</code></a> - <strong>(Optional)</strong> Topic display name, which is presented as the\nname of the email sender in an email message.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/smn_topic_v2.html",docType:""},{id:87,type:"  opentelekomcloud_sdrs_protectiongroup_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of a protection group.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> The description of a protection group. Changing this creates a new group.</p>\n</li>',elementType:"li",listDepth:1},{name:"source_availability_zone",description:'<li><p><a name="source_availability_zone"></a><a href="#source_availability_zone"><code>source_availability_zone</code></a> - <strong>(Required)</strong> Specifies the source AZ of a protection group. Changing this creates a new group.</p>\n</li>',elementType:"li",listDepth:1},{name:"target_availability_zone",description:'<li><p><a name="target_availability_zone"></a><a href="#target_availability_zone"><code>target_availability_zone</code></a> - <strong>(Required)</strong> Specifies the target AZ of a protection group. Changing this creates a new group.</p>\n</li>',elementType:"li",listDepth:1},{name:"domain_id",description:'<li><p><a name="domain_id"></a><a href="#domain_id"><code>domain_id</code></a> - <strong>(Required)</strong> Specifies the ID of an active-active domain. Changing this creates a new group.</p>\n</li>',elementType:"li",listDepth:1},{name:"source_vpc_id",description:'<li><p><a name="source_vpc_id"></a><a href="#source_vpc_id"><code>source_vpc_id</code></a> - <strong>(Required)</strong> Specifies the ID of the source VPC. Changing this creates a new group.</p>\n</li>',elementType:"li",listDepth:1},{name:"dr_type",description:'<li><p><a name="dr_type"></a><a href="#dr_type"><code>dr_type</code></a> - <strong>(Optional)</strong> Specifies the deployment model. The default value is migration indicating migration within a VPC.\nChanging this creates a new group.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/sdrs_protectiongroup_v1.html",docType:""},{id:88,type:"  opentelekomcloud_vbs_backup_policy_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> <strong>(Required)</strong> - Specifies the policy name. The value is a string of 1 to 64 characters that can contain letters, digits, underscores (_), and hyphens (-). It cannot start with default.</p>\n</li>',elementType:"li",listDepth:1},{name:"start_time",description:'<li><p><a name="start_time"></a><a href="#start_time"><code>start_time</code></a> <strong>(Required)</strong> - Specifies the start time of the backup job.The value is in the HH:mm format.</p>\n</li>',elementType:"li",listDepth:1},{name:"status",description:'<li><p><a name="status"></a><a href="#status"><code>status</code></a> <strong>(Required)</strong> - Specifies the backup policy status. The value can ON or OFF.</p>\n</li>',elementType:"li",listDepth:1},{name:"retain_first_backup",description:'<li><p><a name="retain_first_backup"></a><a href="#retain_first_backup"><code>retain_first_backup</code></a> <strong>(Required)</strong> - Specifies whether to retain the first backup in the current month. Possible values are Y or N.</p>\n</li>',elementType:"li",listDepth:1},{name:"rentention_num",description:'<li><p><a name="rentention_num"></a><a href="#rentention_num"><code>rentention_num</code></a> <strong>(Required)</strong> - Specifies number of retained backups. Minimum value is 2.</p>\n</li>',elementType:"li",listDepth:1},{name:"frequency",description:'<li><p><a name="frequency"></a><a href="#frequency"><code>frequency</code></a> <strong>(Required)</strong> - Specifies the backup interval. The value is in the range of 1 to 14 days.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p><strong>tags</strong> <strong>- (Optional)</strong> Represents the list of tags to be configured for the backup policy.</p>",elementType:"p"},{name:"key",description:'<li><p><a name="key"></a><a href="#key"><code>key</code></a> - <strong>(Required)</strong> Specifies the tag key. A tag key consists of up to 36 characters, chosen from letters, digits, hyphens (-), and underscores (_).</p>\n</li>',elementType:"li",listDepth:1},{name:"value",description:'<li><p><a name="value"></a><a href="#value"><code>value</code></a> - <strong>(Required)</strong> Specifies the tag value. A tag value consists of 0 to 43 characters, chosen from letters, digits, hyphens (-), and underscores (_).</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/vbs_backup_policy_v2.html",docType:""},{id:89,type:"  opentelekomcloud_vbs_backup_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the vbs backup. Changing the parameter will create new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_id",description:'<li><p><a name="volume_id"></a><a href="#volume_id"><code>volume_id</code></a> - <strong>(Required)</strong> The id of the disk to be backed up. Changing the parameter will create new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"snapshot_id",description:'<li><p><a name="snapshot_id"></a><a href="#snapshot_id"><code>snapshot_id</code></a> - <strong>(Optional)</strong> The snapshot id of the disk to be backed up. Changing the parameter will create new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> The description of the vbs backup. Changing the parameter will create new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p><strong>tags</strong> <strong>- (Optional)</strong> List of tags to be configured for the backup resources. Changing the parameter will create new resource.</p>",elementType:"p"},{name:"key",description:'<li><p><a name="key"></a><a href="#key"><code>key</code></a> - <strong>(Required)</strong> Specifies the tag key.</p>\n</li>',elementType:"li",listDepth:1},{name:"value",description:'<li><p><a name="value"></a><a href="#value"><code>value</code></a> - <strong>(Required)</strong> Specifies the tag value.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/vbs_backup_v2.html",docType:""},{id:90,type:"  opentelekomcloud_vbs_backup_share_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"backup_id",description:'<li><p><a name="backup_id"></a><a href="#backup_id"><code>backup_id</code></a> - <strong>(Required)</strong> The ID of the backup to be shared. Changing the parameter will create new resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"to_project_ids",description:'<li><p><a name="to_project_ids"></a><a href="#to_project_ids"><code>to_project_ids</code></a> - <strong>(Required)</strong> The IDs of projects with which the backup is shared. Changing the parameter will create new resource.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/vbs_backup_share_v2.html",docType:""},{id:91,type:"  opentelekomcloud_waf_certificate_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The certificate name. The maximum length is 256 characters. Only digits, letters, underscores(_), and hyphens(-) are allowed.</p>\n</li>',elementType:"li",listDepth:1},{name:"content",description:'<li><p><a name="content"></a><a href="#content"><code>content</code></a> - <strong>(Optional)</strong> The certificate content. Changing this creates a new certificate.</p>\n</li>',elementType:"li",listDepth:1},{name:"key",description:'<li><p><a name="key"></a><a href="#key"><code>key</code></a> - <strong>(Optional)</strong> The private key. Changing this creates a new certificate.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/waf_certificate_v1.html",docType:""},{id:92,type:"  opentelekomcloud_waf_domain_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"hostname",description:'<li><p><a name="hostname"></a><a href="#hostname"><code>hostname</code></a> - <strong>(Required)</strong> The domain name. For example, <a href="http://www.example.com">www.example.com</a> or *.example.com. Changing this creates a new domain.</p>\n</li>',elementType:"li",listDepth:1},{name:"certificate_id",description:'<li><p><a name="certificate_id"></a><a href="#certificate_id"><code>certificate_id</code></a> - <strong>(Optional)</strong> The certificate ID. This parameter is mandatory when front_protocol is set to HTTPS.</p>\n</li>',elementType:"li",listDepth:1},{name:"server",description:'<li><p><a name="server"></a><a href="#server"><code>server</code></a> - <strong>(Required)</strong> Array of server object. The server object structure is documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"proxy",description:'<li><p><a name="proxy"></a><a href="#proxy"><code>proxy</code></a> - <strong>(Required)</strong> Specifies whether a proxy is configured.</p>\n</li>',elementType:"li",listDepth:1},{name:"policy_id",description:'<li><p><a name="policy_id"></a><a href="#policy_id"><code>policy_id</code></a> - The policy ID associate with the domain. Changing this create a new domain.</p>\n</li>',elementType:"li",listDepth:1},{name:"sip_header_name",description:'<li><p><a name="sip_header_name"></a><a href="#sip_header_name"><code>sip_header_name</code></a> - <strong>(Optional)</strong> The type of the source IP header. This parameter is required only when proxy is set to true. The options are as follows: default, cloudflare, akamai, and custom.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="sip_header_list"></a><a href="#sip_header_list"><code>sip_header_list</code></a> - (Optional) Array of HTTP request header for identifying the real source IP address. This parameter is required only when proxy is set to true.</p>',elementType:"p"},{name:"sip_header_name",description:'<li>If <code>sip_header_name</code> is default, <code>sip_header_list</code> is ["X-Forwarded-For"].\n</li>',elementType:"li",listDepth:2},{name:"sip_header_name",description:'<li>If <code>sip_header_name</code> is cloudflare, <code>sip_header_list</code> is ["CF-Connecting-IP", "X-Forwarded-For"].\n</li>',elementType:"li",listDepth:2},{name:"sip_header_name",description:'<li>If <code>sip_header_name</code> is akamai, <code>sip_header_list</code> is ["True-Client-IP"].\n</li>',elementType:"li",listDepth:2},{name:"sip_header_name",description:"<li>If <code>sip_header_name</code> is custom, you can customize a value.\n</li>",elementType:"li",listDepth:2},{name:"",description:"<p>The <code>server</code> block supports:</p>",elementType:"p"},{name:"front_protocol",description:'<li><p><a name="front_protocol"></a><a href="#front_protocol"><code>front_protocol</code></a> - <strong>(Required)</strong> Protocol type of the client. The options are HTTP and HTTPS.</p>\n</li>',elementType:"li",listDepth:1},{name:"back_protocol",description:'<li><p><a name="back_protocol"></a><a href="#back_protocol"><code>back_protocol</code></a> - <strong>(Required)</strong> Protocl used by WAF to forward client requests to the server. The options are HTTP and HTTPS.</p>\n</li>',elementType:"li",listDepth:1},{name:"address",description:'<li><p><a name="address"></a><a href="#address"><code>address</code></a> - <strong>(Required)</strong> IP address or domain name of the web server that the client accesses. For example, 192.168.1.1 or <a href="http://www.a.com">www.a.com</a>.</p>\n</li>',elementType:"li",listDepth:1},{name:"port",description:'<li><p><a name="port"></a><a href="#port"><code>port</code></a> - <strong>(Required)</strong> Port number used by the web server. The value ranges from 0 to 65535, for example, 8080.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/waf_domain_v1.html",docType:""},{id:93,type:"  opentelekomcloud_waf_policy_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The policy name. The maximum length is 256 characters. Only digits, letters, underscores(_), and hyphens(-) are allowed.</p>\n</li>',elementType:"li",listDepth:1},{name:"action",description:'<li><p><a name="action"></a><a href="#action"><code>action</code></a> - <strong>(Optional)</strong> Specifies the protective action after a rule is matched. The action object structure is documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"options",description:'<li><p><a name="options"></a><a href="#options"><code>options</code></a> - <strong>(Optional)</strong> Specifies the protection switches. The options object structure is documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="level"></a><a href="#level"><code>level</code></a> - (Optional) Specifies the protection level.</p>',elementType:"p"},{name:"1",description:": low\n",elementType:"li",listDepth:2},{name:"2",description:": medium\n",elementType:"li",listDepth:2},{name:"3",description:": high\n",elementType:"li",listDepth:2},{name:"list description",description:'<p><a name="full_detection"></a><a href="#full_detection"><code>full_detection</code></a> - (Optional) Specifies the detection mode in Precise Protection.</p>',elementType:"p"},{name:"true",description:": full detection, Full detection finishes all threat detections before blocking requests that meet Precise Protection specified conditions.\n",elementType:"li",listDepth:2},{name:"false",description:": instant detection. Instant detection immediately ends threat detection after blocking a request that meets Precise Protection specified conditions.\n",elementType:"li",listDepth:2},{name:"hosts",description:'<li><p><a name="hosts"></a><a href="#hosts"><code>hosts</code></a> - <strong>(Optional)</strong> An array of the domain IDs.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>action</code> block supports:</p>",elementType:"p"},{name:"list description",description:'<p><a name="category"></a><a href="#category"><code>category</code></a> - (Required) Specifies the protective action.</p>',elementType:"p"},{name:"block",description:": WAF blocks and logs detected attacks.\n",elementType:"li",listDepth:2},{name:"log",description:": WAF logs detected attacks only.\n",elementType:"li",listDepth:2},{name:"",description:"<p>The <code>options</code> block supports:</p>",elementType:"p"},{name:"webattack",description:"<strong>(Optional)</strong> Specifies whether Basic Web Protection is enabled.\n",elementType:"li",listDepth:1},{name:"common",description:"<strong>(Optional)</strong> Specifies whether General Check in Basic Web Protection is enabled.\n",elementType:"li",listDepth:1},{name:"crawler",description:"<strong>(Optional)</strong> Specifies whether the master crawler detection switch in Basic Web Protection is enabled.\n",elementType:"li",listDepth:1},{name:"crawler_engine",description:"<strong>(Optional)</strong> Specifies whether the Search Engine switch in Basic Web Protection is enabled.\n",elementType:"li",listDepth:1},{name:"crawler_scanner",description:"<strong>(Optional)</strong> Specifies whether the Scanner switch in Basic Web Protection is enabled.\n",elementType:"li",listDepth:1},{name:"crawler_script",description:"<strong>(Optional)</strong> Specifies whether the Script Tool switch in Basic Web Protection is enabled.\n",elementType:"li",listDepth:1},{name:"crawler_other",description:"<strong>(Optional)</strong> Specifies whether detection of other crawlers in Basic Web Protection is enabled.\n",elementType:"li",listDepth:1},{name:"webshell",description:"<strong>(Optional)</strong> Specifies whether webshell detection in Basic Web Protection is enabled.\n",elementType:"li",listDepth:1},{name:"cc",description:"<strong>(Optional)</strong> Specifies whether CC Attack Protection is enabled.\n",elementType:"li",listDepth:1},{name:"custom",description:"<strong>(Optional)</strong> Specifies whether Precise Protection is enabled.\n",elementType:"li",listDepth:1},{name:"whiteblackip",description:"<strong>(Optional)</strong> Specifies whether Blacklist and Whitelist is enabled.\n",elementType:"li",listDepth:1},{name:"privacy",description:"<strong>(Optional)</strong> Specifies whether Data Masking is enabled.\n",elementType:"li",listDepth:1},{name:"ignore",description:"<strong>(Optional)</strong> Specifies whether False Alarm Masking is enabled.\n",elementType:"li",listDepth:1},{name:"antitamper",description:"<strong>(Optional)</strong> Specifies whether Web Tamper Protection is enabled.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/waf_policy_v1.html",docType:""},{id:94,type:"  opentelekomcloud_waf_whiteblackip_rule_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"policy_id",description:'<li><p><a name="policy_id"></a><a href="#policy_id"><code>policy_id</code></a> - <strong>(Required)</strong> The WAF policy ID. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"addr",description:'<li><p><a name="addr"></a><a href="#addr"><code>addr</code></a> - <strong>(Required)</strong> Specifies the IP address or range. For example, 192.168.0.125 or 192.168.0.0/24.</p>\n</li>',elementType:"li",listDepth:1},{name:"white",description:'<li><p><a name="white"></a><a href="#white"><code>white</code></a> - <strong>(Optional)</strong> Specifies the IP address type. 1: Whitelist, 0: Blacklist. If you do not configure\nthe white parameter, the value is Blacklist by default.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/waf_whiteblackip_rule_v1.html",docType:""},{id:95,type:"  opentelekomcloud_waf_datamasking_rule_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"policy_id",description:'<li><p><a name="policy_id"></a><a href="#policy_id"><code>policy_id</code></a> - <strong>(Required)</strong> The WAF policy ID. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"url",description:'<li><p><a name="url"></a><a href="#url"><code>url</code></a> - <strong>(Required)</strong> Specifies the URL to which the data masking rule applies.</p>\n</li>',elementType:"li",listDepth:1},{name:"category",description:'<li><p><a name="category"></a><a href="#category"><code>category</code></a> - <strong>(Required)</strong> Specifies the masked field. The options are params and header.</p>\n</li>',elementType:"li",listDepth:1},{name:"index",description:'<li><p><a name="index"></a><a href="#index"><code>index</code></a> - <strong>(Required)</strong> Specifies the masked subfield.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/waf_datamasking_rule_v1.html",docType:""},{id:96,type:"  opentelekomcloud_waf_falsealarmmasking_rule_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"policy_id",description:'<li><p><a name="policy_id"></a><a href="#policy_id"><code>policy_id</code></a> - <strong>(Required)</strong> The WAF policy ID. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"url",description:'<li><p><a name="url"></a><a href="#url"><code>url</code></a> - <strong>(Required)</strong> Specifies a misreported URL excluding a domain name. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"rule",description:'<li><p><a name="rule"></a><a href="#rule"><code>rule</code></a> - <strong>(Required)</strong> Specifies the rule ID, which consists of six digits and cannot be empty. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/waf_falsealarmmasking_rule_v1.html",docType:""},{id:97,type:"  opentelekomcloud_waf_ccattackprotection_rule_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"policy_id",description:'<li><p><a name="policy_id"></a><a href="#policy_id"><code>policy_id</code></a> - <strong>(Required)</strong> The WAF policy ID. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"url",description:'<li><p><a name="url"></a><a href="#url"><code>url</code></a> - <strong>(Required)</strong> Specifies a misreported URL excluding a domain name. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"limit_num",description:'<li><p><a name="limit_num"></a><a href="#limit_num"><code>limit_num</code></a> - <strong>(Required)</strong> Specifies the number of requests allowed from a web visitor in a rate limiting period. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"limit_period",description:'<li><p><a name="limit_period"></a><a href="#limit_period"><code>limit_period</code></a> - <strong>(Required)</strong> Specifies the rate limiting period. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"lock_time",description:'<li><p><a name="lock_time"></a><a href="#lock_time"><code>lock_time</code></a> - <strong>(Optional)</strong> Specifies the lock duration. The value ranges from 0 seconds to 2<sup>32</sup> seconds. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="tag_type"></a><a href="#tag_type"><code>tag_type</code></a> - (Required) Specifies the rate limit mode. Changing this creates a new rule. Valid Options are:</p>',elementType:"p"},{name:"ip",description:"A web visitor is identified by the IP address.\n",elementType:"li",listDepth:2},{name:"cookie",description:"A web visitor is identified by the cookie key value.\n",elementType:"li",listDepth:2},{name:"other",description:"A web visitor is identified by the Referer field(user-defined request source).\n",elementType:"li",listDepth:2},{name:"tag_index",description:'<li><p><a name="tag_index"></a><a href="#tag_index"><code>tag_index</code></a> - <strong>(Optional)</strong> If <code>tag_type</code> is set to <code>cookie</code>, this parameter indicates cookie name. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"tag_category",description:'<li><p><a name="tag_category"></a><a href="#tag_category"><code>tag_category</code></a> - <strong>(Optional)</strong> Specifies the category. The value is <code>referer</code>. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"tag_contents",description:'<li><p><a name="tag_contents"></a><a href="#tag_contents"><code>tag_contents</code></a> - <strong>(Optional)</strong> Specifies the category content. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="action_category"></a><a href="#action_category"><code>action_category</code></a> - (Required) Specifies the action. Changing this creates a new rule. Valid Options are:</p>',elementType:"p"},{name:"block",description:"block the requests.\n",elementType:"li",listDepth:2},{name:"captcha",description:"Verification code. The user needs to enter the correct verification code after blocking to restore the correct access page.\n",elementType:"li",listDepth:2},{name:"block_content_type",description:'<li><p><a name="block_content_type"></a><a href="#block_content_type"><code>block_content_type</code></a> - <strong>(Optional)</strong> Specifies the type of the returned page. The options are <code>application/json</code>, <code>text/html</code>, and <code>text/xml</code>. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"block_content",description:'<li><p><a name="block_content"></a><a href="#block_content"><code>block_content</code></a> - <strong>(Optional)</strong> Specifies the content of the returned page. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/waf_ccattackprotection_rule_v1.html",docType:""},{id:98,type:"  opentelekomcloud_waf_preciseprotection_rule_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"policy_id",description:'<li><p><a name="policy_id"></a><a href="#policy_id"><code>policy_id</code></a> - <strong>(Required)</strong> The WAF policy ID. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> Specifies the name of a precise protection rule. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="time"></a><a href="#time"><code>time</code></a> - (Optional) Specifies the effect time of the precise protection rule. Changing this creates a new rule.</p>',elementType:"p"},{name:"false",description:"The rule takes effect immediately.\n",elementType:"li",listDepth:2},{name:"true",description:"The rule takes effect at the scheduled time.\n",elementType:"li",listDepth:2},{name:"start",description:'<li><p><a name="start"></a><a href="#start"><code>start</code></a> - <strong>(Optional)</strong> Specifies the time when the precise protection rule takes effect. If time is set to true,\neither the start time or the end time must be set. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"end",description:'<li><p><a name="end"></a><a href="#end"><code>end</code></a> - <strong>(Optional)</strong> Specifies the time when the precise protection rule expires. If time is set to true,\neither the start time or the end time must be set. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"conditions",description:'<li><p><a name="conditions"></a><a href="#conditions"><code>conditions</code></a> - <strong>(Required)</strong> Specifies the condition parameters. Changing this creates a new rule.\nThe conditions object structure is documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"action",description:'<li><p><a name="action"></a><a href="#action"><code>action</code></a> - <strong>(Required)</strong> Specifies the protective action after the precise protection rule is matched.\nChanging this creates a new rule. The action object structure is documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"priority",description:'<li><p><a name="priority"></a><a href="#priority"><code>priority</code></a> - <strong>(Optional)</strong> Specifies the priority of a rule being executed. Smaller values correspond to higher priorities.\nIf two rules are assigned with the same priority, the rule added earlier has higher priority, the rule added earlier\nhas higher priority. The value ranges from 0 to 65535. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>conditions</code> block supports:</p>",elementType:"p"},{name:"category",description:'<li><p><a name="category"></a><a href="#category"><code>category</code></a> - <strong>(Required)</strong> Specifies the condition type. The value can be url, user-agent, ip, params, cookie, referer, or header.</p>\n</li>',elementType:"li",listDepth:1},{name:"index",description:'<li><p><a name="index"></a><a href="#index"><code>index</code></a> - <strong>(Optional)</strong> If <code>category</code> is set to cookie, index indicates cookie name, if set to params, index indicates param name,\nif set to header, index indicates an option in the header.</p>\n</li>',elementType:"li",listDepth:1},{name:"logic",description:'<li><p><a name="logic"></a><a href="#logic"><code>logic</code></a> - <strong>(Required)</strong> 1,2,3,4,5,6,7, and 8 indicate include, exclude, equal to, not equal to, prefix is, prefix is not, suffix is,\nand suffix is not, respectively. If <code>category</code> is set to ip, logic can only be 3 or 4.</p>\n</li>',elementType:"li",listDepth:1},{name:"contents",description:'<li><p><a name="contents"></a><a href="#contents"><code>contents</code></a> - <strong>(Required)</strong> Specifies a list of content matching the condition. Currently, only one value is accepted.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>action</code> block supports:</p>",elementType:"p"},{name:"category",description:"<strong>(Required)</strong> Specifies the protective action. The value can be block or pass.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/waf_preciseprotection_rule_v1.html",docType:""},{id:99,type:"  opentelekomcloud_waf_webtamperprotection_rule_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"policy_id",description:'<li><p><a name="policy_id"></a><a href="#policy_id"><code>policy_id</code></a> - <strong>(Required)</strong> The WAF policy ID. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"hostname",description:'<li><p><a name="hostname"></a><a href="#hostname"><code>hostname</code></a> - <strong>(Required)</strong> Specifies the domain name. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"url",description:'<li><p><a name="url"></a><a href="#url"><code>url</code></a> - <strong>(Required)</strong> Specifies the URL protected by the web tamper protection rule, excluding a domain name. Changing this creates a new rule.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opentelekomcloud/r/waf_webtamperprotection_rule_v1.html",docType:""}]}}]);